tring,\n    #[pyo3(get)]\n    pub artist: String,\n    #[pyo3(get)]\n    pub playcount: u32,\n    #[pyo3(get)]\n    pub timestamp: Option\u003cu64\u003e,\n    #[pyo3(get)]\n    pub album: Option\u003cString\u003e,\n    #[pyo3(get)]\n    pub album_artist: Option\u003cString\u003e,\n}\n\n/// Python wrapper for Album\n#[pyclass]\n#[derive(Clone)]\npub struct PyAlbum {\n    #[pyo3(get)]\n    pub name: String,\n    #[pyo3(get)]\n    pub artist: String,\n    #[pyo3(get)]\n    pub playcount: u32,\n    #[pyo3(get)]\n    pub timestamp: Option\u003cu64\u003e,\n}\n\n/// Python wrapper for Artist\n#[pyclass]\n#[derive(Clone)]\npub struct PyArtist {\n    #[pyo3(get)]\n    pub name: String,\n    #[pyo3(get)]\n    pub playcount: u32,\n    #[pyo3(get)]\n    pub timestamp: Option\u003cu64\u003e,\n}\n\n/// Python wrapper for ScrobbleEdit\n#[pyclass]\n#[derive(Clone)]\npub struct PyScrobbleEdit {\n    inner: ScrobbleEdit,\n}\n\n/// Python wrapper for EditResponse\n#[pyclass]\npub struct PyEditResponse {\n    inner: EditResponse,\n}\n\n/// Python wrapper for LastFmEditSession\n#[pyclass]\npub struct PyLastFmEditSession {\n    #[pyo3(get)]\n    pub username: String,\n    #[pyo3(get)]\n    pub base_url: String,\n}\n\nimpl From\u003cTrack\u003e for PyTrack {\n    fn from(track: Track) -\u003e Self {\n        Self {\n            name: track.name,\n            artist: track.artist,\n            playcount: track.playcount,\n            timestamp: track.timestamp,\n            album: track.album,\n            album_artist: track.album_artist,\n        }\n    }\n}\n\nimpl From\u003cAlbum\u003e for PyAlbum {\n    fn from(album: Album) -\u003e Self {\n        Self {\n            name: album.name,\n            artist: album.artist,\n            playcount: album.playcount,\n            timestamp: album.timestamp,\n        }\n    }\n}\n\nimpl From\u003cArtist\u003e for PyArtist {\n    fn from(artist: Artist) -\u003e Self {\n        Self {\n            name: artist.name,\n            playcount: artist.playcount,\n            timestamp: artist.timestamp,\n        }\n    }\n}\n\n#[pymethods]\nimpl PyTrack {\n    #[new]\n    #[pyo3(signature = (name, artist, playcount, timestamp=None, album=None, album_artist=None))]\n    fn new(\n        name: String,\n        artist: String,\n        playcount: u32,\n        timestamp: Option\u003cu64\u003e,\n        album: Option\u003cString\u003e,\n        album_artist: Option\u003cString\u003e,\n    ) -\u003e Self {\n        Self {\n            name,\n            artist,\n            playcount,\n            timestamp,\n            album,\n            album_artist,\n        }\n    }\n\n    fn __str__(\u0026self) -\u003e String {\n        let album_part = if let Some(ref album) = self.album {\n            format!(\" [{}]\", album)\n        } else {\n            String::new()\n        };\n        format!(\"{} - {}{}\", self.artist, self.name, album_part)\n    }\n\n    fn __repr__(\u0026self) -\u003e String {\n        format!(\n            \"PyTrack(name='{}', artist='{}', playcount={}, timestamp={:?}, album={:?}, album_artist={:?})\",\n            self.name, self.artist, self.playcount, self.timestamp, self.album, self.album_artist\n        )\n    }\n}\n\n#[pymethods]\nimpl PyAlbum {\n    #[new]\n    #[pyo3(signature = (name, artist, playcount, timestamp=None))]\n    fn new(name: String, artist: String, playcount: u32, timestamp: Option\u003cu64\u003e) -\u003e Self {\n        Self {\n            name,\n            artist,\n            playcount,\n            timestamp,\n        }\n    }\n\n    fn __str__(\u0026self) -\u003e String {\n        format!(\"{} - {}\", self.artist, self.name)\n    }\n\n    fn __repr__(\u0026self) -\u003e String {\n        format!(\n            \"PyAlbum(name='{}', artist='{}', playcount={}, timestamp={:?})\",\n            self.name, self.artist, self.playcount, self.timestamp\n        )\n    }\n}\n\n#[pymethods]\nimpl PyArtist {\n    #[new]\n    #[pyo3(signature = (name, playcount, timestamp=None))]\n     session: Arc\u003cMutex\u003cLastFmEditSession\u003e\u003e,\n    parser: LastFmParser,\n    broadcaster: Arc\u003cSharedEventBroadcaster\u003e,\n    config: ClientConfig,\n}\n\nimpl LastFmEditClientImpl {\n    /// Custom URL encoding for Last.fm paths\n    fn lastfm_encode(\u0026self, input: \u0026str) -\u003e String {\n        urlencoding::encode(input).to_string()\n    }\n\n    pub fn from_session(\n        client: Box\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n    ) -\u003e Self {\n        Self::from_session_with_arc(Arc::from(client), session)\n    }\n\n    fn from_session_with_arc(\n        client: Arc\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n    ) -\u003e Self {\n        Self::from_session_with_broadcaster_arc(\n            client,\n            session,\n            Arc::new(SharedEventBroadcaster::new()),\n        )\n    }\n\n    pub fn from_session_with_rate_limit_patterns(\n        client: Box\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n        rate_limit_patterns: Vec\u003cString\u003e,\n    ) -\u003e Self {\n        let config = ClientConfig::default()\n            .with_rate_limit_config(RateLimitConfig::default().with_patterns(rate_limit_patterns));\n        Self::from_session_with_client_config(client, session, config)\n    }\n\n    pub async fn login_with_credentials(\n        client: Box\u003cdyn HttpClient + Send + Sync\u003e,\n        username: \u0026str,\n        password: \u0026str,\n    ) -\u003e Result\u003cSelf\u003e {\n        let client_arc: Arc\u003cdyn HttpClient + Send + Sync\u003e = Arc::from(client);\n        let login_manager =\n            crate::login::LoginManager::new(client_arc.clone(), \"https://www.last.fm\".to_string());\n        let session = login_manager.login(username, password).await?;\n        Ok(Self::from_session_with_arc(client_arc, session))\n    }\n\n    pub fn from_session_with_client_config(\n        client: Box\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n        config: ClientConfig,\n    ) -\u003e Self {\n        Self::from_session_with_client_config_arc(Arc::from(client), session, config)\n    }\n\n    pub async fn login_with_credentials_and_client_config(\n        client: Box\u003cdyn HttpClient + Send + Sync\u003e,\n        username: \u0026str,\n        password: \u0026str,\n        config: ClientConfig,\n    ) -\u003e Result\u003cSelf\u003e {\n        let client_arc: Arc\u003cdyn HttpClient + Send + Sync\u003e = Arc::from(client);\n        let login_manager =\n            crate::login::LoginManager::new(client_arc.clone(), \"https://www.last.fm\".to_string());\n        let session = login_manager.login(username, password).await?;\n        Ok(Self::from_session_with_client_config_arc(\n            client_arc, session, config,\n        ))\n    }\n\n    pub fn from_session_with_config(\n        client: Box\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n        retry_config: RetryConfig,\n        rate_limit_config: RateLimitConfig,\n    ) -\u003e Self {\n        Self::from_session_with_config_arc(\n            Arc::from(client),\n            session,\n            retry_config,\n            rate_limit_config,\n        )\n    }\n\n    pub async fn login_with_credentials_and_config(\n        client: Box\u003cdyn HttpClient + Send + Sync\u003e,\n        username: \u0026str,\n        password: \u0026str,\n        retry_config: RetryConfig,\n        rate_limit_config: RateLimitConfig,\n    ) -\u003e Result\u003cSelf\u003e {\n        let client_arc: Arc\u003cdyn HttpClient + Send + Sync\u003e = Arc::from(client);\n        let login_manager =\n            crate::login::LoginManager::new(client_arc.clone(), \"https://www.last.fm\".to_string());\n        let session = login_manager.login(username, password).await?;\n        Ok(Self::from_session_with_config_arc(\n            client_arc,\n            session,\n            retry_config,\n            rate_limit_config,\n        ))\n    }\n\n    fn from_session_with_broadcaster(\n        client: Box\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n        broadcaster: Arc\u003cSharedEventBroadcaster\u003e,\n    ) -\u003e Self {\n        Self::from_session_with_broadcaster_arc(Arc::from(client), session, broadcaster)\n    }\n\n    fn from_session_with_client_config_arc(\n        client: Arc\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n        config: ClientConfig,\n    ) -\u003e Self {\n        Self::from_session_with_client_config_and_broadcaster_arc(\n            client,\n            session,\n            config,\n            Arc::new(SharedEventBroadcaster::new()),\n        )\n    }\n\n    fn from_session_with_config_arc(\n        client: Arc\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n        retry_config: RetryConfig,\n        rate_limit_config: RateLimitConfig,\n    ) -\u003e Self {\n        let config = ClientConfig {\n            retry: retry_config,\n            rate_limit: rate_limit_config,\n            operational_delays: OperationalDelayConfig::default(),\n        };\n        Self::from_session_with_client_config_arc(client, session, config)\n    }\n\n    fn from_session_with_broadcaster_arc(\n        client: Arc\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n        broadcaster: Arc\u003cSharedEventBroadcaster\u003e,\n    ) -\u003e Self {\n        Self::from_session_with_client_config_and_broadcaster_arc(\n            client,\n            session,\n            ClientConfig::default(),\n            broadcaster,\n        )\n    }\n\n    fn from_session_with_client_config_and_broadcaster_arc(\n        client: Arc\u003cdyn HttpClient + Send + Sync\u003e,\n        session: LastFmEditSession,\n        config: ClientConfig,\n        broadcaster: Arc\u003cSharedEventBroadcaster\u003e,\n    ) -\u003e Self {\n        Self {\n            client,\n            session: Arc::new(Mutex::new(session)),\n            parser: LastFmParser::new(),\n            broadcaster,\n            config,\n        }\n    }\n\n    pub fn get_session(\u0026self) -\u003e LastFmEditSession {\n        self.session.lock().unwrap().clone()\n    }\n\n    pub fn with_shared_broadcaster(\u0026self, client: Box\u003cdyn HttpClient + Send + Sync\u003e) -\u003e Self {\n        let session = self.get_session();\n        Self::from_session_with_broadcaster(client, session, self.broadcaster.clone())\n    }\n\n    pub fn username(\u0026self) -\u003e String {\n        self.session.lock().unwrap().username.clone()\n    }\n\n    pub async fn validate_session(\u0026self) -\u003e bool {\n        let test_url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/settings/subscription/automatic-edits/tracks\",\n                session.base_url\n            )\n        };\n\n        let mut request = Request::new(Method::Get, test_url.parse::\u003cUrl\u003e().unwrap());\n\n        {\n            let session = self.session.lock().unwrap();\n            headers::add_cookies(\u0026mut request, \u0026session.cookies);\n        }\n\n        headers::add_get_headers(\u0026mut request, false, None);\n\n        match self.client.send(request).await {\n            Ok(response) =\u003e {\n                if response.status() == 302 || response.status() == 301 {\n                    if let Some(location) = response.header(\"location\") {\n                        if let Some(redirect_url) = location.get(0) {\n                            let redirect_url_str = redirect_url.as_str();\n                            let is_valid = !redirect_url_str.contains(\"/login\");\n\n                            return is_valid;\n                        }\n                    }\n                }\n                true\n            }\n            Err(_e) =\u003e false,\n        }\n    }\n\n    pub async fn delete_scrobble(\n        \u0026self,\n        artist_name: \u0026str,\n        track_name: \u0026str,\n        timestamp: u64,\n    ) -\u003e Result\u003cbool\u003e {\n        let config = RetryConfig {\n            max_retries: 3,\n            base_delay: 5,\n            max_delay: 300,\n            enabled: true,\n        };\n\n        let artist_name = artist_name.to_string();\n        let track_name = track_name.to_string();\n        let client = self.clone();\n\n        match retry::retry_with_backoff(\n            config,\n            \"Delete scrobble\",\n            || client.delete_scrobble_impl(\u0026artist_name, \u0026track_name, timestamp),\n            |delay, rate_limit_timestamp, operation_name| {\n                self.broadcast_event(ClientEvent::RateLimited {\n                    delay_seconds: delay,\n                    request: None,\n                    rate_limit_type: RateLimitType::ResponsePattern,\n                    rate_limit_timestamp,\n                });\n                log::debug!(\"{operation_name} rate limited, waiting {delay} seconds\");\n            },\n            |total_duration, _operation_name| {\n                self.broadcast_event(ClientEvent::RateLimitEnded {\n                    request: crate::types::RequestInfo::from_url_and_method(\n                        \u0026format!(\"delete_scrobble/{artist_name}/{track_name}/{timestamp}\"),\n                        \"POST\",\n                    ),\n                    rate_limit_type: RateLimitType::ResponsePattern,\n                    total_rate_limit_duration_seconds: total_duration,\n                });\n            },\n        )\n        .await\n        {\n            Ok(retry_result) =\u003e Ok(retry_result.result),\n            Err(_) =\u003e Ok(false),\n        }\n    }\n\n    async fn delete_scrobble_impl(\n        \u0026self,\n        artist_name: \u0026str,\n        track_name: \u0026str,\n        timestamp: u64,\n    ) -\u003e Result\u003cbool\u003e {\n        let delete_url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library/delete\",\n                session.base_url, session.username\n            )\n        };\n\n        log::debug!(\"Getting fresh CSRF token for delete\");\n        let library_url = {\n            let session = self.session.lock().unwrap();\n            format!(\"{}/user/{}/library\", session.base_url, session.username)\n        };\n\n        let mut response = self.get(\u0026library_url).await?;\n        let content = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        let document = Html::parse_document(\u0026content);\n        let fresh_csrf_token = self.extract_csrf_token(\u0026document)?;\n\n        log::debug!(\"Submitting delete request with fresh token\");\n\n        let mut request = Request::new(Method::Post, delete_url.parse::\u003cUrl\u003e().unwrap());\n\n        let referer_url = {\n            let session = self.session.lock().unwrap();\n            headers::add_cookies(\u0026mut request, \u0026session.cookies);\n            format!(\"{}/user/{}\", session.base_url, session.username)\n        };\n\n        headers::add_edit_headers(\u0026mut request, \u0026referer_url);\n\n        let form_data = [\n            (\"csrfmiddlewaretoken\", fresh_csrf_token.as_str()),\n            (\"artist_name\", artist_name),\n            (\"track_name\", track_name),\n            (\"timestamp\", \u0026timestamp.to_string()),\n            (\"ajax\", \"1\"),\n        ];\n\n        let form_string: String = form_data\n            .iter()\n            .map(|(k, v)| format!(\"{}={}\", urlencoding::encode(k), urlencoding::encode(v)))\n            .collect::\u003cVec\u003c_\u003e\u003e()\n            .join(\"\u0026\");\n\n        request.set_body(form_string);\n\n        log::debug!(\n            \"Deleting scrobble: '{track_name}' by '{artist_name}' with timestamp {timestamp}\"\n        );\n\n        let request_info = RequestInfo::from_url_and_method(\u0026delete_url, \"POST\");\n        let request_start = std::time::Instant::now();\n\n        self.broadcast_event(ClientEvent::RequestStarted {\n            request: request_info.clone(),\n        });\n\n        let mut response = self\n            .client\n            .send(request)\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        self.broadcast_event(ClientEvent::RequestCompleted {\n            request: request_info.clone(),\n            status_code: response.status().into(),\n            duration_ms: request_start.elapsed().as_millis() as u64,\n        });\n\n        log::debug!(\"Delete response status: {}\", response.status());\n\n        let response_text = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        let success = response.status().is_success();\n\n        if success {\n            log::debug!(\"Successfully deleted scrobble\");\n        } else {\n            log::debug!(\"Delete failed with response: {response_text}\");\n        }\n\n        Ok(success)\n    }\n\n    pub fn subscribe(\u0026self) -\u003e ClientEventReceiver {\n        self.broadcaster.subscribe()\n    }\n\n    pub fn latest_event(\u0026self) -\u003e Option\u003cClientEvent\u003e {\n        self.broadcaster.latest_event()\n    }\n\n    fn broadcast_event(\u0026self, event: ClientEvent) {\n        self.broadcaster.broadcast_event(event);\n    }\n\n    pub async fn get_recent_scrobbles(\u0026self, page: u32) -\u003e Result\u003cVec\u003cTrack\u003e\u003e {\n        let url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library?page={}\",\n                session.base_url, session.username, page\n            )\n        };\n\n        log::debug!(\"Fetching recent scrobbles page {page}\");\n        let mut response = self.get(\u0026url).await?;\n        let content = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\n            \"Recent scrobbles response: {} status, {} chars\",\n            response.status(),\n            content.len()\n        );\n\n        let document = Html::parse_document(\u0026content);\n        self.parser.parse_recent_scrobbles(\u0026document)\n    }\n\n    pub async fn get_recent_tracks_page(\u0026self, page: u32) -\u003e Result\u003cTrackPage\u003e {\n        let tracks = self.get_recent_scrobbles(page).await?;\n\n        let has_next_page = !tracks.is_empty();\n\n        Ok(TrackPage {\n            tracks,\n            page_number: page,\n            has_next_page,\n            total_pages: None,\n        })\n    }\n\n    pub async fn find_recent_scrobble_for_track(\n        \u0026self,\n        track_name: \u0026str,\n        artist_name: \u0026str,\n        max_pages: u32,\n    ) -\u003e Result\u003cOption\u003cTrack\u003e\u003e {\n        log::debug!(\"Searching for recent scrobble: '{track_name}' by '{artist_name}'\");\n\n        for page in 1..=max_pages {\n            let scrobbles = self.get_recent_scrobbles(page).await?;\n\n            for scrobble in scrobbles {\n                if scrobble.name == track_name \u0026\u0026 scrobble.artist == artist_name {\n                    log::debug!(\n                        \"Found recent scrobble: '{}' with timestamp {:?}\",\n                        scrobble.name,\n                        scrobble.timestamp\n                    );\n                    return Ok(Some(scrobble));\n                }\n            }\n        }\n\n        log::debug!(\n            \"No recent scrobble found for '{track_name}' by '{artist_name}' in {max_pages} pages\"\n        );\n        Ok(None)\n    }\n\n    pub async fn edit_scrobble(\u0026self, edit: \u0026ScrobbleEdit) -\u003e Result\u003cEditResponse\u003e {\n        let discovered_edits = self.discover_scrobble_edit_variations(edit).await?;\n\n        if discovered_edits.is_empty() {\n            let context = match (\u0026edit.track_name_original, \u0026edit.album_name_original) {\n                (Some(track_name), _) =\u003e {\n                    format!(\"track '{}' by '{}'\", track_name, edit.artist_name_original)\n                }\n                (None, Some(album_name)) =\u003e {\n                    format!(\"album '{}' by '{}'\", album_name, edit.artist_name_original)\n                }\n                (None, None) =\u003e format!(\"artist '{}'\", edit.artist_name_original),\n            };\n            return Err(LastFmError::Parse(format!(\n                \"No scrobbles found for {context}. Make sure the names are correct and that you have scrobbled recently.\"\n            )));\n        }\n\n        log::info!(\n            \"Discovered {} scrobble instances to edit\",\n            discovered_edits.len()\n        );\n\n        let mut all_results = Vec::new();\n\n        for (index, discovered_edit) in discovered_edits.iter().enumerate() {\n            log::debug!(\n                \"Processing scrobble {}/{}: '{}' from '{}'\",\n                index + 1,\n                discovered_edits.len(),\n                discovered_edit.track_name_original,\n                discovered_edit.album_name_original\n            );\n\n            let mut modified_exact_edit = discovered_edit.clone();\n\n            if let Some(new_track_name) = \u0026edit.track_name {\n                modified_exact_edit.track_name = new_track_name.clone();\n            }\n            if let Some(new_album_name) = \u0026edit.album_name {\n                modified_exact_edit.album_name = new_album_name.clone();\n            }\n            modified_exact_edit.artist_name = edit.artist_name.clone();\n            if let Some(new_album_artist_name) = \u0026edit.album_artist_name {\n                modified_exact_edit.album_artist_name = new_album_artist_name.clone();\n            }\n            modified_exact_edit.edit_all = edit.edit_all;\n\n            let album_info = format!(\n                \"{} by {}\",\n                modified_exact_edit.album_name_original,\n                modified_exact_edit.album_artist_name_original\n            );\n\n            let single_response = self.edit_scrobble_single(\u0026modified_exact_edit, 3).await?;\n            let success = single_response.success();\n            let message = single_response.message();\n\n            all_results.push(SingleEditResponse {\n                success,\n                message,\n                album_info: Some(album_info),\n                exact_scrobble_edit: modified_exact_edit.clone(),\n            });\n\n            if index \u003c discovered_edits.len() - 1\n                \u0026\u0026 self.config.operational_delays.edit_delay_ms \u003e 0\n            {\n                tokio::time::sleep(std::time::Duration::from_millis(\n                    self.config.operational_delays.edit_delay_ms,\n                ))\n                .await;\n            }\n        }\n\n        Ok(EditResponse::from_results(all_results))\n    }\n\n    pub async fn edit_scrobble_single(\n        \u0026self,\n        exact_edit: \u0026ExactScrobbleEdit,\n        max_retries: u32,\n    ) -\u003e Result\u003cEditResponse\u003e {\n        let config = RetryConfig {\n            max_retries,\n            base_delay: 5,\n            max_delay: 300,\n            enabled: true,\n        };\n\n        let edit_clone = exact_edit.clone();\n        let client = self.clone();\n\n        match retry::retry_with_backoff(\n            config,\n            \"Edit scrobble\",\n            || client.edit_scrobble_impl(\u0026edit_clone),\n            |delay, rate_limit_timestamp, operation_name| {\n                self.broadcast_event(ClientEvent::RateLimited {\n                    delay_seconds: delay,\n                    request: None, // No specific request context in retry callback\n                    rate_limit_type: RateLimitType::ResponsePattern,\n                    rate_limit_timestamp,\n                });\n                log::debug!(\"{operation_name} rate limited, waiting {delay} seconds\");\n            },\n            |total_duration, _operation_name| {\n                self.broadcast_event(ClientEvent::RateLimitEnded {\n                    request: crate::types::RequestInfo::from_url_and_method(\n                        \u0026format!(\n                            \"edit_scrobble/{}/{}\",\n                            edit_clone.artist_name, edit_clone.track_name\n                        ),\n                        \"POST\",\n                    ),\n                    rate_limit_type: RateLimitType::ResponsePattern,\n                    total_rate_limit_duration_seconds: total_duration,\n                });\n            },\n        )\n        .await\n        {\n            Ok(retry_result) =\u003e Ok(EditResponse::single(\n                retry_result.result,\n                None,\n                None,\n                exact_edit.clone(),\n            )),\n            Err(LastFmError::RateLimit { .. }) =\u003e Ok(EditResponse::single(\n                false,\n                Some(format!(\"Rate limit exceeded after {max_retries} retries\")),\n                None,\n                exact_edit.clone(),\n            )),\n            Err(other_error) =\u003e Ok(EditResponse::single(\n                false,\n                Some(other_error.to_string()),\n                None,\n                exact_edit.clone(),\n            )),\n        }\n    }\n\n    async fn edit_scrobble_impl(\u0026self, exact_edit: \u0026ExactScrobbleEdit) -\u003e Result\u003cbool\u003e {\n        let start_time = std::time::Instant::now();\n        let result = self.edit_scrobble_impl_internal(exact_edit).await;\n        let duration_ms = start_time.elapsed().as_millis() as u64;\n\n        match \u0026result {\n            Ok(success) =\u003e {\n                self.broadcast_event(ClientEvent::EditAttempted {\n                    edit: exact_edit.clone(),\n                    success: *success,\n                    error_message: None,\n                    duration_ms,\n                });\n            }\n            Err(error) =\u003e {\n                self.broadcast_event(ClientEvent::EditAttempted {\n                    edit: exact_edit.clone(),\n                    success: false,\n                    error_message: Some(error.to_string()),\n                    duration_ms,\n                });\n            }\n        }\n\n        result\n    }\n\n    async fn edit_scrobble_impl_internal(\u0026self, exact_edit: \u0026ExactScrobbleEdit) -\u003e Result\u003cbool\u003e {\n        let edit_url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library/edit?edited-variation=library-track-scrobble\",\n                session.base_url, session.username\n            )\n        };\n\n        log::debug!(\"Getting fresh CSRF token for edit\");\n        let form_html = self.get_edit_form_html(\u0026edit_url).await?;\n\n        let form_document = Html::parse_document(\u0026form_html);\n        let fresh_csrf_token = self.extract_csrf_token(\u0026form_document)?;\n\n        log::debug!(\"Submitting edit with fresh token\");\n\n        let form_data = exact_edit.build_form_data(\u0026fresh_csrf_token);\n\n        log::debug!(\n            \"Editing scrobble: '{}' -\u003e '{}'\",\n            exact_edit.track_name_original,\n            exact_edit.track_name\n        );\n        {\n            let session = self.session.lock().unwrap();\n            log::trace!(\"Session cookies count: {}\", session.cookies.len());\n        }\n\n        let mut request = Request::new(Method::Post, edit_url.parse::\u003cUrl\u003e().unwrap());\n\n        let referer_url = {\n            let session = self.session.lock().unwrap();\n            headers::add_cookies(\u0026mut request, \u0026session.cookies);\n            format!(\"{}/user/{}/library\", session.base_url, session.username)\n        };\n\n        headers::add_edit_headers(\u0026mut request, \u0026referer_url);\n\n        let form_string: String = form_data\n            .iter()\n            .map(|(k, v)| format!(\"{}={}\", urlencoding::encode(k), urlencoding::encode(v)))\n            .collect::\u003cVec\u003c_\u003e\u003e()\n            .join(\"\u0026\");\n\n        request.set_body(form_string);\n\n        let request_info = RequestInfo::from_url_and_method(\u0026edit_url, \"POST\");\n        let request_start = std::time::Instant::now();\n\n        self.broadcast_event(ClientEvent::RequestStarted {\n            request: request_info.clone(),\n        });\n\n        let mut response = self\n            .client\n            .send(request)\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        self.broadcast_event(ClientEvent::RequestCompleted {\n            request: request_info.clone(),\n            status_code: response.status().into(),\n            duration_ms: request_start.elapsed().as_millis() as u64,\n        });\n\n        log::debug!(\"Edit response status: {}\", response.status());\n\n        let response_text = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        let analysis = edit_analysis::analyze_edit_response(\u0026response_text, response.status());\n\n        Ok(analysis.success)\n    }\n\n    async fn get_edit_form_html(\u0026self, edit_url: \u0026str) -\u003e Result\u003cString\u003e {\n        let mut form_response = self.get(edit_url).await?;\n        let form_html = form_response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\"Edit form response status: {}\", form_response.status());\n        Ok(form_html)\n    }\n\n    pub async fn load_edit_form_values_internal(\n        \u0026self,\n        track_name: \u0026str,\n        artist_name: \u0026str,\n    ) -\u003e Result\u003cVec\u003cExactScrobbleEdit\u003e\u003e {\n        log::debug!(\"Loading edit form values for '{track_name}' by '{artist_name}'\");\n\n        let base_track_url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library/music/+noredirect/{}/_/{}\",\n                session.base_url,\n                session.username,\n                urlencoding::encode(artist_name),\n                urlencoding::encode(track_name)\n            )\n        };\n\n        log::debug!(\"Fetching track page: {base_track_url}\");\n\n        let mut response = self.get(\u0026base_track_url).await?;\n        let html = response\n            .body_string()\n            .await\n            .map_err(|e| crate::LastFmError::Http(e.to_string()))?;\n\n        let document = Html::parse_document(\u0026html);\n\n        let mut all_scrobble_edits = Vec::new();\n        let mut unique_albums = std::collections::HashSet::new();\n        let max_pages = 5;\n\n        let page_edits = self.extract_scrobble_edits_from_page(\n            \u0026document,\n            track_name,\n            artist_name,\n            \u0026mut unique_albums,\n        )?;\n        all_scrobble_edits.extend(page_edits);\n\n        log::debug!(\n            \"Page 1: found {} unique album variations\",\n            all_scrobble_edits.len()\n        );\n\n        let pagination_selector = Selector::parse(\".pagination .pagination-next\").unwrap();\n        let mut has_next_page = document.select(\u0026pagination_selector).next().is_some();\n        let mut page = 2;\n\n        while has_next_page \u0026\u0026 page \u003c= max_pages {\n            let page_url = {\n                let session = self.session.lock().unwrap();\n                format!(\n                    \"{}/user/{}/library/music/{}/_/{}?page={page}\",\n                    session.base_url,\n                    session.username,\n                    urlencoding::encode(artist_name),\n                    urlencoding::encode(track_name)\n                )\n            };\n\n            log::debug!(\"Fetching page {page} for additional album variations\");\n\n            let mut response = self.get(\u0026page_url).await?;\n            let html = response\n                .body_string()\n                .await\n                .map_err(|e| crate::LastFmError::Http(e.to_string()))?;\n\n            let document = Html::parse_document(\u0026html);\n\n            let page_edits = self.extract_scrobble_edits_from_page(\n                \u0026document,\n                track_name,\n                artist_name,\n                \u0026mut unique_albums,\n            )?;\n\n            let initial_count = all_scrobble_edits.len();\n            all_scrobble_edits.extend(page_edits);\n            let found_new_unique_albums = all_scrobble_edits.len() \u003e initial_count;\n\n            has_next_page = document.select(\u0026pagination_selector).next().is_some();\n\n            log::debug!(\n                \"Page {page}: found {} total unique albums ({})\",\n                all_scrobble_edits.len(),\n                if found_new_unique_albums {\n                    \"new albums found\"\n                } else {\n                    \"no new unique albums\"\n                }\n            );\n\n            page += 1;\n        }\n\n        if all_scrobble_edits.is_empty() {\n            return Err(crate::LastFmError::Parse(format!(\n                \"No scrobble forms found for track '{track_name}' by '{artist_name}'\"\n            )));\n        }\n\n        log::debug!(\n            \"Final result: found {} unique album variations for '{track_name}' by '{artist_name}'\",\n            all_scrobble_edits.len(),\n        );\n\n        Ok(all_scrobble_edits)\n    }\n\n    fn extract_scrobble_edits_from_page(\n        \u0026self,\n        document: \u0026Html,\n        expected_track: \u0026str,\n        expected_artist: \u0026str,\n        unique_albums: \u0026mut std::collections::HashSet\u003c(String, String)\u003e,\n    ) -\u003e Result\u003cVec\u003cExactScrobbleEdit\u003e\u003e {\n        let mut scrobble_edits = Vec::new();\n        let table_selector =\n            Selector::parse(\"table.chartlist:not(.chartlist__placeholder)\").unwrap();\n        let table = document.select(\u0026table_selector).next().ok_or_else(|| {\n            crate::LastFmError::Parse(\"No chartlist table found on track page\".to_string())\n        })?;\n\n        let row_selector = Selector::parse(\"tr\").unwrap();\n        for row in table.select(\u0026row_selector) {\n            let count_bar_link_selector = Selector::parse(\".chartlist-count-bar-link\").unwrap();\n            if row.select(\u0026count_bar_link_selector).next().is_some() {\n                log::debug!(\"Found count bar link, skipping aggregated row\");\n                continue;\n            }\n\n            let form_selector = Selector::parse(\"form[data-edit-scrobble]\").unwrap();\n            if let Some(form) = row.select(\u0026form_selector).next() {\n                let extract_form_value = |name: \u0026str| -\u003e Option\u003cString\u003e {\n                    let selector = Selector::parse(\u0026format!(\"input[name='{name}']\")).unwrap();\n                    form.select(\u0026selector)\n                        .next()\n                        .and_then(|input| input.value().attr(\"value\"))\n                        .map(|s| s.to_string())\n                };\n\n                let form_track = extract_form_value(\"track_name\").unwrap_or_default();\n                let form_artist = extract_form_value(\"artist_name\").unwrap_or_default();\n                let form_album = extract_form_value(\"album_name\").unwrap_or_default();\n                let form_album_artist =\n                    extract_form_value(\"album_artist_name\").unwrap_or_else(|| form_artist.clone());\n                let form_timestamp = extract_form_value(\"timestamp\").unwrap_or_default();\n\n                if form_track == expected_track \u0026\u0026 form_artist == expected_artist {\n                    let album_key = (form_album.clone(), form_album_artist.clone());\n                    if unique_albums.insert(album_key) {\n                        let timestamp = if form_timestamp.is_empty() {\n                            None\n                        } else {\n                            form_timestamp.parse::\u003cu64\u003e().ok()\n                        };\n\n                        if let Some(timestamp) = timestamp {\n                            let scrobble_edit = ExactScrobbleEdit::new(\n                                form_track.clone(),\n                                form_album.clone(),\n                                form_artist.clone(),\n                                form_album_artist.clone(),\n                                form_track,\n                                form_album,\n                                form_artist,\n                                form_album_artist,\n                                timestamp,\n                                true,\n                            );\n                            scrobble_edits.push(scrobble_edit);\n                        } else {\n                            log::warn!(\n                                \"âš ï¸ Skipping form without valid timestamp: '{form_album}' by '{form_album_artist}'\"\n                            );\n                        }\n                    }\n                }\n            }\n        }\n\n        Ok(scrobble_edits)\n    }\n\n    pub async fn get_artist_tracks_page(\u0026self, artist: \u0026str, page: u32) -\u003e Result\u003cTrackPage\u003e {\n        let url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library/music/{}/+tracks?page={}\u0026ajax=true\",\n                session.base_url,\n                session.username,\n                urlencoding::encode(artist),\n                page\n            )\n        };\n\n        log::debug!(\"Fetching tracks page {page} for artist: {artist}\");\n        let mut response = self.get(\u0026url).await?;\n        let content = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\n            \"AJAX response: {} status, {} chars\",\n            response.status(),\n            content.len()\n        );\n\n        log::debug!(\"Parsing HTML response from AJAX endpoint\");\n        let document = Html::parse_document(\u0026content);\n        self.parser.parse_tracks_page(\u0026document, page, artist, None)\n    }\n\n    pub fn extract_tracks_from_document(\n        \u0026self,\n        document: \u0026Html,\n        artist: \u0026str,\n        album: Option\u003c\u0026str\u003e,\n    ) -\u003e Result\u003cVec\u003cTrack\u003e\u003e {\n        self.parser\n            .extract_tracks_from_document(document, artist, album)\n    }\n\n    pub fn parse_tracks_page(\n        \u0026self,\n        document: \u0026Html,\n        page_number: u32,\n        artist: \u0026str,\n        album: Option\u003c\u0026str\u003e,\n    ) -\u003e Result\u003cTrackPage\u003e {\n        self.parser\n            .parse_tracks_page(document, page_number, artist, album)\n    }\n\n    fn extract_csrf_token(\u0026self, document: \u0026Html) -\u003e Result\u003cString\u003e {\n        let csrf_selector = Selector::parse(\"input[name=\\\"csrfmiddlewaretoken\\\"]\").unwrap();\n\n        document\n            .select(\u0026csrf_selector)\n            .next()\n            .and_then(|input| input.value().attr(\"value\"))\n            .map(|token| token.to_string())\n            .ok_or(LastFmError::CsrfNotFound)\n    }\n\n    pub async fn get(\u0026self, url: \u0026str) -\u003e Result\u003cResponse\u003e {\n        self.get_with_retry(url).await\n    }\n\n    async fn get_with_retry(\u0026self, url: \u0026str) -\u003e Result\u003cResponse\u003e {\n        let config = self.config.retry.clone();\n\n        let url_string = url.to_string();\n        let client = self.clone();\n\n        let retry_result = retry::retry_with_backoff(\n            config,\n            \u0026format!(\"GET {url}\"),\n            || async {\n                let mut response = client.get_with_redirects(\u0026url_string, 0).await?;\n\n                let body = client\n                    .extract_response_body(\u0026url_string, \u0026mut response)\n                    .await?;\n\n                if response.status().is_success() \u0026\u0026 client.is_rate_limit_response(\u0026body) {\n                    log::debug!(\"Response body contains rate limit patterns\");\n                    return Err(LastFmError::RateLimit { retry_after: 60 });\n                }\n\n                let mut new_response = http_types::Response::new(response.status());\n                for (name, values) in response.iter() {\n                    for value in values {\n                        let _ = new_response.insert_header(name.clone(), value.clone());\n                    }\n                }\n                new_response.set_body(body);\n\n                Ok(new_response)\n            },\n            |delay, rate_limit_timestamp, operation_name| {\n                self.broadcast_event(ClientEvent::RateLimited {\n                    delay_seconds: delay,\n                    request: None, // No specific request context in retry callback\n                    rate_limit_type: RateLimitType::ResponsePattern,\n                    rate_limit_timestamp,\n                });\n                log::debug!(\"{operation_name} rate limited, waiting {delay} seconds\");\n            },\n            |total_duration, _operation_name| {\n                self.broadcast_event(ClientEvent::RateLimitEnded {\n                    request: crate::types::RequestInfo::from_url_and_method(\u0026url_string, \"GET\"),\n                    rate_limit_type: RateLimitType::ResponsePattern,\n                    total_rate_limit_duration_seconds: total_duration,\n                });\n            },\n        )\n        .await?;\n\n        Ok(retry_result.result)\n    }\n\n    async fn get_with_redirects(\u0026self, url: \u0026str, redirect_count: u32) -\u003e Result\u003cResponse\u003e {\n        if redirect_count \u003e 5 {\n            return Err(LastFmError::Http(\"Too many redirects\".to_string()));\n        }\n\n        let mut request = Request::new(Method::Get, url.parse::\u003cUrl\u003e().unwrap());\n\n        {\n            let session = self.session.lock().unwrap();\n            headers::add_cookies(\u0026mut request, \u0026session.cookies);\n            if session.cookies.is_empty() \u0026\u0026 url.contains(\"page=\") {\n                log::debug!(\"No cookies available for paginated request!\");\n            }\n        }\n\n        let is_ajax = url.contains(\"ajax=true\");\n        let referer_url = if url.contains(\"page=\") {\n            Some(url.split('?').next().unwrap_or(url))\n        } else {\n            None\n        };\n\n        headers::add_get_headers(\u0026mut request, is_ajax, referer_url);\n\n        let request_info = RequestInfo::from_url_and_method(url, \"GET\");\n        let request_start = std::time::Instant::now();\n\n        self.broadcast_event(ClientEvent::RequestStarted {\n            request: request_info.clone(),\n        });\n\n        let response = self\n            .client\n            .send(request)\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        self.broadcast_event(ClientEvent::RequestCompleted {\n            request: request_info.clone(),\n            status_code: response.status().into(),\n            duration_ms: request_start.elapsed().as_millis() as u64,\n        });\n\n        self.extract_cookies(\u0026response);\n\n        if response.status() == 302 || response.status() == 301 {\n            if let Some(location) = response.header(\"location\") {\n                if let Some(redirect_url) = location.get(0) {\n                    let redirect_url_str = redirect_url.as_str();\n                    if url.contains(\"page=\") {\n                        log::debug!(\"Following redirect from {url} to {redirect_url_str}\");\n\n                        if redirect_url_str.contains(\"/login\") {\n                            log::debug!(\"Redirect to login page - authentication failed for paginated request\");\n                            return Err(LastFmError::Auth(\n                                \"Session expired or invalid for paginated request\".to_string(),\n                            ));\n                        }\n                    }\n\n                    let full_redirect_url = if redirect_url_str.starts_with('/') {\n                        let base_url = self.session.lock().unwrap().base_url.clone();\n                        format!(\"{base_url}{redirect_url_str}\")\n                    } else if redirect_url_str.starts_with(\"http\") {\n                        redirect_url_str.to_string()\n                    } else {\n                        let base_url = url\n                            .rsplit('/')\n                            .skip(1)\n                            .collect::\u003cVec\u003c_\u003e\u003e()\n                            .into_iter()\n                            .rev()\n                            .collect::\u003cVec\u003c_\u003e\u003e()\n                            .join(\"/\");\n                        format!(\"{base_url}/{redirect_url_str}\")\n                    };\n\n                    return Box::pin(\n                        self.get_with_redirects(\u0026full_redirect_url, redirect_count + 1),\n                    )\n                    .await;\n                }\n            }\n        }\n\n        if self.config.rate_limit.detect_by_status \u0026\u0026 response.status() == 429 {\n            let retry_after = response\n                .header(\"retry-after\")\n                .and_then(|h| h.get(0))\n                .and_then(|v| v.as_str().parse::\u003cu64\u003e().ok())\n                .unwrap_or(60);\n            self.broadcast_event(ClientEvent::RateLimited {\n                delay_seconds: retry_after,\n                request: Some(request_info.clone()),\n                rate_limit_type: RateLimitType::Http429,\n                rate_limit_timestamp: std::time::SystemTime::now()\n                    .duration_since(std::time::UNIX_EPOCH)\n                    .unwrap_or_default()\n                    .as_secs(),\n            });\n            return Err(LastFmError::RateLimit { retry_after });\n        }\n\n        if self.config.rate_limit.detect_by_status \u0026\u0026 response.status() == 403 {\n            log::debug!(\"Got 403 response, checking if it's a rate limit\");\n            {\n                let session = self.session.lock().unwrap();\n                if !session.cookies.is_empty() {\n                    log::debug!(\"403 on authenticated request - likely rate limit\");\n                    self.broadcast_event(ClientEvent::RateLimited {\n                        delay_seconds: 60,\n                        request: Some(request_info.clone()),\n                        rate_limit_type: RateLimitType::Http403,\n                        rate_limit_timestamp: std::time::SystemTime::now()\n                            .duration_since(std::time::UNIX_EPOCH)\n                            .unwrap_or_default()\n                            .as_secs(),\n                    });\n                    return Err(LastFmError::RateLimit { retry_after: 60 });\n                }\n            }\n        }\n\n        Ok(response)\n    }\n\n    fn is_rate_limit_response(\u0026self, response_body: \u0026str) -\u003e bool {\n        let rate_limit_config = \u0026self.config.rate_limit;\n\n        if !rate_limit_config.detect_by_patterns \u0026\u0026 rate_limit_config.custom_patterns.is_empty() {\n            return false;\n        }\n\n        let body_lower = response_body.to_lowercase();\n\n        for pattern in \u0026rate_limit_config.custom_patterns {\n            if body_lower.contains(\u0026pattern.to_lowercase()) {\n                log::debug!(\"Rate limit detected (custom pattern: '{pattern}')\");\n                return true;\n            }\n        }\n\n        if rate_limit_config.detect_by_patterns {\n            for pattern in \u0026rate_limit_config.patterns {\n                let pattern_lower = pattern.to_lowercase();\n                if body_lower.contains(\u0026pattern_lower) {\n                    log::debug!(\"Rate limit detected (pattern: '{pattern}')\");\n                    return true;\n                }\n            }\n        }\n\n        false\n    }\n\n    fn extract_cookies(\u0026self, response: \u0026Response) {\n        let mut session = self.session.lock().unwrap();\n        extract_cookies_from_response(response, \u0026mut session.cookies);\n    }\n\n    async fn extract_response_body(\u0026self, _url: \u0026str, response: \u0026mut Response) -\u003e Result\u003cString\u003e {\n        let body = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        Ok(body)\n    }\n\n    pub async fn get_artists_page(\u0026self, page: u32) -\u003e Result\u003ccrate::ArtistPage\u003e {\n        let url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library/artists?page={}\",\n                session.base_url, session.username, page\n            )\n        };\n\n        log::debug!(\"Fetching artists page {page}\");\n        let mut response = self.get(\u0026url).await?;\n        let content = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\n            \"Artist library response: {} status, {} chars\",\n            response.status(),\n            content.len()\n        );\n\n        log::debug!(\"Parsing HTML response from artist library endpoint\");\n        let document = Html::parse_document(\u0026content);\n        self.parser.parse_artists_page(\u0026document, page)\n    }\n\n    pub async fn get_artist_albums_page(\u0026self, artist: \u0026str, page: u32) -\u003e Result\u003cAlbumPage\u003e {\n        let url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library/music/{}/+albums?page={}\u0026ajax=true\",\n                session.base_url,\n                session.username,\n                urlencoding::encode(artist),\n                page\n            )\n        };\n\n        log::debug!(\"Fetching albums page {page} for artist: {artist}\");\n        let mut response = self.get(\u0026url).await?;\n        let content = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\n            \"AJAX response: {} status, {} chars\",\n            response.status(),\n            content.len()\n        );\n\n        log::debug!(\"Parsing HTML response from AJAX endpoint\");\n        let document = Html::parse_document(\u0026content);\n        self.parser.parse_albums_page(\u0026document, page, artist)\n    }\n\n    pub async fn get_album_tracks_page(\n        \u0026self,\n        album_name: \u0026str,\n        artist_name: \u0026str,\n        page: u32,\n    ) -\u003e Result\u003cTrackPage\u003e {\n        let url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library/music/{}/{}?page={}\u0026ajax=true\",\n                session.base_url,\n                session.username,\n                self.lastfm_encode(artist_name),\n                self.lastfm_encode(album_name),\n                page\n            )\n        };\n\n        log::debug!(\"Fetching tracks page {page} for album '{album_name}' by '{artist_name}'\");\n        log::debug!(\"ğŸ”— Album URL: {url}\");\n\n        let mut response = self.get(\u0026url).await?;\n        let content = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\n            \"AJAX response: {} status, {} chars\",\n            response.status(),\n            content.len()\n        );\n\n        log::debug!(\"Parsing HTML response from AJAX endpoint\");\n        let document = Html::parse_document(\u0026content);\n        let result =\n            self.parser\n                .parse_tracks_page(\u0026document, page, artist_name, Some(album_name))?;\n\n        // Debug logging for albums that return 0 tracks\n        if result.tracks.is_empty() {\n            if content.contains(\"404\") || content.contains(\"Not Found\") {\n                log::warn!(\"ğŸš¨ 404 ERROR for album '{album_name}' by '{artist_name}': {url}\");\n            } else if content.contains(\"no tracks\") || content.contains(\"no music\") {\n                log::debug!(\"â„¹ï¸  Album '{album_name}' by '{artist_name}' explicitly has no tracks in user's library\");\n            } else {\n                log::warn!(\n                    \"ğŸš¨ UNKNOWN EMPTY RESPONSE for album '{album_name}' by '{artist_name}': {url}\"\n                );\n                log::debug!(\"ğŸ” Response length: {} chars\", content.len());\n                log::debug!(\n                    \"ğŸ” Response preview (first 200 chars): {}\",\n                    \u0026content.chars().take(200).collect::\u003cString\u003e()\n                );\n            }\n        } else {\n            log::debug!(\n                \"âœ… SUCCESS: Album '{album_name}' by '{artist_name}' returned {} tracks\",\n                result.tracks.len()\n            );\n        }\n\n        Ok(result)\n    }\n\n    pub async fn search_tracks_page(\u0026self, query: \u0026str, page: u32) -\u003e Result\u003cTrackPage\u003e {\n        let url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library/tracks/search?page={}\u0026query={}\u0026ajax=1\",\n                session.base_url,\n                session.username,\n                page,\n                urlencoding::encode(query)\n            )\n        };\n\n        log::debug!(\"Searching tracks for query '{query}' on page {page}\");\n        let mut response = self.get(\u0026url).await?;\n        let content = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\n            \"Track search response: {} status, {} chars\",\n            response.status(),\n            content.len()\n        );\n\n        let document = Html::parse_document(\u0026content);\n        let tracks = self.parser.parse_track_search_results(\u0026document)?;\n\n        // For search results, we need to determine pagination differently\n        // since we don't have the same pagination structure as regular library pages\n        let (has_next_page, total_pages) = self.parser.parse_pagination(\u0026document, page)?;\n\n        Ok(TrackPage {\n            tracks,\n            page_number: page,\n            has_next_page,\n            total_pages,\n        })\n    }\n\n    pub async fn search_albums_page(\u0026self, query: \u0026str, page: u32) -\u003e Result\u003cAlbumPage\u003e {\n        let url = {\n            let session = self.session.lock().unwrap();\n            format!(\n                \"{}/user/{}/library/albums/search?page={}\u0026query={}\u0026ajax=1\",\n                session.base_url,\n                session.username,\n                page,\n                urlencoding::encode(query)\n            )\n        };\n\n        log::debug!(\"Searching albums for query '{query}' on page -\u003e Self {\n        let tracks_iterator = crate::AlbumTracksIterator::new(\n            client.clone(),\n            album_name.clone(),\n            edit.artist_name_original.clone(),\n        );\n\n        Self {\n            client,\n            edit,\n            album_name,\n            tracks_iterator,\n            current_track_results: Vec::new(),\n            current_track_index: 0,\n        }\n    }\n}\n\n#[async_trait(?Send)]\nimpl AsyncDiscoveryIterator\u003cExactScrobbleEdit\u003e for AlbumTracksDiscovery {\n    async fn next(\u0026mut self) -\u003e Result\u003cOption\u003cExactScrobbleEdit\u003e\u003e {\n        // If we have results from the current track, return the next one\n        if self.current_track_index \u003c self.current_track_results.len() {\n            let result = self.current_track_results[self.current_track_index].clone();\n            self.current_track_index += 1;\n            return Ok(Some(result));\n        }\n\n        // Get the next track from the iterator\n        while let Some(track) = self.tracks_iterator.next().await? {\n            log::debug!(\n                \"Getting scrobble data for track '{}' from album '{}' by '{}'\",\n                track.name,\n                self.album_name,\n                self.edit.artist_name_original\n            );\n\n            // Get scrobble data for this track\n            match self\n                .client\n                .load_edit_form_values_internal(\u0026track.name, \u0026self.edit.artist_name_original)\n                .await\n            {\n                Ok(track_scrobbles) =\u003e {\n                    // Apply user's changes and filtering\n                    let mut modified_edits = Vec::new();\n                    for scrobble in track_scrobbles {\n                        let mut modified_edit = scrobble.clone();\n                        if let Some(new_track_name) = \u0026self.edit.track_name {\n                            modified_edit.track_name = new_track_name.clone();\n                        }\n                        if let Some(new_album_name) = \u0026self.edit.album_name {\n                            modified_edit.album_name = new_album_name.clone();\n                        }\n                        modified_edit.artist_name = self.edit.artist_name.clone();\n                        if let Some(new_album_artist_name) = \u0026self.edit.album_artist_name {\n                            modified_edit.album_artist_name = new_album_artist_name.clone();\n                        }\n                        modified_edit.edit_all = self.edit.edit_all;\n                        modified_edits.push(modified_edit);\n                    }\n\n                    let filtered_edits =\n                        filter_by_original_album_artist(modified_edits, \u0026self.edit);\n\n                    if !filtered_edits.is_empty() {\n                        // Store results and return the first one\n                        self.current_track_results = filtered_edits;\n                        self.current_track_index = 1; // We'll return the first result below\n                        return Ok(Some(self.current_track_results[0].clone()));\n                    }\n                }\n                Err(e) =\u003e {\n                    log::debug!(\n                        \"Failed to get scrobble data for track '{}': {}\",\n                        track.name,\n                        e\n                    );\n                    // Continue with next track\n                }\n            }\n        }\n\n        // No more tracks\n        Ok(None)\n    }\n}\n","traces":[{"line":23,"address":[3805344,3806184,3806350],"length":1,"stats":{"Line":1}},{"line":25,"address":[6149880,6149933],"length":1,"stats":{"Line":2}},{"line":26,"address":[6050213,6050275],"length":1,"stats":{"Line":2}},{"line":27,"address":[3321851],"length":1,"stats":{"Line":1}},{"line":35,"address":[3322195],"length":1,"stats":{"Line":1}},{"line":43,"address":[56603 );\n        while let Some(item) = self.next().await? {\n            items.push(item);\n        }\n        Ok(items)\n    }\n\n    /// Take the first `n` items from the iterator\n    ///\n    /// This stops after collecting `n` items or when the iterator is exhausted,\n    /// whichever comes first.\n    async fn take(\u0026mut self, n: usize) -\u003e Result\u003cVec\u003cT\u003e\u003e {\n        let mut items = Vec::with_capacity(n);\n        for _ in 0..n {\n            if let Some(item) = self.next().await? {\n                items.push(item);\n            } else {\n                break;\n            }\n        }\n        Ok(items)\n    }\n}\n","traces":[{"line":22,"address":[3544457],"length":1,"stats":{"Line":8}},{"line":23,"address":[6150652,6153372,6152012,6149292],"length":1,"stats":{"Line":2}},{"line":24,"address":[5413609,5414969,5412572,5412983,5410889,5411981,5413341,5413366,5412249,5413932,5414726,5410621,5413282,5410646,5411922,5412006,5415292,5410263,5411212,5411623,5414343,5414701,5410562,5414642],"length":1,"stats":{"Line":8}},{"line":25,"address":[5411151,5413871,5415231,5415277,5411197,5413917,5412557,5412511],"length":1,"stats":{"Line":4}},{"line":27,"address":[3440313,3441609,3439017,3437721],"length":1,"stats":{"Line":2}},{"line":34,"address":[6076862],"length":1,"stats":{"Line":0}},{"line":35,"address":[5889783,5892791,5891287,5894295],"length":1,"stats":{"Line":0}},{"line":36,"address":[5417652,5419156,5420660,5416148,5417639,5417559,5420647,5421255,5416135,5419751,5419063,5416743,5418247,5419143,5416055,5420567],"length":1,"stats":{"Line":0}},{"line":37,"address":[3348868,3352756,3348308,3351364],"length":1,"stats":{"Line":0}},{"line":38,"address":[3659421,3656367,3660879,3657917,3656413,3660925,3657871,3659375],"length":1,"stats":{"Line":0}},{"line":40,"address":[],"length":0,"stats":{"Line":0}},{"line":43,"address":[],"length":0,"stats":{"Line":0}}],"covered":5,"coverable":12},{"path":["/","home","imalison","Projects","lastfm-edit","src","discovery","exact_match.rs"],"content":"use super::common::filter_by_original_album_artist;\nuse crate::{\n    AsyncDiscoveryIterator, ExactScrobbleEdit, LastFmEditClientImpl, LastFmError, Result,\n    ScrobbleEdit,\n};\nuse async_trait::async_trait;\n\n/// Case 1: Exact match discovery (track + album specified)\n///\n/// This discovers the specific scrobble that matches both the track and album,\n/// yielding at most one result.\npub struct ExactMatchDiscovery {\n    client: LastFmEditClientImpl,\n    edit: ScrobbleEdit,\n    track_name: String,\n    album_name: String,\n    result: Option\u003cExactScrobbleEdit\u003e,\n    completed: bool,\n}\n\nimpl ExactMatchDiscovery {\n    pub fn new(\n        client: LastFmEditClientImpl,\n        edit: ScrobbleEdit,\n        track_name: String,\n        album_name: String,\n    ) -\u003e Self {\n        Self {\n            client,\n            edit,\n            track_name,\n            album_name,\n            result: None,\n            completed: false,\n        }\n    }\n}\n\n#[async_trait(?Send)]\nimpl AsyncDiscoveryIterator\u003cExactScrobbleEdit\u003e for ExactMatchDiscovery {\n    async fn next(\u0026mut self) -\u003e Result\u003cOption\u003cExactScrobbleEdit\u003e\u003e {\n        if self.completed {\n            return Ok(None);\n        }\n\n        if self.result.is_none() {\n            // Perform the lookup inline (previously discover_track_album_exact_match)\n            log::debug!(\n                \"Looking up missing metadata for track '{}' on album '{}' by '{}'\",\n                self.track_name,\n                self.album_name,\n                self.edit.artist_name_original\n            );\n\n            match self\n                .client\n                .load_edit_form_values_internal(\u0026self.track_name, \u0026self.edit.artist_name_original)\n                .await\n            {\n                Ok(all_variations) =\u003e {\n                    // Filter by album artist first if specified, then   \"Track '{}' not found on album '{}' by '{}'{} in recent scrobbles\",\n                            self.track_name,\n                            self.album_name,\n                            self.edit.artist_name_original,\n                            album_artist_filter\n                        )));\n                    }\n                }\n                Err(e) =\u003e {\n                    self.completed = true;\n                    return Err(e);\n                }\n            }\n        }\n\n        self.completed = true;\n        Ok(self.result.take())\n    }\n}\n","traces":[{"line":22,"address":[3740448],"length":1,"stats":{"Line":1}},{"line":41,"address":[5740590,5740752,5740975,5741916,5744259,5740528,5740925],"length":1,"stats":{"Line":4}},{"line":42,"address":[3305926],"length":1,"stats":{"Line":1}},{"line":43,"address":[3305984],"length":1,"stats":{"Line":1}},{"line":46,"address":[5662760,5662667],"length":1,"stats":{"Line":2}},{"line":48,"address":[6053594,6053714],"length":1,"stats":{"Line":2}},{"line":55,"address":[3073433,3073120,3073382,3073150,3072536],"length":1,"stats":{"Line":5}},{"line":57,"address":[5467317,5466849],"length":1,"stats":{"Line":2}},{"line":58,"address":[3348183],"length":1,"stats":{"Line":3}},{"line":60,"address":[5836407],"length":1,"stats":{"Line":1}},{"line":62,"address":[3073667],"length":1,"stats":{"Line":1}},{"line":65,"address":[5742430,5742513,5742579],"length":1,"stats":{"Line":3}},{"line":67,"address":[3310128,3310145,3307488],"length":1,"stats":{"Line":3}},{"line":70,"address":[5664427,5664319],"length":1,"stats":{"Line":2}},{"line":71,"address":[3074075,3074436],"length":1,"stats":{"Line":1}},{"line":72,"address":[5743025,5742894,5743044],"length":1,"stats":{"Line":0}},{"line":74,"address":[5468497,5468774,5468997],"length":1,"stats":{"Line":1}},{"line":75,"address":[5837246,5837303,5837322],"length":1,"stats":{"Line":0}},{"line":77,"address":[6055834,6055633,6055853],"length":1,"stats":{"Line":2}},{"line":78," rs all album variations of a specific track by loading the track's\n/// scrobble data incrementally and yielding each variation as it processes them.\n/// This is now truly incremental like the artist and album tracks discovery.\npub struct TrackVariationsDiscovery {\n    client: LastFmEditClientImpl,\n    edit: ScrobbleEdit,\n    track_name: String,\n    scrobbles_loaded: bool,\n    current_results: Vec\u003cExactScrobbleEdit\u003e,\n    current_index: usize,\n}\n\nimpl TrackVariationsDiscovery {\n    pub fn new(client: LastFmEditClientImpl, edit: ScrobbleEdit, track_name: String) -\u003e Self {\n        Self {\n            client,\n            edit,\n            track_name,\n            scrobbles_loaded: false,\n            current_results: Vec::new(),\n            current_index: 0,\n        }\n    }\n}\n\n#[async_trait(?Send)]\nimpl AsyncDiscoveryIterator\u003cExactScrobbleEdit\u003e for TrackVariationsDiscovery {\n    async fn next(\u0026mut self) -\u003e Result\u003cOption\u003cExactScrobbleEdit\u003e\u003e {\n        // If we have results from current batch, return the next one\n        if self.current_index \u003c self.current_results.len() {\n            let result = self.current_results[self.current_index].clone();\n            self.current_index += 1;\n            return Ok(Some(result));\n        }\n\n        // If we haven't loaded scrobbles yet, load them\n        if !self.scrobbles_loaded {\n            log::debug!(\n                \"Getting scrobble data for track '{}' by '{}'\",\n                self.track_name,\n                self.edit.artist_name_original\n            );\n\n            match self\n                .client\n                .load_edit_form_values_internal(\u0026self.track_name, \u0026self.edit.artist_name_original)\n                .await\n            {\n                Ok(track_scrobbles) =\u003e {\n                    // Apply user's changes and filtering\n                    let mut modified_edits = Vec::new();\n                    for scrobble in track_scrobbles {\n                        let mut modified_edit = scrobble.clone();\n                        if let Some(new_track_name) = \u0026self.edit.track_name {\n                            modified_edit.track_name = new_track_name.clone();\n                        }\n                        if let Some(new_album_name) = \u0026self.edit.album_name {\n                            modified_edit.album_name = new_album_name.clone();\n                        }\n                        modified_edit.artist_name = self.edit.artist_name.clone();\n                        if let Some(new_album_artist_name) = \u0026self.edit.album_artist_name {\n                            modified_edit.album_artist_name = new_album_artist_name.clone();\n                        }\n                        modified_edit.edit_all = self.edit.edit_all;\n                        modified_edits.push(modified_edit);\n                    }\n\n                    let filtered_edits =\n                        filter_by_original_album_artist(modified_edits, \u0026self.edit);\n\n                    if !filtered_edits.is_empty() {\n                        // Store results and return the first one\n                        self.current_results = filtered_edits;\n                        self.current_index = 1; // We'll return the first result below\n                        self.scrobbles_loaded = true;\n                        return Ok(Some(self.current_results[0].clone()));\n                    }\n                }\n                Err(e) =\u003e {\n                    log::debug!(\n                        \"Failed to get scrobble data for track '{}': {}\",\n                        self.track_name,\n                        e\n                    );\n                    self.scrobbles_loaded = true;\n                    return Err(e);\n                }\n            }\n            self.scrobbles_loaded = true;\n        }\n\n        // No more results\n        Ok(None)\n    }\n}\n"," ress":[5438129],"length":1,"stats":{"Line":1}},{"line":83,"address":[5606712],"length":1,"stats":{"Line":1}},{"line":84,"address":[3557259],"length":1,"stats":{"Line":1}},{"line":87,"address":[3318280],"length":1,"stats":{"Line":0}},{"line":88,"address":[5440069,5440249,5437200],"length":1,"stats":{"Line":0}},{"line":93,"address":[5440079],"length":1,"stats":{"Line":0}},{"line":94,"address":[3559186],"length":1,"stats":{"Line":0}},{"line":97,"address":[3557430],"length":1,"stats":{"Line":0}},{"line":101,"address":[3555053],"length":1,"stats":{"Line":1}}],"covered":31,"coverable":37},{"path":["/","home","imalison","Projects","lastfm-edit","src","edit_analysis.rs"],"content":"use http_types::StatusCode;\nuse scraper::{Html, Selector};\n\n/// Result of analyzing an edit response from Last.fm\n#[derive(Debug, Clone)]\npub struct EditAnalysisResult {\n    /// Whether the edit was successful based on all indicators\n    pub success: bool,\n    /// Optional detailed message about the result\n    pub message: Option\u003cString\u003e,\n    /// Track name found in the response (if any)\n    pub actual_track_name: Option\u003cString\u003e,\n    /// Album name found in the response (if any)\n    pub actual_album_name: Option\u003cString\u003e,\n}\n\n/// Analyze the HTML response from a Last.fm edit request to determine success/failure\n///\n/// This function parses the response HTML to look for success/error indicators\n/// and extract the actual track/album names that were processed.\n///\n/// # Arguments\n/// * `response_text` - The HTML response body from the edit request\n/// * `status_code` - The HTTP status code of the response\n///\n/// # Returns\n/// An `EditAnalysisResult` containing the analysis results\npub fn analyze_edit_response(response_text: \u0026str, status_code: StatusCode) -\u003e EditAnalysisResult {\n    // Parse the HTML response to check for actual success/failure\n    let document = Html::parse_document(response_text);\n\n    // Check for success indicator\n    let success_selector = Selector::parse(\".alert-success\").unwrap();\n    let error_selector = Selector::parse(\".alert-danger, .alert-error, .error\").unwrap();\n\n    let has_success_alert = document.select(\u0026success_selector).next().is_some();\n    let has_error_alert = document.select(\u0026error_selector).next().is_some();\n\n    // Extract track and album names from the response\n    let (actual_track_name, actual_album_name) =\n        extract_track_album_names(\u0026document, response_text);\n\n    log::debug!(\n        \"Response analysis: success_alert={}, error_alert={}, track='{}', album='{}'\",\n        has_success_alert,\n        has_error_alert,\n        actual_track_name.as_deref().unwrap_or(\"not found\"),\n        actual_album_name.as_deref().unwrap_or(\"not found\")\n    );\n\n    // Determine if edit was truly successful\n    let final_success = status_code.is_success() \u0026\u0026 has_success_alert \u0026\u0026 !has_error_alert;\n\n    // Create detailed message\n    let message = if has_error_alert {\n        // Extract error message\n        if let Some(error_element) = document.select(\u0026error_selector).next() {\n            Some(format!(\n                \"Edit failed: {}\",\n                error_element.text().collect::\u003cString\u003e().trim()\n            ))\n        } else {\n            Some(\"Edit failed with unknown error\".to_string())\n        }\n    } else if final_success {\n        Some(format!(\n            \"Edit successful - Track: '{}', Album: '{}'\",\n            actual_track_name.as_deref().unwrap_or(\"unknown\"),\n            actual_album_name.as_deref().unwrap_or(\"unknown\")\n        ))\n    } else {\n        Some(format!(\"Edit failed with status: {status_code}\"))\n    };\n\n    EditAnalysisResult {\n        success: final_success,\n        message,\n        actual_track_name,\n        actual_album_name,\n    }\n}\n\n/// Extract track and album names from the edit response\n///\n/// This function tries multiple strategies to find the actual track and album names\n/// in the response, including direct CSS selectors and regex patterns.\nfn extract_track_album_names(\n    document: \u0026Html,\n    response_text: \u0026str,\n) -\u003e (Option\u003cString\u003e, Option\u003cString\u003e) {\n    let mut actual_track_name = None;\n    let mut actual_album_name = None;\n\n    // Try direct selectors first\n    let track_name_selector = Selector::parse(\"td.chartlist-name a\").unwrap();\n    let album_name_selector = Selector::parse(\"td.chartlist-album a\").unwrap();\n\n    if let Some(track_element) = document.select(\u0026track_name_selector).next() {\n        actual_track_name = Some(track_element.text().collect::\u003cString\u003e().trim().to_string());\n    }\n\n    if let Some(album_element) = document.select(\u0026album_name_selector).next() {\n        actual_album_name = Some(album_element.text().collect::\u003cString\u003e().trim().to_string());\n    }\n\n    // If not found, try extracting from the raw response text using generic patterns\n    if actual_track_name.is_none() || actual_album_name.is_none() {\n        if actual_track_name.is_none() {\n            actual_track_name = extract_track_name_from_text(response_text);\n        }\n\n        if actual_album_name.is_none() {\n            actual_album_name = extract_album_name_from_text(response_text);\n        }\n    }\n\n    (actual_track_name, actual_album_name)\n}\n\n/// Extract track name from response text using regex patterns\nfn extract_track_name_from_text(response_text: \u0026str) -\u003e Option\u003cString\u003e {\n    // Look for track name in href=\"/music/{artist}/_/{track}\"\n    // Use regex to find track URLs\n    let track_pattern = regex::Regex::new(r#\"href=\"/music/[^\"]+/_/([^\"]+)\"\"#).unwrap();\n    if let Some(captures) = track_pattern.captures(response_text) {\n        if let Some(track_match) = captures.get(1) {\n            let raw_track = track_match.as_str();\n            // URL decode the track name\n            let decoded_track = urlencoding::decode(raw_track)\n                .unwrap_or_else(|_| raw_track.into())\n                .replace('+', \" \");\n            return Some(decoded_track);\n        }\n    }\n    None\n}\n\n/// Extract album name from response text using regex patterns\nfn extract_album_name_from_text(response_text: \u0026str) -\u003e Option\u003cString\u003e {\n    // Look for album name in href=\"/music/{artist}/{album}\"\n    // Find album links that are not track links (don't contain /_/)\n    let album_pattern =\n        regex::Regex::new(r#\"href=\"/music/[^\"]+/([^\"/_]+)\"[^\u003e]*\u003e[^\u003c]*\u003c/a\u003e\"#).unwrap();\n    if let Some(captures) = album_pattern.captures(response_text) {\n        if let Some(album_match) = captures.get(1) {\n            let raw_album = album_match.as_str();\n            // URL decode the album name\n            let decoded_album = urlencoding::decode(raw_album)\n                .unwrap_or_else(|_| raw_album.into())\n                .replace('+', \" \");\n            return Some(decoded_album);\n        }\n    }\n    None\n}\n\n#[cfg(test)]\nmod tests {\n    use super::*;\n\n    #[test]\n    fn test_analyze_success_response() {\n        let html = r#\"\n            \u003cdiv class=\"alert-success\"\u003eEdit successful\u003c/div\u003e\n            \u003ctable\u003e\n                \u003ctr\u003e\n                    \u003ctd class=\"chartlist-name\"\u003e\u003ca href=\"/music/artist/_/track\"\u003eTest Track\u003c/a\u003e\u003c/td\u003e\n                    \u003ctd class=\"chartlist-album\"\u003e\u003ca href=\"/music/artist/album\"\u003eTest Album\u003c/a\u003e\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/table\u003e\n        \"#;\n\n        let result = analyze_edit_response(html, StatusCode::Ok);\n        assert!(result.success);\n        // The CSS selectors should extract the text content of the links\n        assert_eq!(result.actual_track_name, Some(\"Test Track\".to_string()));\n        assert_eq!(result.actual_album_name, Some(\"Test Album\".to_string()));\n    }\n\n    #[test]\n    fn test_analyze_error_response() {\n        let html = r#\"\n            \u003cdiv class=\"alert-danger\"\u003eEdit failed: Invalid data\u003c/div\u003e\n        \"#;\n\n        let result = analyze_edit_response(html, StatusCode::Ok);\n        assert!(!result.success);\n        assert!(result\n            .message\n            .unwrap()\n            .contains(\"Edit failed: Invalid data\"));\n    }\n\n    #[test]\n    fn test_extract_from_regex_patterns() {\n        let html = r#\"\n            Some content with \u003ca href=\"/music/Artist/AlbumName\"\u003ealbum link\u003c/a\u003e\n            and later \u003ca href=\"/music/Artist/_/TrackName\"\u003etrack link\u003c/a\u003e\n        \"#;\n\n        let result = analyze_edit_response(html, StatusCode::Ok);\n        // Should extract from regex patterns when direct selectors fail\n        // The track pattern captures from /_/ URLs, album pattern from non-/_/ URLs\n        assert_eq!(result.actual_track_name, Some(\"TrackName\".to_string()));\n        assert_eq!(result.actual_album_name, Some(\"AlbumName\".to_string()));\n    }\n}\n","traces":[{"line":28,"address":[3731792,3734964,3734837],"length":1,"stats":{"Line":5}},{"line":30,"address":[5976242],"length":1,"stats":{"Line":5}},{"line":33,"address":[5976259,5976334],"length":1,"stats":{"Line":10}},{"line":34,"address":[3424999,3424924],"length":1,"stats":{"Line":10}},{"line":36,"address":[3732204,3732125],"length":1,"stats":{"Line":10}},{"line":37,"address":[5976717],"length":1,"stats":{"Line":5}},{"line":40,"address":[3732539],"length":1,"stats":{"Line":5}},{"line":43,"address":[3425515,3425900,3426031,3425646,3425611],"length":1,"stats":{"Line":3}},{"line":52,"address":[5974590,5973921],"length":1,"stats":{"Line":4}},{"line":55,"address":[3426330],"length":1,"stats":{"Line":2}},{"line":57,"address":[3734353,373
