"Connection\", \"keep-alive\");\n    let _ = request.insert_header(\"sec-ch-ua\", SEC_CH_UA);\n    let _ = request.insert_header(\"sec-ch-ua-mobile\", SEC_CH_UA_MOBILE);\n    let _ = request.insert_header(\"sec-ch-ua-platform\", SEC_CH_UA_PLATFORM);\n}\n\n/// Add headers for AJAX form edit requests\npub fn add_edit_headers(request: \u0026mut Request, referer_url: \u0026str) {\n    add_common_headers(request);\n    let _ = request.insert_header(\"Accept\", \"*/*\");\n    let _ = request.insert_header(\n        \"Content-Type\",\n        \"application/x-www-form-urlencoded;charset=UTF-8\",\n    );\n    let _ = request.insert_header(\"Priority\", \"u=1, i\");\n    let _ = request.insert_header(\"X-Requested-With\", \"XMLHttpRequest\");\n    let _ = request.insert_header(\"Sec-Fetch-Dest\", \"empty\");\n    let _ = request.insert_header(\"Sec-Fetch-Mode\", \"cors\");\n    let _ = request.insert_header(\"Sec-Fetch-Site\", \"same-origin\");\n    let _ = request.insert_header(\"Referer\", referer_url);\n}\n\n/// Add headers for GET requests (regular pages or AJAX)\npub fn add_get_headers(request: \u0026mut Request, is_ajax: bool, referer_url: Option\u003c\u0026str\u003e) {\n    add_common_headers(request);\n\n    if is_ajax {\n        let _ = request.insert_header(\"Accept\", \"*/*\");\n        let _ = request.insert_header(\"X-Requested-With\", \"XMLHttpRequest\");\n    } else {\n        let _ = request.insert_header(\n            \"Accept\",\n            \"text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.7\"\n        );\n        let _ = request.insert_header(\"Upgrade-Insecure-Requests\", \"1\");\n    }\n\n    if let Some(referer) = referer_url {\n        let _ = request.insert_header(\"Referer\", referer);\n    }\n}\n\n/// Add cookies to a request if they exist\npub fn add_cookies(request: \u0026mut Request, cookies: \u0026[String]) {\n    if !cookies.is_empty() {\n        let cookie_header = cookies.join(\"; \");\n        let _ = request.insert_header(\"Cookie\", \u0026cookie_header);\n    }\n}\n","traces":[{"line":13,"address":[6088944],"length":1,"stats":{"Line":9}},{"line":14,"address":[21100713,21100656,21100665,21100704],"length":1,"stats":{"Line":4}},{"line":15,"address":[20842288,20842352,20842308,20842372],"length":1,"stats":{"Line":9}},{"line":16,"address":[21125222],"length":1,"stats":{"Line":4}},{"line":17,"address":[5974387],"length":1,"stats":{"Line":9}},{"line":18,"address":[5824183],"length":1,"stats":{"Line":4}},{"line":19,"address":[20970377],"length":1,"stats":{"Line":9}},{"line":20,"address":[5824297],"length":1,"stats":{"Line":4}},{"line":21,"address":[3612995],"length":1,"stats":{"Line":9}},{"line":25,"address":[2801696],"length":1,"stats":{"Line":1}},{"line":26,"address":[21125312],"length":1,"stats":{"Line":1}},{"line":27,"address":[6089465],"length":1,"stats":{"Line":1}},{"line":28,"address":[5824525],"length":1,"stats":{"Line":1}},{"line":32,"address":[5974833],"length":1,"stats":{"Line":1}},{"line":33,"address":[3613269],"length":1,"stats":{"Line":1}},{"line":34,"address":[5974943],"length":1,"stats":{"Line":1}},{"line":35,"address":[5975001],"length":1,"stats":{"Line":1}},{"line":36,"address":[5975059],"length":1,"stats":{"Line":1}},{"line":37,"address":[5824871],"length":1,"stats":{"Line":1}},{"line":41,"address":[5824928],"length":1,"stats":{"Line":9}},{"line":42,"address":[2802238],"length":1,"stats":{"Line":4}},{"line":44,"address":[6089976],"length":1,"stats":{"Line":4}},{"line":45,"address":[5825105],"length":1,"stats":{"Line":4}},{"line":46,"address":[3613797],"length":1,"stats":{"Line":1}},{"line":48,"address":[5708049],"length":1,"stats":{"Line":5}},{"line":52,"address":[5896869],"length":1,"stats":{"Line":3}},{"line":55,"address":[5975460],"length":1,"stats":{"Line":9}},{"line":56,"address":[5897087],"length":1,"stats":{"Line":2}},{"line":61,"address":[5708605,5708368,5708599],"length":1,"stats":{"Line":4}},{"line":62,"address":[2802642],"length":1,"stats":{"Line":9}},{"line":63,"address":[5708454],"length":1,"stats":{"Line":4}},{"line":64,"address":[3614154,3614080],"length":1,"stats":{"Line":13}}],"covered":32,"coverable":32},{"path":["/","home","imalison","Projects","lastfm-edit","src","iterator.rs"],"content":"use crate::r#trait::LastFmEditClient;\nuse crate::{Album, AlbumPage, Result, Track, TrackPage};\n\nuse async_trait::async_trait;\n\n/// Async iterator trait for paginated Last.fm data.\n///\n/// This trait provides a common interface for iterating over paginated data from Last.fm,\n/// such as tracks, albums, and recent scrobbles. All iterators implement efficient streaming\n/// with automatic pagination and built-in rate limiting.\n///\n/// # Examples\n///\n/// ```rust,no_run\n/// use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n///\n/// # tokio_test::block_on(async {\n/// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n/// let mut client = LastFmEditClientImpl::from_session(Box::new(http_client::native::NativeClient::new()), test_session);\n///\n/// let mut tracks = client.artist_tracks(\"Radiohead\");\n///\n/// // Iterate one by one\n/// while let Some(track) = tracks.next().await? {\n///     println!(\"{}\", track.name);\n/// }\n///\n/// // Or collect a limited number\n/// let first_10 = tracks.take(10).await?;\n/// # Ok::\u003c(), Box\u003cdyn std::error::Error\u003e\u003e(())\n/// # });\n/// ```\n#[cfg_attr(feature = \"mock\", mockall::automock)]\n#[async_trait(?Send)]\npub trait AsyncPaginatedIterator\u003cT\u003e {\n    /// Fetch the next item from the iterator.\n    ///\n    /// This method automatically handles pagination, fetching new pages as needed.\n    /// Returns `None` when there are no more items available.\n    ///\n    /// # Returns\n    ///\n    /// - `Ok(Some(item))` - Next item in the sequence\n    /// - `Ok(None)` - No more items available\n    /// - `Err(...)` - Network or parsing error occurred\n    async fn next(\u0026mut self) -\u003e Result\u003cOption\u003cT\u003e\u003e;\n\n    /// Collect all remaining items into a Vec.\n    ///\n    /// **Warning**: This method will fetch ALL remaining pages, which could be\n    /// many thousands of items for large libraries. Use [`take`](Self::take) for\n    /// safer bounded collection.\n    ///\n    /// # Examples\n    ///\n    /// ```rust,no_run\n    /// # use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n    /// # tokio_test::block_on(async {\n    /// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n    /// let mut client = LastFmEditClientImpl::from_session(Box::new(http_client::native::NativeClient::new()), test_session);\n    /// let mut tracks = client.artist_tracks(\"Small Artist\");\n    /// let all_tracks = tracks.collect_all().await?;\n    /// println!(\"Found {} tracks total\", all_tracks.len());\n    /// # Ok::\u003c(), Box\u003cdyn std::error::Error\u003e\u003e(())\n    /// # });\n    /// ```\n    async fn collect_all(\u0026mut self) -\u003e Result\u003cVec\u003cT\u003e\u003e {\n        let mut items = Vec::new();\n        while let Some(item) = self.next().await? {\n            items.push(item);\n        }\n        Ok(items)\n    }\n\n    /// Take up to n items from the iterator.\n    ///\n    /// This is the recommended way to collect a bounded number of items\n    /// from potentially large datasets.\n    ///\n    /// # Arguments\n    ///\n    /// * `n` - Maximum number of items to collect\n    ///\n    /// # Examples\n    ///\n    /// ```rust,no_run\n    /// # use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n    /// # tokio_test::block_on(async {\n    /// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n    /// let mut client = LastFmEditClientImpl::from_session(Box::new(http_client::native::NativeClient::new()), test_session);\n    /// let mut tracks = client.artist_tracks(\"Radiohead\");\n    /// let top_20 = tracks.take(20).await?;\n    /// println!(\"Top 20 tracks: {:?}\", top_20);\n    /// # Ok::\u003c(), Box\u003cdyn std::error::Error\u003e\u003e(())\n    /// # });\n    /// ```\n    async fn take(\u0026mut self, n: usize) -\u003e Result\u003cVec\u003cT\u003e\u003e {\n        let mut items = Vec::new();\n        for _ in 0..n {\n            match self.next().await? {\n                Some(item) =\u003e items.push(item),\n                None =\u003e break,\n            }\n        }\n        Ok(items)\n    }\n\n    /// Get the current page number (0-indexed).\n    ///\n    /// Returns the page number of the most recently fetched page.\n    fn current_page(\u0026self) -\u003e u32;\n\n    /// Get the total number of pages, if known.\n    ///\n    /// Returns `Some(n)` if the total page count is known, `None` otherwise.\n    /// This information may not be available until at least one page has been fetched.\n    fn total_pages(\u0026self) -\u003e Option\u003cu32\u003e {\n        None // Default implementation returns None\n    }\n}\n\n/// Iterator for browsing an artist's tracks from a user's library.\n///\n/// This iterator provides access to all tracks by a specific artist\n/// in the authenticated user's Last.fm library. Unlike the basic track listing,\n/// this iterator fetches tracks by iterating through the artist's albums first,\n/// which provides complete album information for each track.\n///\n/// The iterator loads albums and their tracks as needed and handles rate limiting\n/// automatically to be respectful to Last.fm's servers.\n///\n/// # Examples\n///\n/// ```rust,no_run\n/// # use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n/// # tokio_test::block_on(async {\n/// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n/// let mut client = LastFmEditClientImpl::from_session(Box::new(http_client::native::NativeClient::new()), test_session);\n///\n/// let mut tracks = client.artist_tracks(\"The Beatles\");\n///\n/// // Get the top 5 tracks with album information\n/// let top_tracks = tracks.take(5).await?;\n/// for track in top_tracks {\n///     let album = track.album.as_deref().unwrap_or(\"Unknown Album\");\n///     println!(\"{} [{}] (played {} times)\", track.name, album, track.playcount);\n/// }\n/// # Ok::\u003c(), Box\u003cdyn std::error::Error\u003e\u003e(())\n/// # });\n/// ```\npub struct ArtistTracksIterator\u003cC: LastFmEditClient\u003e {\n    client: C,\n    artist: String,\n    album_iterator: Option\u003cArtistAlbumsIterator\u003cC\u003e\u003e,\n    current_album_tracks: Option\u003cAlbumTracksIterator\u003cC\u003e\u003e,\n    track_buffer: Vec\u003cTrack\u003e,\n    finished: bool,\n}\n\n#[async_trait(?Send)]\nimpl\u003cC: LastFmEditClient + Clone\u003e AsyncPaginatedIterator\u003cTrack\u003e for ArtistTracksIterator\u003cC\u003e {\n    async fn next(\u0026mut self) -\u003e Result\u003cOption\u003cTrack\u003e\u003e {\n        // If we're finished, return None\n        if self.finished {\n            return Ok(None);\n        }\n\n        // If track buffer is empty, try to get more tracks\n        while self.track_buffer.is_empty() {\n            // If we don't have a current album tracks iterator, get the next album\n            if self.current_album_tracks.is_none() {\n                // Initialize album iterator if needed\n                if self.album_iterator.is_none() {\n                    self.album_iterator = Some(ArtistAlbumsIterator::new(\n                        self.client.clone(),\n                        self.artist.clone(),\n                    ));\n                }\n\n                // Get next album\n                if let Some(ref mut album_iter) = self.album_iterator {\n                    if let Some(album) = album_iter.next().await? {\n                        log::debug!(\n                            \"Processing album '{}' for artist '{}'\",\n                            album.name,\n                            self.artist\n                        );\n                        // Create album tracks iterator for this album\n                        self.current_album_tracks = Some(AlbumTracksIterator::new(\n                            self.client.clone(),\n                            album.name.clone(),\n                            self.artist.clone(),\n                        ));\n                    } else {\n                        // No more albums, we're done\n                        log::debug!(\"No more albums for artist '{}'\", self.artist);\n                        self.finished = true;\n                        return Ok(None);\n                    }\n                }\n            }\n\n            // Get tracks from current album\n            if let Some(ref mut album_tracks) = self.current_album_tracks {\n                if let Some(track) = album_tracks.next().await? {\n                    self.track_buffer.push(track);\n                } else {\n                    // This album is exhausted, move to next album\n                    log::debug!(\n                        \"Finished processing current album for artist '{}'\",\n                        self.artist\n                    );\n                    self.current_album_tracks = None;\n                    // Continue the loop to try getting the next album\n                }\n            }\n        }\n\n        // Return the next track from our buffer\n        Ok(self.track_buffer.pop())\n    }\n\n    fn current_page(\u0026self) -\u003e u32 {\n        // Since we're iterating through albums, return the album iterator's current page\n        if let Some(ref album_iter) = self.album_iterator {\n            album_iter.current_page()\n        } else {\n            0\n        }\n    }\n\n    fn total_pages(\u0026self) -\u003e Option\u003cu32\u003e {\n        // Since we're iterating through albums, return the album iterator's total pages\n        if let Some(ref album_iter) = self.album_iterator {\n            album_iter.total_pages()\n        } else {\n            None\n        }\n    }\n}\n\nimpl\u003cC: LastFmEditClient + Clone\u003e ArtistTracksIterator\u003cC\u003e {\n    /// Create a new artist tracks iterator.\n    ///\n    /// This is typically called via [`LastFmEditClient::artist_tracks`](crate::LastFmEditClient::artist_tracks).\n    pub fn new(client: C, artist: String) -\u003e Self {\n        Self {\n            client,\n            artist,\n            album_iterator: None,\n            current_album_tracks: None,\n            track_buffer: Vec::new(),\n            finished: false,\n        }\n    }\n}\n\n/// Iterator for browsing an artist's tracks directly using the paginated artist tracks endpoint.\n///\n/// This iterator provides access to all tracks by a specific artist\n/// in the authenticated user's Last.fm library by directly using the\n/// `/user/{username}/library/music/{artist}/+tracks` endpoint with pagination.\n/// This is more efficient than the album-based approach as it doesn't need to\n/// iterate through albums first.\n///\n/// # Examples\n///\n/// ```rust,no_run\n/// # use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n/// # tokio_test::block_on(async {\n/// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n/// let mut client = LastFmEditClientImpl::from_session(Box::new(http_client::native::NativeClient::new()), test_session);\n///\n/// let mut tracks = client.artist_tracks_direct(\"The Beatles\");\n///\n/// // Get the first 10 tracks directly from the paginated endpoint\n/// let first_10_tracks = tracks.take(10).await?;\n/// for track in first_10_tracks {\n///     println!(\"{} (played {} times)\", track.name, track.playcount);\n/// }\n/// # Ok::\u003c(), Box\u003cdyn std::error::Error\u003e\u003e(())\n/// # });\n/// ```\npub struct ArtistTracksDirectIterator\u003cC: LastFmEditClient\u003e {\n    client: C,\n    artist: String,\n    current_page: u32,\n    has_more: bool,\n    buffer: Vec\u003cTrack\u003e,\n    total_pages: Option\u003cu32\u003e,\n    tracks_yielded: u32,\n}\n\n#[async_trait(?Send)]\nimpl\u003cC: LastFmEditClient\u003e AsyncPaginatedIterator\u003cTrack\u003e for ArtistTracksDirectIterator\u003cC\u003e {\n    async fn next(\u0026mut self) -\u003e Result\u003cOption\u003cTrack\u003e\u003e {\n        // If buffer is empty, try to load next page\n        if self.buffer.is_empty() {\n            if let Some(page) = self.next_page().await? {\n                self.buffer = page.tracks;\n                self.buffer.reverse(); // Reverse so we can pop from end efficiently\n            }\n        }\n\n        if let Some(track) = self.buffer.pop() {\n            self.tracks_yielded += 1;\n            Ok(Some(track))\n        } else {\n            Ok(None)\n        }\n    }\n\n    fn current_page(\u0026self) -\u003e u32 {\n        self.current_page.saturating_sub(1)\n    }\n\n    fn total_pages(\u0026self) -\u003e Option\u003cu32\u003e {\n        self.total_pages\n    }\n}\n\nimpl\u003cC: LastFmEditClient\u003e ArtistTracksDirectIterator\u003cC\u003e {\n    /// Create a new direct artist tracks iterator.\n    ///\n    /// This is typically called via [`LastFmEditClient::artist_tracks_direct`](crate::LastFmEditClient::artist_tracks_direct).\n    pub fn new(client: C, artist: String) -\u003e Self {\n        Self {\n            client,\n            artist,\n            current_page: 1,\n            has_more: true,\n            buffer: Vec::new(),\n            total_pages: None,\n            tracks_yielded: 0,\n        }\n    }\n\n    /// Fetch the next page of tracks.\n    ///\n    /// This method handles pagination automatically and includes rate limiting.\n    pub async fn next_page(\u0026mut self) -\u003e Result\u003cOption\u003cTrackPage\u003e\u003e {\n        if !self.has_more {\n            return Ok(None);\n        }\n\n        log::debug!(\n            \"Fetching page {} of {} tracks (yielded {} tracks so far)\",\n            self.current_page,\n            self.artist,\n            self.tracks_yielded\n        );\n\n        let page = self\n            .client\n            .get_artist_tracks_page(\u0026self.artist, self.current_page)\n            .await?;\n\n        self.has_more = page.has_next_page;\n        self.current_page += 1;\n        self.total_pages = page.total_pages;\n\n        Ok(Some(page))\n    }\n\n    /// Get the total number of pages, if known.\n    ///\n    /// Returns `None` until at least one page has been fetched.\n    pub fn total_pages(\u0026self) -\u003e Option\u003cu32\u003e {\n        self.total_pages\n    }\n}\n\n/// Iterator for browsing an artist's albums from a user's library.\n///\n/// This iterator provides paginated access to all albums by a specific artist\n/// in the authenticated user's Last.fm library, ordered by play count.\n///\n/// # Examples\n///\n/// ```rust,no_run\n/// # use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n/// # tokio_test::block_on(async {\n/// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n/// let mut client = LastFmEditClientImpl::from_session(Box::new(http_client::native::NativeClient::new()), test_session);\n///\n/// let mut albums = client.artist_albums(\"Pink Floyd\");\n///\n/// // Get all albums (be careful with large discographies!)\n/// while let Some(album) = albums.next().await? {\n///     println!(\"{} (played {} times)\", album.name, album.playcount);\n/// }\n/// # Ok::\u003c(), Box\u003cdyn std::error::Error\u003e\u003e(())\n/// # });\n/// ```\npub struct ArtistAlbumsIterator\u003cC: LastFmEditClient\u003e {\n    client: C,\n    artist: String,\n    current_page: u32,\n    has_more: bool,\n    buffer: Vec\u003cAlbum\u003e,\n    total_pages: Option\u003cu32\u003e,\n}\n\n#[async_trait(?Send)]\nimpl\u003cC: LastFmEditClient\u003e AsyncPaginatedIterator\u003cAlbum\u003e for ArtistAlbumsIterator\u003cC\u003e {\n    async fn next(\u0026mut self) -\u003e Result\u003cOption\u003cAlbum\u003e\u003e {\n        // If buffer is empty, try to load next page\n        if self.buffer.is_empty() {\n            if let Some(page) = self.next_page().await? {\n                self.buffer = page.albums;\n                self.buffer.reverse(); // Reverse so we can pop from end efficiently\n            }\n        }\n\n        Ok(self.buffer.pop())\n    }\n\n    fn current_page(\u0026self) -\u003e u32 {\n        self.current_page.saturating_sub(1)\n    }\n\n    fn total_pages(\u0026self) -\u003e Option\u003cu32\u003e {\n        self.total_pages\n    }\n}\n\nimpl\u003cC: LastFmEditClient\u003e ArtistAlbumsIterator\u003cC\u003e {\n    /// Create a new artist albums iterator.\n    ///\n    /// This is typically called via [`LastFmEditClient::artist_albums`](crate::LastFmEditClient::artist_albums).\n    pub fn new(client: C, artist: String) -\u003e Self {\n        Self {\n            client,\n            artist,\n            current_page: 1,\n            has_more: true,\n            buffer: Vec::new(),\n            total_pages: None,\n        }\n    }\n\n    /// Fetch the next page of albums.\n    ///\n    /// This method handles pagination automatically and includes rate limiting.\n    pub async fn next_page(\u0026mut self) -\u003e Result\u003cOption\u003cAlbumPage\u003e\u003e {\n        if !self.has_more {\n            return Ok(None);\n        }\n\n        let page = self\n            .client\n            .get_artist_albums_page(\u0026self.artist, self.current_page)\n            .await?;\n\n        self.has_more = page.has_next_page;\n        self.current_page += 1;\n        self.total_pages = page.total_pages;\n\n        Ok(Some(page))\n    }\n\n    /// Get the total number of pages, if known.\n    ///\n    /// Returns `None` until at least one page has been fetched.\n    pub fn total_pages(\u0026self) -\u003e Option\u003cu32\u003e {\n        self.total_pages\n    }\n}\n\n/// Iterator for browsing a user's recent tracks/scrobbles.\n///\n/// This iterator provides access to the user's recent listening history with timestamps,\n/// which is essential for finding tracks that can be edited. It supports optional\n/// timestamp-based filtering to avoid reprocessing old data.\n///\n/// # Examples\n///\n/// ```rust,no_run\n/// # use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n/// # tokio_test::block_on(async {\n/// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n/// let mut client = LastFmEditClientImpl::from_session(Box::new(http_client::native::NativeClient::new()), test_session);\n///\n/// // Get recent tracks with timestamps\n/// let mut recent = client.recent_tracks();\n/// while let Some(track) = recent.next().await? {\n///     if let Some(timestamp) = track.timestamp {\n///         println!(\"{} - {} ({})\", track.artist, track.name, timestamp);\n///     }\n/// }\n///\n/// // Or stop at a specific timestamp to avoid reprocessing\n/// let last_processed = 1640995200;\n/// let mut recent = lastfm_edit::RecentTracksIterator::new(client).with_stop_timestamp(last_processed);\n/// let new_tracks = recent.collect_all().await?;\n/// # Ok::\u003c(), Box\u003cdyn std::error::Error\u003e\u003e(())\n/// # });\n/// ```\npub struct RecentTracksIterator\u003cC: LastFmEditClient\u003e {\n    client: C,\n    current_page: u32,\n    has_more: bool,\n    buffer: Vec\u003cTrack\u003e,\n    stop_at_timestamp: Option\u003cu64\u003e,\n}\n\n#[async_trait(?Send)]\nimpl\u003cC: LastFmEditClient\u003e AsyncPaginatedIterator\u003cTrack\u003e for RecentTracksIterator\u003cC\u003e {\n    async fn next(\u0026mut self) -\u003e Result\u003cOption\u003cTrack\u003e\u003e {\n        // If buffer is empty, try to load next page\n        if self.buffer.is_empty() {\n            if !self.has_more {\n                return Ok(None);\n            }\n\n            let page = self\n                .client\n                .get_recent_tracks_page(self.current_page)\n                .await?;\n\n            if page.tracks.is_empty() {\n                self.has_more = false;\n                return Ok(None);\n            }\n\n            self.has_more = page.has_next_page;\n\n            // Check if we should stop based on timestamp\n            if let Some(stop_timestamp) = self.stop_at_timestamp {\n                let mut filtered_tracks = Vec::new();\n                for track in page.tracks {\n                    if let Some(track_timestamp) = track.timestamp {\n                        if track_timestamp \u003c= stop_timestamp {\n                            self.has_more = false;\n                            break;\n                        }\n                    }\n                    filtered_tracks.push(track);\n                }\n                self.buffer = filtered_tracks;\n            } else {\n                self.buffer = page.tracks;\n            }\n\n            self.buffer.reverse(); // Reverse so we can pop from end efficiently\n            self.current_page += 1;\n        }\n\n        Ok(self.buffer.pop())\n    }\n\n    fn current_page(\u0026self) -\u003e u32 {\n        self.current_page.saturating_sub(1)\n    }\n}\n\nimpl\u003cC: LastFmEditClient\u003e RecentTracksIterator\u003cC\u003e {\n    /// Create a new recent tracks iterator starting from page 1.\n    ///\n    /// This is typically called via [`LastFmEditClient::recent_tracks`](crate::LastFmEditClient::recent_tracks).\n    pub fn new(client: C) -\u003e Self {\n        Self::with_starting_page(client, 1)\n    }\n\n    /// Create a new recent tracks iterator starting from a specific page.\n    ///\n    /// This allows resuming pagination from an arbitrary page, useful for\n    /// continuing from where a previous iteration left off.\n    ///\n    /// # Arguments\n    ///\n    /// * `client` - The LastFmEditClient to use for API calls\n    /// * `starting_page` - The page number to start from (1-indexed)\n    ///\n    /// # Examples\n    ///\n    /// ```rust,no_run\n    /// # use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n    /// # tokio_test::block_on(async {\n    /// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n    /// let mut client = LastFmEditClientImpl::from_session(Box::new(http_client::native::NativeClient::new()), test_session);\n    ///\n    /// // Start from page 5\n    /// let mut recent = client.recent_tracks_from_page(5);\n    /// let tracks = recent.take(10).await?;\n    /// # Ok::\u003c(), Box\u003cdyn std::error::Error\u003e\u003e(())\n    /// # });\n    /// ```\n    pub fn with_starting_page(client: C, starting_page: u32) -\u003e Self {\n        let page = std::cmp::max(1, starting_page);\n        Self {\n            client,\n            current_page: page,\n            has_more: true,\n            buffer: Vec::new(),\n            stop_at_timestamp: None,\n        }\n    }\n\n    /// Set a timestamp to stop iteration at.\n    ///\n    /// When this is set, the iterator will stop returning tracks once it encounters\n    /// a track with a timestamp less than or equal to the specified value. This is\n    /// useful for incremental processing to avoid reprocessing old data.\n    ///\n    /// # Arguments\n    ///\n    /// * `timestamp` - Unix timestamp to stop at\n    ///\n    /// # Examples\n    ///\n    /// ```rust,no_run\n    /// # use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n    /// # tokio_test::block_on(async {\n    /// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n    /// let mut client = LastFmEditClientImpl::from_session(Box::new(http_client::native::NativeClient::new()), test_session);\n    /// let last_processed = 1640995200; // Some previous timestamp\n    ///\n    /// let mut recent = lastfm_edit::RecentTracksIterator::new(client).with_stop_timestamp(last_processed);\n    /// let new_tracks = recent.collect_all().await?; // Only gets new tracks\n    /// # Ok::\u003c(), Box\u003cdyn std::error::Error\u003e\u003e(())\n    /// # });\n    /// ```\n    pub fn with_stop_timestamp(mut self, timestamp: u64) -\u003e Self {\n        self.stop_at_timestamp = Some(timestamp);\n        self\n    }\n}\n\n/// Iterator for browsing tracks in a specific album from a user's library.\n///\n/// This iterator provides access to all tracks in a specific album by an artist\n/// in the authenticated user's Last.fm library. Unlike paginated iterators,\n/// this loads tracks once and iterates through them.\n///\n/// # Examples\n///\n/// ```rust,no_run\n/// # use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, AsyncPaginatedIterator};\n/// # tokio_test::block_on(async {\n/// # let test_session = LastFmEditSession::new(\"test\".to_string(), vec![\"sessionid=.test123\".to_string()], Some(\"csrf\".to_string()), \"https://www.last.fm\".to_string());\n/// let mu ublic API.\n//!\n//! ## Features\n//!\n//! - **Authentication**: Login to Last.fm with username/password\n//! - **Library browsing**: Paginated access to tracks, albums, and recent scrobbles\n//! - **Bulk editing**: Edit track names, artist names, and album information\n//! - **Async iterators**: Stream large datasets efficiently\n//! - **HTTP client abstraction**: Works with any HTTP client implementation\n//!\n//! ## Quick Start\n//!\n//! ```rust,no_run\n//! use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, AsyncPaginatedIterator, Result};\n//!\n//! #[tokio::main]\n//! async fn main() -\u003e Result\u003c()\u003e {\n//!     // Create HTTP client and login\n//!     let http_client = http_client::native::NativeClient::new();\n//!     let client = LastFmEditClientImpl::login_with_credentials(\n//!         Box::new(http_client),\n//!         \"username\",\n//!         \"password\"\n//!     ).await?;\n//!\n//!     // Browse recent tracks\n//!     let mut recent_tracks = client.recent_tracks();\n//!     while let Some(track) = recent_tracks.next().await? {\n//!         println!(\"{} - {}\", track.artist, track.name);\n//!     }\n//!\n//!     Ok(())\n//! }\n//! ```\n//!\n//! ## Core Components\n//!\n//! - [`LastFmEditClient`] - Main client trait for interacting with Last.fm\n//! - [`Track`], [`Album`] - Data structures for music metadata\n//! - [`AsyncPaginatedIterator`] - Trait for streaming paginated data\n//! - [`ScrobbleEdit`] - Represents track edit operations\n//! - [`LastFmError`] - Error types for the crate\n//!\n//! ## Installation\n//!\n//! Add this to your `Cargo.toml`:\n//! ```toml\n//! [dependencies]\n//! lastfm-edit = \"3.1.0\"\n//! http-client = { version = \"^6.6.3\", package = \"http-client-2\", features = [\"curl_client\"] }\n//! tokio = { version = \"1.0\", features = [\"full\"] }\n//! ```\n//!\n//! ## Usage Patterns\n//!\n//! ### Basic Library Browsing\n//!\n//! ```rust,no_run\n//! use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, AsyncPaginatedIterator, Result};\n//!\n//! #[tokio::main]\n//! async fn main() -\u003e Result\u003c()\u003e {\n//!     let http_client = http_client::native::NativeClient::new();\n//!     let client = LastFmEditClientImpl::login_with_credentials(\n//!         Box::new(http_client),\n//!         \"username\",\n//!         \"password\"\n//!     ).await?;\n//!\n//!     // Get all tracks by an artist\n//!     let mut tracks = client.artist_tracks(\"Radiohead\");\n//!     while let Some(track) = tracks.next().await? {\n//!         println!(\"{} - {}\", track.artist, track.name);\n//!     }\n//!\n//!     Ok(())\n//! }\n//! ```\n//!\n//! ### Bulk Track Editing\n//!\n//! ```rust,no_run\n//! use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, ScrobbleEdit, AsyncPaginatedIterator, Result};\n//!\n//! #[tokio::main]\n//! async fn main() -\u003e Result\u003c()\u003e {\n//!     let http_client = http_client::native::NativeClient::new();\n//!     let client = LastFmEditClientImpl::login_with_credentials(\n//!         Box::new(http_client),\n//!         \"username\",\n//!         \"password\"\n//!     ).await?;\n//!\n//!     // Find and edit tracks\n//!     let tracks = client.artist_tracks(\"Artist Name\").collect_all().await?;\n//!     for track in tracks {\n//!         if track.name.contains(\"(Remaster)\") {\n//!             let new_name = track.name.replace(\" (Remaster)\", \"\");\n//!\n//!             // Create edit for this track\n//!             let edit = ScrobbleEdit::from_track_info(\n//!                 \u0026track.name,\n//!                 \u0026track.name, // Use track name as album fallback\n//!                 \u0026track.artist,\n//!                 0 // No timestamp needed for bulk edit\n//!             )\n//!             .with_track_name(\u0026new_name)\n//!             .with_edit_all(true);\n//!\n//!             let response = client.edit_scrobble(\u0026edit).await?;\n//!             if response.success() {\n//!                 println!(\"Successfully edited: {} -\u003e {}\", track.name, new_name);\n//!             }\n//!         }\n//!     }\n//!\n//!     Ok(())\n//! }\n//! ```\n//!\n//! ### Recent Tracks Monitoring\n//!\n//! ```rust,no_run\n//! use lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, AsyncPaginatedIterator, Result};\n//!\n//! #[tokio::main]\n//! async fn main() -\u003e Result\u003c()\u003e {\n//!     let http_client = http_client::native::NativeClient::new();\n//!     let client = LastFmEditClientImpl::login_with_credentials(\n//!         Box::new(http_client),\n//!         \"username\",\n//!         \"password\"\n//!     ).await?;\n//!\n//!     // Get recent tracks (first 100)\n//!     let recent_tracks = client.recent_tracks().take(100).await?;\n//!     println!(\"Found {} recent tracks\", recent_tracks.len());\n//!\n//!     Ok(())\n//! }\n//! ```\n//!\n//! ### Mocking for Testing\n//!\n//! Enable the `mock` feature to use `MockLastFmEditClient` for testing:\n//!\n//! ```toml\n//! [dev-dependencies]\n//! lastfm-edit = { version = \"3.1.0\", features = [\"mock\"] }\n//! mockall = \"0.13\"\n//! ```\n//!\n//! ```rust,ignore\n//! #[cfg(feature = \"mock\")]\n//! mod tests {\n//!     use lastfm_edit::{LastFmEditClient, MockLastFmEditClient, Result, EditResponse, ScrobbleEdit};\n//!     use mockall::predicate::*;\n//!\n//!     #[tokio::test]\n//!     async fn test_edit_workflow() -\u003e Result\u003c()\u003e {\n//!         let mut mock_client = MockLastFmEditClient::new();\n//!\n//!         // Set up expectations\n//!         mock_client\n//!             .expect_login()\n//!             .with(eq(\"testuser\"), eq(\"testpass\"))\n//!             .times(1)\n//!             .returning(|_, _| Ok(()));\n//!\n//!         mock_client\n//!             .expect_edit_scrobble()\n//!             .times(1)\n//!             .returning(|_| Ok(EditResponse {\n//!                 success: true,\n//!                 message: Some(\"Edit successful\".to_string()),\n//!             }));\n//!\n//!         // Use as trait object\n//!         let client: \u0026dyn LastFmEditClient = \u0026mock_client;\n//!\n//!         client.login(\"testuser\", \"testpass\").await?;\n//!\n//!         let edit = ScrobbleEdit::new(\n//!             Some(\"Old Track\".to_string()),\n//!             Some(\"Old Album\".to_string()),\n//!             Some(\"Old Artist\".to_string()),\n//!             Some(\"Old Artist\".to_string()),\n//!             \"New Track\".to_string(),\n//!             \"New Album\".to_string(),\n//!             \"New Artist\".to_string(),\n//!             \"New Artist\".to_string(),\n//!             1640995200,\n//!             false,\n//!         );\n//!\n//!         let response = client.edit_scrobble(\u0026edit).await?;\n//!         assert!(response.success);\n//!\n//!         Ok(())\n//!     }\n//! }\n//! ```\n//!\n//! ## License\n//!\n//! MIT\n\npub mod client;\npub mod discovery;\npub mod edit_analysis;\npub mod headers;\npub mod iterator;\npub mod login;\npub mod parsing;\npub mod retry;\npub mod session_persistence;\npub mod r#trait;\npub mod types;\npub mod vcr_form_data;\npub mod vcr_matcher;\npub mod vcr_test_utils;\n\npub use client::LastFmEditClientImpl;\npub use discovery::{\n    AlbumTracksDiscovery, ArtistTracksDiscovery, AsyncDiscoveryIterator, ExactMatchDiscovery,\n    TrackVariationsDiscovery,\n};\npub use login::LoginManager;\npub use r#trait::LastFmEditClient;\n\n// Re-export all types from the consolidated types module\npub use iterator::AsyncPaginatedIterator;\npub use types::{\n    Album, AlbumPage, Artist, ArtistPage, ClientConfig, ClientEvent, ClientEventReceiver,\n    ClientEventWatcher, EditResponse, ExactScrobbleEdit, LastFmEditSession, LastFmError,\n    OperationalDelayConfig, RateLimitConfig, RateLimitType, RequestInfo, RetryConfig, RetryResult,\n    ScrobbleEdit, SharedEventBroadcaster, SingleEditResponse, Track, TrackPage,\n};\n\n// Type aliases for iterators with the concrete client type\npub type ArtistsIterator = iterator::ArtistsIterator\u003cLastFmEditClientImpl\u003e;\npub type ArtistTracksIterator = iterator::ArtistTracksIterator\u003cLastFmEditClientImpl\u003e;\npub type ArtistTracksDirectIterator = iterator::ArtistTracksDirectIterator\u003cLastFmEditClientImpl\u003e;\npub type ArtistAlbumsIterator = iterator::ArtistAlbumsIterator\u003cLastFmEditClientImpl\u003e;\npub type AlbumTracksIterator = iterator::AlbumTracksIterator\u003cLastFmEditClientImpl\u003e;\npub type RecentTracksIterator = iterator::RecentTracksIterator\u003cLastFmEditClientImpl\u003e;\npub type SearchTracksIterator = iterator::SearchTracksIterator\u003cLastFmEditClientImpl\u003e;\npub type SearchAlbumsIterator = iterator::SearchAlbumsIterator\u003cLastFmEditClientImpl\u003e;\n#[cfg(feature = \"mock\")]\npub use r#trait::MockLastFmEditClient;\n\n// Re-export the mock iterator when the mock feature is enabled\n#[cfg(feature = \"mock\")]\npub use iterator::MockAsyncPaginatedIterator;\npub use session_persistence::{SessionManager, SessionPersistence};\n\n// Re-export scraper types for testing\npub use scraper::Html;\n\n/// A convenient type alias for [`Result`] with [`LastFmError`] as the error type.\npub type Result\u003cT\u003e = std::result::Result\u003cT, LastFmError\u003e;\n","traces":[{"line":247,"address":[21749552,21750622,21748839,21748773,21750688,21749486,21751559,21751637],"length":1,"stats":{"Line":4}},{"line":248,"address":[6531763,6535614],"length":1,"stats":{"Line":3}},{"line":249,"address":[24048246,24051056,24050101,24048959],"length":1,"stats":{"Line":1}},{"line":250,"address":[23938667,23938599],"length":1,"stats":{"Line":2}},{"line":251,"address":[27337440],"length":1,"stats":{"Line":6}},{"line":252,"address":[24259288,24259371],"length":1,"stats":{"Line":1}},{"line":253,"address":[23938860],"length":1,"stats":{"Line":1}},{"line":254,"address":[6960433,6960593],"length":1,"stats":{"Line":2}},{"line":267,"address":[9259922,9260064,9260021,9260117,9260112,9260074,9259904,9260016],"length":1,"stats":{"Line":2}}],"covered":9,"coverable":9},{"path":["/","home","imalison","Projects","lastfm-edit","src","login.rs"],"content":"use crate::types::{LastFmEditSession, LastFmError};\nuse crate::Result;\nuse http_client::{HttpClient, Request};\nuse http_types::{Method, Url};\nuse scraper::{Html, Selector};\nuse std::collections::HashMap;\nuse std::sync::Arc;\n\n/// Login functionality separated from the main client\npub struct LoginManager {\n    client: Arc\u003cdyn HttpClient + Send + Sync\u003e,\n    base_url: String,\n}\n\nimpl LoginManager {\n    pub fn new(client: Arc\u003cdyn HttpClient + Send + Sync\u003e, base_url: String) -\u003e Self {\n        Self { client, base_url }\n    }\n\n    /// Authenticate with Last.fm using username and password.\n    ///\n    /// This method:\n    /// 1. Fetches the login page to extract CSRF tokens\n    /// 2. Submits the login form with credentials\n    /// 3. Validates the authentication by checking for session cookies\n    /// 4. Returns a valid session for use with the client\n    ///\n    /// # Arguments\n    ///\n    /// * `username` - Last.fm username or email\n    /// * `password` - Last.fm password\n    ///\n    /// # Returns\n    ///\n    /// Returns a [`LastFmEditSession`] on successful authentication, or [`LastFmError::Auth`] on failure.\n    pub async fn login(\u0026self, username: \u0026str, password: \u0026str) -\u003e Result\u003cLastFmEditSession\u003e {\n        log::info!(\"ğŸ” Starting Last.fm login for username: {username}\");\n\n        // Step 1: Fetch login page and extract CSRF token and cookies\n        let login_url = format!(\"{}/login\", self.base_url);\n        let (csrf_token, next_field, mut cookies) = self.fetch_login_page(\u0026login_url).await?;\n\n        // Step 2: Submit login form\n        let response = self\n            .submit_login_form(\n                \u0026login_url,\n                username,\n                password,\n                \u0026csrf_token,\n                \u0026next_field,\n                \u0026cookies,\n            )\n            .await?;\n\n        // Step 3: Extract cookies from login response\n        extract_cookies_from_response(\u0026response, \u0026mut cookies);\n        log::debug!(\"ğŸª Cookies after login response: {cookies:?}\");\n\n        // Step 4: Validate login response\n        self.validate_login_response(response, username, cookies, csrf_token)\n            .await\n    }\n\n    /// Fetch the login page and extract CSRF token, next field, and cookies\n    async fn fetch_login_page(\n        \u0026self,\n        login_url: \u0026str,\n    ) -\u003e Result\u003c(String, Option\u003cString\u003e, Vec\u003cString\u003e)\u003e {\n        log::debug!(\"ğŸ“¡ Fetching login page: {login_url}\");\n        let mut response = self.get(login_url).await?;\n\n        log::debug!(\"ğŸ“‹ Login page response status: {}\", response.status());\n        log::debug!(\n            \"ğŸ“‹ Login page response headers: {:?}\",\n            response.iter().collect::\u003cVec\u003c_\u003e\u003e()\n        );\n\n        // Extract cookies from the login page response\n        let mut cookies = Vec::new();\n        extract_cookies_from_response(\u0026response, \u0026mut cookies);\n        log::debug!(\"ğŸª Initial cookies from login page: {cookies:?}\");\n\n        // Read and parse the HTML response\n        let html = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\"ğŸ“„ Login page HTML length: {} chars\", html.len());\n        if html.len() \u003c 500 {\n            log::debug!(\"ğŸ“„ Login page HTML content (short): {html}\");\n        }\n\n        // Extract CSRF token and next field from form\n        let (csrf_token, next_field) = self.extract_login_form_data(\u0026html)?;\n        log::debug!(\"ğŸ”‘ Extracted CSRF token: {csrf_token}\",);\n        log::debug!(\"â¡ï¸  Next field: {next_field:?}\");\n\n        Ok((csrf_token, next_field, cookies))\n    }\n\n    /// Submit the login form with credentials\n    async fn submit_login_form(\n        \u0026self,\n        login_url: \u0026str,\n        username: \u0026str,\n        password: \u0026str,\n        csrf_token: \u0026str,\n        next_field: \u0026Option\u003cString\u003e,\n        cookies: \u0026[String],\n    ) -\u003e Result\u003chttp_types::Response\u003e {\n        // Prepare form data\n        let mut form_data = HashMap::new();\n        form_data.insert(\"csrfmiddlewaretoken\", csrf_token);\n        form_data.insert(\"username_or_email\", username);\n        form_data.insert(\"password\", password);\n\n        if let Some(ref next_value) = next_field {\n            form_data.insert(\"next\", next_value);\n            log::debug!(\"â¡ï¸  Including next field in form: {next_value}\");\n        }\n\n        log::debug!(\n            \"ğŸ“ Form data fields: {:?}\",\n            form_data.keys().collect::\u003cVec\u003c_\u003e\u003e()\n        );\n        log::debug!(\"ğŸ“ Form username: {username}\");\n        log::debug!(\"ğŸ“ Form password length: {} chars\", password.len());\n\n        // Create and configure the POST request\n        let mut request = self.create_login_request(login_url, cookies)?;\n\n        // Convert form data to URL-encoded string\n        let form_string: String = form_data\n            .iter()\n            .map(|(k, v)| format!(\"{}={}\", urlencoding::encode(k), urlencoding::encode(v)))\n            .collect::\u003cVec\u003c_\u003e\u003e()\n            .join(\"\u0026\");\n\n        log::debug!(\"ğŸ“¤ Sending POST request to: {login_url}\");\n        log::debug!(\"ğŸ“¤ Form body length: {} chars\", form_string.len());\n        log::debug!(\"ğŸ“¤ Form body (masked): {form_string}\");\n        log::debug!(\"ğŸ“¤ Request headers: Referer={}, Origin={}, Content-Type=application/x-www-form-urlencoded\", \n            login_url, \u0026self.base_url);\n\n        request.set_body(form_string);\n\n        // Send the request\n        let response = self\n            .client\n            .send(request)\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\"ğŸ“¥ Login response status: {}\", response.status());\n        log::debug!(\n            \"ğŸ“¥ Login response headers: {:?}\",\n            response.iter().collect::\u003cVec\u003c_\u003e\u003e()\n        );\n\n        Ok(response)\n    }\n\n    /// Create and configure the login POST request with all necessary headers\n    fn create_login_request(\u0026self, login_url: \u0026str, cookies: \u0026[String]) -\u003e Result\u003cRequest\u003e {\n        let mut request = Request::new(Method::Post, login_url.parse::\u003cUrl\u003e().unwrap());\n\n        // Set all the required headers\n        let _ = request.insert_header(\"Referer\", login_url);\n        let _ = request.insert_header(\"Origin\", \u0026self.base_url);\n        let _ = request.insert_header(\"Content-Type\", \"application/x-www-form-urlencoded\");\n        let _ = request.insert_header(\n            \"User-Agent\",\n            \"Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/138.0.0.0 Safari/537.36\"\n        );\n        let _ = request.insert_header(\n            \"Accept\",\n            \"text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.7\"\n        );\n        let _ = request.insert_header(\"Accept-Language\", \"en-US,en;q=0.9\");\n        let _ = request.insert_header(\"Accept-Encoding\", \"gzip, deflate, br\");\n        let _ = request.insert_header(\"DNT\", \"1\");\n        let _ = request.insert_header(\"Connection\", \"keep-alive\");\n        let _ = request.insert_header(\"Upgrade-Insecure-Requests\", \"1\");\n        let _ = request.insert_header(\n            \"sec-ch-ua\",\n            \"\\\"Not)A;Brand\\\";v=\\\"8\\\", \\\"Chromium\\\";v=\\\"138\\\", \\\"Google Chrome\\\";v=\\\"138\\\"\",\n        );\n        let _ = request.insert_header(\"sec-ch-ua-mobile\", \"?0\");\n        let _ = request.insert_header(\"sec-ch-ua-platform\", \"\\\"Linux\\\"\");\n        let _ = request.insert_header(\"Sec-Fetch-Dest\", \"document\");\n        let _ = request.insert_header(\"Sec-Fetch-Mode\", \"navigate\");\n        let _ = request.insert_header(\"Sec-Fetch-Site\", \"same-origin\");\n        let _ = request.insert_header(\"Sec-Fetch-User\", \"?1\");\n\n        // Add cookies if we have any\n        if !cookies.is_empty() {\n            let cookie_header = cookies.join(\"; \");\n            let _ = request.insert_header(\"Cookie\", \u0026cookie_header);\n        }\n\n        Ok(request)\n    }\n\n    /// Validate the login response and return a session if successful\n    async fn validate_login_response(\n        \u0026self,\n        mut response: http_types::Response,\n        username: \u0026str,\n        cookies: Vec\u003cString\u003e,\n        csrf_token: String,\n    ) -\u003e Result\u003cLastFmEditSession\u003e {\n        // Handle 403 Forbidden responses (likely CSRF failures)\n        if response.status() == 403 {\n            return self.handle_403_response(response).await;\n        }\n\n        // Check for successful session establishment\n        if let Some(session) =\n            self.check_session_success(\u0026response, username, \u0026cookies, \u0026csrf_token)\n        {\n            return Ok(session);\n        }\n\n        // For other cases, analyze the response body\n        let response_html = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\n            \"ğŸ“„ Login response HTML length: {} chars\",\n            response_html.len()\n        );\n        if response_html.len() \u003c 500 {\n            log::debug!(\"ğŸ“„ Login response HTML content (short): {response_html}\");\n        }\n\n        // Check if we were redirected away from login page (success indicator)\n        let has_login_form = self.check_for_login_form(\u0026response_html);\n        log::debug!(\"ğŸ” Final login validation:\");\n        log::debug!(\"   - Response contains login form: {has_login_form}\");\n        log::debug!(\"   - Response status: {}\", response.status());\n\n        if !has_login_form \u0026\u0026 response.status() == 200 {\n            log::info!(\"âœ… Login successful - no login form detected in response\");\n            Ok(LastFmEditSession::new(\n                username.to_string(),\n                cookies,\n                Some(csrf_token),\n                self.base_url.clone(),\n            ))\n        } else {\n            // Parse and return error message\n            let error_msg = self.parse_login_error(\u0026response_html);\n            log::warn!(\"âŒ Login failed: {error_msg}\");\n            Err(LastFmError::Auth(error_msg))\n        }\n    }\n\n    /// Handle 403 Forbidden responses\n    async fn handle_403_response(\n        \u0026self,\n        mut response: http_types::Response,\n    ) -\u003e Result\u003cLastFmEditSession\u003e {\n        let response_html = response\n            .body_string()\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))?;\n\n        log::debug!(\"ğŸ“„ 403 response HTML length: {} chars\", response_html.len());\n        if response_html.len() \u003c 2000 {\n            log::debug!(\"ğŸ“„ 403 response HTML content: {response_html}\");\n        } else {\n            // Log first and last 500 chars for large responses\n            log::debug!(\"ğŸ“„ 403 response HTML start: {}\", \u0026response_html[..500]);\n            log::debug!(\n                \"ğŸ“„ 403 response HTML end: {}\",\n                \u0026response_html[response_html.len() - 500..]\n            );\n        }\n\n        let login_error = self.parse_login_error(\u0026response_html);\n        Err(LastFmError::Auth(login_error))\n    }\n\n    /// Check if the response indicates successful session establishment\n    fn check_session_success(\n        \u0026self,\n        response: \u0026http_types::Response,\n        username: \u0026str,\n        cookies: \u0026[String],\n        csrf_token: \u0026str,\n    ) -\u003e Option\u003cLastFmEditSession\u003e {\n        let has_real_session = cookies\n            .iter()\n            .any(|cookie| cookie.starts_with(\"sessionid=.\") \u0026\u0026 cookie.len() \u003e 50);\n\n        log::debug!(\"ğŸ” Session validation:\");\n        log::debug!(\"   - Has real session cookie: {has_real_session}\");\n        log::debug!(\"   - Response status: {}\", response.status());\n        log::debug!(\"   - All cookies: {cookies:?}\");\n\n        if has_real_session \u0026\u0026 (response.status() == 302 || response.status() == 200) {\n            log::info!(\"âœ… Login successful - authenticated session established\");\n            Some(LastFmEditSession::new(\n                username.to_string(),\n                cookies.to_vec(),\n                Some(csrf_token.to_string()),\n                self.base_url.clone(),\n            ))\n        } else {\n            None\n        }\n    }\n\n    /// Make a simple HTTP GET request (without retry logic)\n    async fn get(\u0026self, url: \u0026str) -\u003e Result\u003chttp_types::Response\u003e {\n        let mut request = Request::new(Method::Get, url.parse::\u003cUrl\u003e().unwrap());\n        let _ = request.insert_header(\"User-Agent\", \"Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/138.0.0.0 Safari/537.36\");\n\n        self.client\n            .send(request)\n            .await\n            .map_err(|e| LastFmError::Http(e.to_string()))\n    }\n\n    /// Extract login form data (CSRF token and next field)\n    fn extract_login_form_data(\u0026self, html: \u0026str) -\u003e Result\u003c(String, Option\u003cString\u003e)\u003e {\n        let document = Html::parse_document(html);\n\n        let csrf_token = self.extract_csrf_token(\u0026document)?;\n\n        // Check if there's a 'next' field in the form\n        let next_selector = Selector::parse(\"input[name=\\\"next\\\"]\").unwrap();\n        let next_field = document\n            .select(\u0026next_selector)\n            .next()\n            .and_then(|input| input.value().attr(\"value\"))\n            .map(|s| s.to_string());\n\n        Ok((csrf_token, next_field))\n    }\n\n    fn extract_csrf_token(\u0026self, document: \u0026Html) -\u003e Result\u003cString\u003e {\n        let csrf_selector = Selector::parse(\"input[name=\\\"csrfmiddlewaretoken\\\"]\").unwrap();\n\n        let csrf_token = document\n            .select(\u0026csrf_selector)\n            .next()\n            .and_then(|input| input.value().attr(\"value\"))\n            .map(|token| token.to_string())\n            .ok_or(LastFmError::CsrfNotFound)?;\n\n        log::debug!(\"ğŸ”‘ CSRF token extracted from HTML: {csrf_token}\");\n        Ok(csrf_token)\n    }\n\n    /// Parse login error messages from HTML\n    fn parse_login_error(\u0026self, html: \u0026str) -\u003e String {\n        let document = Html::parse_document(html);\n\n        let error_selector = Selector::parse(\".alert-danger, .form-error, .error-message\").unwrap();\n\n        let mut error_messages = Vec::new();\n        for error in document.select(\u0026error_selector) {\n            let error_text = error.text().collect::\u003cString\u003e().trim().to_string();\n            if !error_text.is_empty() {\n                error_messages.push(error_text);\n            }\n        }\n\n        if error_messages.is_empty() {\n            \"Login failed - please check your credentials\".to_string()\n        } else {\n            format!(\"Login failed: {}\", error_messages.join(\"; \"))\n        }\n    }\n\n    /// Check if HTML contains a login form\n    fn check_for_login_form(\u0026self, html: \u0026str) -\u003e bool {\n        let document = Html::parse_document(html);\n        let login_form_selector =\n            Selector::parse(\"form[action*=\\\"login\\\"], input[name=\\\"username_or_email\\\"]\").unwrap();\n        document.select(\u0026login_form_selector).next().is_some()\n    }\n}\n\n/// Extract cookies from HTTP response - utility function\npub fn extract_cookies_from_response(response: \u0026http_types::Response, cookies: \u0026mut Vec\u003cString\u003e) {\n    if let Some(cookie_headers) = response.header(\"set-cookie\") {\n        for cookie_header in cookie_headers {\n            let cookie_str = cookie_header.as_str();\n            // Extract just the cookie name=value part (before any semicolon)\n            if let Some(cookie_value) = cookie_str.split(';').next() {\n                let cookie_name = cookie_value.split('=').next().unwrap_or(\"\");\n\n                // Remove any existing cookie with the same name\n                cookies.retain(|existing| !existing.starts_with(\u0026format!(\"{cookie_name}=\")));\n                cookies.push(cookie_value.to_string());\n            }\n        }\n    }\n}\n","traces":[{"line":16,"address":[5478176],"length":1,"stats":{"Line":1}},{"line":36,"address":[3235146,3234164,3234340,3234425,3236350,3234080],"length":1,"stats":{"Line":4}},{"line":37,"address":[6080946,6080986,6080756],"length":1,"stats":{"Line":3}},{"line":40,"address":[3234488,3234810],"length":1,"stats":{"Line":2}},{"line":41,"address":[3363506],"length":1,"stats":{"Line":2}},{"line":44,"address":[6083021,6082245,6082719,6082643,6083049,6083136],"length":1,"stats":{"Line":5}},{"line":46,"address":[5960601],"length":1,"stats":{"Line":1}},{"line":47,"address":[5578279],"length":1,"stats":{"Line":1}},{"line":48,"address":[5578311],"length":1,"stats":{"Line":1}},{"line":49,"address":[3507279],"length":1,"stats":{"Line":1}},{"line":50,"address":[6343530],"length":1,"stats":{"Line":1}},{"line":51,"address":[5960849],"length":1,"stats":{"Line":1}},{"line":53,"address":[5316760],"length":1,"stats":{"Line":3}},{"line":56,"address":[3236798],"length":1,"stats":{"Line":1}},{"lin
