re is correct by checking that:\n\n    // 1. Clients with shared broadcasters have the same latest event state\n    // 2. Clients with independent broadcasters maintain separate state\n\n    // For now, we can only test that the event subscriptions are properly set up\n    // and that no events are present initially (which is correct)\n\n    // Test that subscriptions don't immediately have events\n    let no_event_1 = timeout(Duration::from_millis(10), events1.recv()).await;\n    let no_event_2 = timeout(Duration::from_millis(10), events2.recv()).await;\n    let no_event_3 = timeout(Duration::from_millis(10), events3.recv()).await;\n\n    // All should timeout (no events received)\n    assert!(no_event_1.is_err());\n    assert!(no_event_2.is_err());\n    assert!(no_event_3.is_err());\n}\n\n#[test_log::test(tokio::test)]\nasync fn test_session_sharing_vs_broadcaster_sharing() {\n    // Create first client\n    let http_client1 = NoOpClient::new();\n    let client1 = LastFmEditClientImpl::from_session(Box::new(http_client1), create_test_session());\n\n    // Client2: shares session but NOT broadcaster\n    let http_client2 = NoOpClient::new();\n    let session = client1.get_session();\n    let client2 = LastFmEditClientImpl::from_session(Box::new(http_client2), session);\n\n    // Client3: shares BOTH session and broadcaster\n    let http_client3 = NoOpClient::new();\n    let client3 = client1.with_shared_broadcaster(Box::new(http_client3));\n\n    // Verify session sharing\n    assert_eq!(\n        client1.get_session().base_url,\n        client2.get_session().base_url\n    );\n    assert_eq!(\n        client1.get_session().base_url,\n        client3.get_session().base_url\n    );\n\n    // All clients should start with no events\n    assert!(client1.latest_event().is_none());\n    assert!(client2.latest_event().is_none());\n    assert!(client3.latest_event().is_none());\n\n    // Subscribe to verify broadcast setup\n    let _events1 = client1.subscribe();\n    let _events2 = client2.subscribe();\n    let _events3 = client3.subscribe();\n\n    // Test passes if no panics occur - the broadcaster sharing is working correctly\n    // In real usage, when client1 or client3 encounter rate limits, both would see the events\n    // while client2 would not (since it has an independent broadcaster)\n}\n\n#[test_log::test]\nfn test_client_creation_patterns() {\n    // Pattern 1: Independent clients\n    let http_client1 = NoOpClient::new();\n    let client1 = LastFmEditClientImpl::from_session(Box::new(http_client1), create_test_session());\n\n    let http_client2 = NoOpClient::new();\n    let session = client1.get_session();\n    let client2 = LastFmEditClientImpl::from_session(Box::new(http_client2), session);\n\n    // These should be independent - same session but different broadcasters\n    assert_eq!(\n        client1.get_session().base_url,\n        client2.get_session().base_url\n    );\n\n    // Pattern 2: Shared broadcaster\n    let http_client3 = NoOpClient::new();\n    let client3 = client1.with_shared_broadcaster(Box::new(http_client3));\n\n    // These should share both session and broadcaster\n    assert_eq!(\n        client1.get_session().base_url,\n        client3.get_session().base_url\n    );\n\n    // Test that we can create subscriptions without issues\n    let _sub1 = client1.subscribe();\n    let _sub2 = client2.subscribe();\n    let _sub3 = client3.subscribe();\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","tests","mock_client.rs"],"content":"#[cfg(feature = \"mock\")]\nmod mock_tests {\n    use lastfm_edit::{\n        Album, AlbumPage, EditResponse, ExactScrobbleEdit, LastFmEditClient, MockLastFmEditClient,\n        Result, ScrobbleEdit, Track, TrackPage,\n    };\n    use mockall::predicate::*; // for eq(), any(), etc.\n\n    #[test_log::test(tokio::test)]\n    async fn test_mock_basic_functionality() -\u003e Result\u003c()\u003e {\n        let mut mock_clie n    // Track statistics\n    let mut total_tracks_scanned = 0;\n    let mut matching_tracks_found = 0;\n    let mut tracks_successfully_cleaned = 0;\n    let mut tracks_failed_to_clean = 0;\n    let mut already_cleaned_tracks = HashSet::new();\n\n    // Step 1: Collect all matching tracks first\n    println!(\"ğŸ” Step 1: Scanning entire {artist} catalog for matching tracks...\");\n    let mut all_matching_tracks = Vec::new();\n    let mut page = 1;\n\n    loop {\n        match client.get_artist_tracks_page(artist, page).await {\n            Ok(track_page) =\u003e {\n                if track_page.tracks.is_empty() {\n                    println!(\n                        \"ğŸ“š Reached end of {artist} catalog - scanned {total_tracks_scanned} tracks total\"\n                    );\n                    break;\n                }\n\n                for track in track_page.tracks {\n                    total_tracks_scanned += 1;\n\n                    // Print progress every 50 tracks\n                    if total_tracks_scanned % 50 == 0 {\n                        println!(\"ğŸ“– Scanned {total_tracks_scanned} tracks so far...\");\n                    }\n\n                    // Check if this track matches our pattern\n                    if regex.is_match(\u0026track.name) {\n                        let base_name = regex.replace(\u0026track.name, \"\").to_string();\n                        if !already_cleaned_tracks.contains(\u0026base_name) {\n                            all_matching_tracks.push(track);\n                            already_cleaned_tracks.insert(base_name);\n                            matching_tracks_found += 1;\n                        }\n                    }\n                }\n\n                if !track_page.has_next_page {\n                    println!(\n                        \"ğŸ“š Reached end of {artist} catalog - scanned {total_tracks_scanned} tracks total\"\n                    );\n                    break;\n                }\n\n                page += 1;\n            }\n            Err(e) =\u003e {\n                println!(\"âŒ Error fetching tracks page {page}: {e}\");\n                break;\n            }\n        }\n    }\n\n    // Step 2: Process all found matching tracks\n    if all_matching_tracks.is_empty() {\n        println!(\"\\nğŸ‰ No matching tracks found! Your {artist} catalog is already clean.\");\n        return Ok(());\n    }\n\n    println!(\n        \"\\nğŸ¯ Step 2: Processing {} matching tracks...\",\n        all_matching_tracks.len()\n    );\n    already_cleaned_tracks.clear(); // Reset for actual processing\n\n    for (index, track) in all_matching_tracks.iter().enumerate() {\n        let clean_name = regex.replace(\u0026track.name, \"\").to_string();\n\n        println!(\n            \"\\nğŸµ [{}/{}] Cleaning: '{}' â†’ '{}'\",\n            index + 1,\n            all_matching_tracks.len(),\n            track.name,\n            clean_name\n        );\n\n        // Skip if we've already processed this track name in this session\n        if already_cleaned_tracks.contains(\u0026clean_name) {\n            println!(\"   â­ï¸  Skipping - already processed in this session\");\n            continue;\n        }\n\n        // Load real edit form values from the track page\n        let edit_template = lastfm_edit::ScrobbleEdit::from_track_and_artist(\u0026track.name, artist);\n        match client\n            .discover_scrobble_edit_variations(\u0026edit_template)\n            .await\n        {\n            Ok(exact_edit_vec) =\u003e {\n                if let Some(exact_edit) = exact_edit_vec.into_iter().next() {\n                    let mut edit_data = exact_edit.to_scrobble_edit();\n                    println!(\n                        \"   ğŸ“‹ Loaded edit form data - Album: '{}'\",\n                        edit_data\n                            .album_name_original\n                            .as_deref()\n                            .unwrap_or(\"unknown\")\n                    );\n\n                    // Update the track name to the cleaned version\n                    edit_data.track_name = Some(clean_name.clone());\n\n                    println!(\"   ğŸ”§ Submitting edit...\");\n\n                    // Perform the edit\n                    match client.edit_scrobble(\u0026edit_data).await {\n                        Ok(_response) =\u003e {\n                            println!(\"   âœ… Successfully cleaned: '{clean_name}'\");\n                            tracks_successfully_cleaned += 1;\n                            already_cleaned_tracks.insert(clean_name);\n                        }\n                        Err(e) =\u003e {\n                            println!(\"   âŒ Error editing '{}': {}\", track.name, e);\n                            tracks_failed_to_clean += 1;\n                        }\n                    }\n                } else {\n                    println!(\"   âš ï¸  No edit data found for track\");\n                    tracks_failed_to_clean += 1;\n                }\n            }\n            Err(e) =\u003e {\n                println!(\"   âš ï¸  Couldn't load edit form for '{}': {}\", track.name, e);\n                println!(\"      This track might not be in your recent scrobbles\");\n                tracks_failed_to_clean += 1;\n            }\n        }\n\n        // Add a small delay to be respectful to Last.fm servers\n        println!(\"   â³ Waiting 1.2s before next track...\");\n        tokio::time::sleep(tokio::time::Duration::from_millis(1200)).await;\n    }\n\n    // Print final statistics\n    println!(\"\\n{}\", \"=\".repeat(60));\n    println!(\"ğŸ¼ {} CATALOG CLEANUP COMPLETE\", artist.to_uppercase());\n    println!(\"{}\", \"=\".repeat(60));\n    println!(\"ğŸ“Š STATISTICS:\");\n    println!(\"   â€¢ Total tracks scanned: {total_tracks_scanned}\");\n    println!(\"   â€¢ Matching tracks found: {matching_tracks_found}\");\n    println!(\"   â€¢ Tracks successfully cleaned: {tracks_successfully_cleaned}\");\n    println!(\"   â€¢ Tracks failed to clean: {tracks_failed_to_clean}\");\n\n    if tracks_successfully_cleaned \u003e 0 {\n        println!(\n            \"\\nâœ¨ Your {artist} catalog is now cleaner! Pattern '{pattern}' has been removed from track names.\"\n        );\n    }\n\n    if tracks_failed_to_clean \u003e 0 {\n        println!(\"\\nâš ï¸  Some tracks couldn't be cleaned. This usually happens when:\");\n        println!(\"   â€¢ The track hasn't been scrobbled recently\");\n        println!(\"   â€¢ The track data isn't in your listening history\");\n        println!(\"   â€¢ There were temporary server issues\");\n        println!(\"\\nğŸ’¡ You can re-run this script later to try cleaning the remaining tracks.\");\n    }\n\n    println!(\"\\nğŸµ {artist} catalog cleanup completed!\");\n\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","custom_session_manager.rs"],"content":"/// Example demonstrating how to use SessionManager with custom app names.\n///\n/// This example shows how other libraries can use SessionManager to store\n/// Last.fm sessions with their own application prefix in XDG directories.\n///\n/// Usage:\n///   direnv exec . cargo run --example custom_session_manager\nuse lastfm_edit::{LastFmEditClientImpl, SessionManager};\nuse std::env;\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c(), Box\u003cdyn std::error::Error\u003e\u003e {\n    env_logger::init();\n\n    println!(\"ğŸµ Custom SessionManager Example\");\n    println!(\"=================================\\n\");\n\n    // Create a custom session manager for your application\n    let session_manager = SessionManager::new(\"my-music-app\");\n    println!(\"ğŸ“ Using app name: '{}'\", session_manager.app_name());\n    println!(\"ğŸ“‚ Sessions will be stored in: ~/.local/share/my-music-app/users/{{username}}/session.json\\n\");\n\n    let username = env::var(\"LASTFM_EDIT_USERNAME\")\n        .expect(\"LASTFM_EDIT_USERNAME environment variable not set\");\n    let password = env::var(\"LASTFM_EDIT_PASSWORD\")\n        .expect(\"LASTFM_EDIT_PASSWORD environment variable not set\");\n\n    // Check if we have a saved session with our custom manager\n    if session_manager.session_exists(\u0026username) {\n        println!(\"ğŸ“ Found existing session for user '{username}', attempting to restore...\");\n\n        match session_manager.load_session(\u0026username) {\n            Ok(session) =\u003e {\n                println!(\"ğŸ“¥ Session loaded successfully\");\n\n                // Create client with loaded session\n                let http_client = http_client::native::NativeClient::new();\n                let client = LastFmEditClientImpl::from_session(Box::new(http_client), session);\n\n                // Validate the session\n                println!(\"ğŸ” Validating session...\");\n                if client.validate_session().await {\n                    println!(\"âœ… Session is valid, using saved session\");\n\n                    // Test the session by fetching recent tracks\n                    println!(\"ğŸ§ Testing session by fetching recent tracks...\");\n                    let tracks = client.get_recent_scrobbles(1).await?;\n                    let recent_tracks: Vec\u003c_\u003e = tracks.into_iter().take(3).collect();\n                    println!(\"ğŸ“Š Found {} recent tracks:\", recent_tracks.len());\n\n                    for track in recent_tracks {\n                        println!(\"   ğŸµ {} - {}\", track.artist, track.name);\n                    }\n\n                    return Ok(());\n                } else {\n                    println!(\"âŒ Session is invalid or expired\");\n                    // Remove invalid session file\n                    let _ = session_manager.remove_session(\u0026username);\n                }\n            }\n            Err(e) =\u003e {\n                println!(\"âŒ Failed to load session: {e}\");\n                // Remove corrupted session file\n                let _ = session_manager.remove_session(\u0026username);\n            }\n        }\n    }\n\n    // No valid session found, perform fresh login\n    println!(\"ğŸ” No valid session found, performing fresh login...\");\n    let http_client = http_client::native::NativeClient::new();\n    let client =\n        LastFmEditClientImpl::login_with_credentials(Box::new(http_client), \u0026username, \u0026password)\n            .await?;\n\n    // Save the new session with our custom manager\n    println!(\"ğŸ’¾ Saving session with custom session manager...\");\n    let session = client.get_session();\n    if let Err(e) = session_manager.save_session(\u0026session) {\n        println!(\"âš ï¸  Warning: Failed to save session: {e}\");\n        println!(\"   (You'll need to login again next time)\");\n    } else {\n        println!(\"âœ… Session saved to custom location\");\n\n        // Show the session path\n        let session_path = session_manager.get_session_path(\u0026username)?;\n        println!(\"ğŸ“‚ Session saved to: {}\", session_path.display());\n    }\n\n    // Test the new session\n    println!(\"ğŸ§ Testing session by fetching recent tracks...\");\n    let tracks = client.get_recent_scrobbles(1).await?;\n    let recent_tracks: Vec\u003c_\u003e = tracks.into_iter().take(3).collect();\n    println!(\"ğŸ“Š Found {} recent tracks:\", recent_tracks.len());\n\n    for track in recent_tracks {\n        println!(\"   ğŸµ {} - {}\", track.artist, track.name);\n    }\n\n    // Demonstrate listing saved users\n    println!(\"\\nğŸ‘¥ Listing all saved users for this app:\");\n    let saved_users = session_manager.list_saved_users()?;\n    if saved_users.is_empty() {\n        println!(\"   No saved users found\");\n    } else {\n        for user in saved_users {\n            println!(\"   - {user}\");\n        }\n    }\n\n    println!(\"\\nğŸ‰ Example completed!\");\n    println!(\"ğŸ’¡ Your custom session is saved separately from the default lastfm-edit sessions.\");\n    println!(\n        \"ğŸ’¡ Other apps using SessionManager with different names won't interfere with each other.\"\n    );\n\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","debug_album_url.rs"],"content":"#[path = \"shared/common.rs\"]\nmod common;\n\nuse lastfm_edit::Result;\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c()\u003e {\n    let client = common::setup_client().await?;\n\n    let artist = \"Radiohead\";\n    let album = \"In Rainbows\";\n\n    println!(\"=== Debug Album URL Test ===\\n\");\n    println!(\"ğŸ” Testing URL construction for album tracks...\");\n    println!(\"Artist: {artist}\");\n    println!(\"Album: {album}\\n\");\n\n    // First, let's see if the artist has albums at all\n    println!(\"1. Testing artist albums page...\");\n    match client.get_artist_albums_page(artist, 1).await {\n        Ok(albums_page) =\u003e {\n            println!(\"âœ… Found {} albums for {artist}\", albums_page.albums.len());\n            for (i, album_item) in albums_page.albums.iter().enumerate().take(5) {\n                println!(\n                    \"   [{i}] '{}' ({} plays)\",\n                    album_item.name, album_item.playcount\n                );\n            }\n        }\n        Err(e) =\u003e {\n            println!(\"âŒ Error getting albums: {e}\");\n            return Ok(());\n        }\n    }\n\n    println!(\"\\n2. Testing album tracks page...\");\n    match client.get_album_tracks_page(album, artist, 1).await {\n        Ok(tracks_page) =\u003e {\n            println!(\n                \"âœ… Album tracks page returned {} tracks\",\n                tracks_page.tracks.len()\n            );\n            println!(\"   Has next page: {}\", tracks_page.has_next_page);\n            println!(\"   Total pages: {:?}\", tracks_page.total_pages);\n            for (i, track) in tracks_page.tracks.iter().enumerate().take(10) {\n                println!(\n                    \"   [{i}] '{}' - Album: '{}'\",\n                    track.name,\n                    track.album.as_deref().unwrap_or(\"(none)\")\n                );\n            }\n        }\n        Err(e) =\u003e {\n            println!(\"âŒ Error getting album tracks: {e}\");\n        }\n    }\n\n    // Let's also test with an album we know exists from the albums list\n    println!(\"\\n3. Testing with first album from albums list...\");\n    match client.get_artist_albums_page(artist, 1).await {\n        Ok(albums_page) =\u003e {\n            if let Some(first_album) = albums_page.albums.first() {\n                println!(\"Testing with album: '{}'\", first_album.name);\n                match client\n                    .get_album_tracks_page(\u0026first_album.name, artist, 1)\n                    .await\n                {\n                    Ok(tracks_page) =\u003e {\n                        println!(\n                            \"âœ… Found {} tracks for '{}'\",\n                            tracks_page.tracks.len(),\n                            first_album.name\n                        );\n                        for (i, track) in tracks_page.tracks.iter().enumerate().take(5) {\n                            println!(\"   [{i}] '{}'\", track.name);\n                        }\n                    }\n                    Err(e) =\u003e {\n                        println!(\"âŒ Error: {e}\");\n                    }\n                }\n            } else {\n                println!(\"No albums found in list\");\n            }\n        }\n        Err(e) =\u003e {\n            println!(\"âŒ Error getting albums: {e}\");\n        }\n    }\n\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","list_artist_tracks.rs"],"content":"#[path = \"shared/common.rs\"]\nmod common;\n\nuse lastfm_edit::{LastFmEditClient, Result};\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c()\u003e {\n    let client = common::setup_client().await?;\n\n    let artist = std::env::args()\n        .nth(1)\n        .unwrap_or_else(|| \"Queen\".to_string());\n\n    println!(\"=== Artist Tracks Listing (using Iterator) ===\\n\");\n    println!(\"ğŸµ Listing all tracks for artist: {artist}\\n\");\n\n    // Use the iterator the same way as Case 4: Artist-specific discovery\n    let mut tracks_iterator = client.artist_tracks(\u0026artist);\n    let mut track_count = 0;\n\n    println!(\"ğŸ” Fetching tracks using iterator...\\n\");\n\n    while let Some(track) = tracks_iterator.next().await? {\n        track_count += 1;\n        println!(\n            \"[{:4}] '{}' | Album: '{}' | Plays: {} | Timestamp: {:?}\",\n            track_count,\n            track.name,\n            track.album.as_deref().unwrap_or(\"(no album)\"),\n            track.playcount,\n            track.timestamp\n        );\n\n        // Limit output for testing to avoid overwhelming output\n        if track_count \u003e= 50 {\n            println!(\"\\nâš ï¸  Limiting output to first 50 tracks for testing...\");\n            break;\n        }\n    }\n\n    println!(\"\\n=== Summary ===\");\n    println!(\"ğŸ“Š Total tracks displayed: {track_count}\");\n\n    if let Some(total_pages) = tracks_iterator.total_pages() {\n        println!(\"ğŸ“„ Total pages available: {total_pages}\");\n    }\n\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","list_recent_tracks.rs"],"content":"#[path = \"shared/common.rs\"]\nmod common;\n\nuse lastfm_edit::{LastFmEditClient, Result};\nuse std::env;\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c()\u003e {\n    let client = common::setup_client().await?;\n\n    // Parse command line arguments\n    let args: Vec\u003cString\u003e = env::args().collect();\n    let num_tracks: usize = args.get(1).and_then(|s| s.parse().ok()).unwrap_or(20);\n    let starting_page: u32 = args.get(2).and_then(|s| s.parse().ok()).unwrap_or(1);\n\n    println!(\"Fetching {num_tracks} recent tracks starting from page {starting_page}...\");\n    println!();\n\n    // Create iterator starting from the specified page\n    let mut recent_tracks = client.recent_tracks_from_page(starting_page);\n    let mut count = 0;\n\n    // Use the iterator to fetch tracks\n    while count \u003c num_tracks {\n        match recent_tracks.next().await? {\n            Some(track) =\u003e {\n                let timestamp_str = if let Some(ts) = track.timestamp {\n                    format!(\n                        \" ({})\",\n                        chrono::DateTime::from_timestamp(ts as i64, 0)\n                            .map(|dt| dt.format(\"%Y-%m-%d %H:%M:%S\").to_string())\n                            .unwrap_or_else(|| format!(\"timestamp: {ts}\"))\n                    )\n                } else {\n                    \" (no timestamp)\".to_string()\n                };\n\n                let album_str = if let Some(album) = \u0026track.album {\n                    format!(\" [{album}]\")\n                } else {\n                    \"\".to_string()\n                };\n\n                println!(\n                    \"{}. {} - {}{}{}\",\n                    count + 1,\n                    track.artist,\n                    track.name,\n                    album_str,\n                    timestamp_str\n                );\n\n                count += 1;\n            }\n            None =\u003e {\n                println!(\"No more tracks available.\");\n                break;\n            }\n        }\n    }\n\n    println!();\n    println!(\"Fetched {count} tracks total.\");\n\n    println!();\n    println!(\"Usage: cargo run --example list_recent_tracks [num_tracks] [starting_page]\");\n    println!(\"  num_tracks    - Number of tracks to fetch (default: 20)\");\n    println!(\"  starting_page - Page number to start from (default: 1)\");\n    println!();\n    println!(\"Examples:\");\n    println!(\"  cargo run --example list_recent_tracks 50     # Fetch 50 tracks from page 1\");\n    println!(\n        \"  cargo run --example list_recent_tracks 20 5   # Fetch 20 tracks starting from page 5\"\n    );\n\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","rate_limit_monitoring.rs"],"content":"use lastfm_edit::{ClientEvent, LastFmEditClientImpl};\nuse std::env;\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c(), Box\u003cdyn std::error::Error\u003e\u003e {\n    env_logger::init();\n\n    let username =\n        env::var(\"LASTFM_EDIT_USERNAME\").expect(\"Set LASTFM_EDIT_USERNAME environment variable\");\n    let password =\n        env::var(\"LASTFM_EDIT_PASSWORD\").expect(\"Set LASTFM_EDIT_PASSWORD environment variable\");\n\n    // Login and create client\n    let http_client = http_client::native::NativeClient::new();\n    println!(\"Logging in as {username}...\");\n    let client =\n        LastFmEditClientImpl::login_with_credentials(Box::new(http_client), \u0026username, \u0026password)\n            .await?;\n\n    // Subscribe to client events before any operations\n    let mut events = client.subscribe();\n\n    // Spawn a background task to monitor events\n    let event_monitor = tokio::spawn(async move {\n        println!(\"ğŸ” Monitoring client events...\");\n        while let Ok(event) = events.recv().await {\n            match event {\n                ClientEvent::RequestStarted { request } =\u003e {\n                    println!(\"ğŸš€ Starting request: {}\", request.short_description());\n                }\n                ClientEvent::RequestCompleted {\n                    request,\n                    status_code,\n                    duration_ms,\n                } =\u003e {\n                    println!(\n                        \"âœ… Completed request: {} - {} ({} ms)\",\n                        request.short_description(),\n                        status_code,\n                        duration_ms\n                    );\n                }\n                ClientEvent::RateLimited {\n                    delay_seconds,\n                    request,\n                    rate_limit_type,\n                    rate_limit_timestamp,\n                } =\u003e {\n                    let req_desc = request\n                        .as_ref()\n                        .map(|r| r.short_description())\n                        .unwrap_or_else(|| \"unknown request\".to_string());\n                    println!(\n                        \"â³ Rate limited ({rate_limit_type:?})! {req_desc} - Waiting {delay_seconds} seconds (at timestamp {rate_limit_timestamp})\"\n                    );\n                }\n                ClientEvent::RateLimitEnded {\n                    request,\n                    rate_limit_type,\n                    total_rate_limit_duration_seconds,\n                } =\u003e {\n                    println!(\n                        \"ğŸ‰ Rate limiting ended ({rate_limit_type:?}) after {total_rate_limit_duration_seconds} seconds - {}\",\n                        request.short_description()\n                    );\n                }\n                ClientEvent::EditAttempted {\n                    edit,\n                    success,\n                    error_message,\n                    duration_ms,\n                } =\u003e {\n                    if success {\n                        println!(\n                            \"âœ… Edit succeeded: '{}' -\u003e '{}' ({duration_ms} ms)\",\n                            edit.track_name_original, edit.track_name\n                        );\n                    } else {\n                        let error_msg = error_message\n                            .as_ref()\n                            .map(|s| format!(\" - {s}\"))\n                            .unwrap_or_default();\n                        println!(\n                            \"âŒ Edit failed: '{}' -\u003e '{}' ({duration_ms} ms){error_msg}\",\n                            edit.track_name_original, edit.track_name\n                        );\n                    }\n                }\n            }\n        }\n    });\n\n    println!(\"âœ… Successfully logged in as: {}\", client.username());\n\n    // Check latest event after login\n    if let Some(event) = client.latest_event() {\n        match event {\n            ClientEvent::RequestStarted { request } =\u003e {\n                println!(\n                    \"ğŸ“Š Latest event: Started request {}\",\n                    request.short_description()\n                );\n            }\n            ClientEvent::RequestCompleted {\n                request,\n                status_code,\n                duration_ms,\n            } =\u003e {\n                println!(\n                    \"ğŸ“Š Latest event: Completed request {} - {} ({} ms)\",\n                    request.short_description(),\n                    status_code,\n                    duration_ms\n                );\n            }\n            ClientEvent::RateLimited {\n                delay_seconds,\n                request,\n                rate_limit_type,\n                rate_limit_timestamp,\n            } =\u003e {\n                let req_desc = request\n                    .as_ref()\n                    .map(|r| r.short_description())\n                    .unwrap_or_else(|| \"unknown request\".to_string());\n                println!(\n                    \"ğŸ“Š Latest event: Rate limited ({rate_limit_type:?}) for {delay_seconds} seconds - {req_desc} (at timestamp {rate_limit_timestamp})\"\n                );\n            }\n            ClientEvent::RateLimitEnded {\n                request,\n                rate_limit_type,\n                total_rate_limit_duration_seconds,\n            } =\u003e {\n                println!(\n                    \"ğŸ“Š Latest event: Rate limiting ended ({rate_limit_type:?}) after {total_rate_limit_duration_seconds} seconds - {}\",\n                    request.short_description()\n                );\n            }\n            ClientEvent::EditAttempted {\n                edit,\n                success,\n                error_message,\n                duration_ms,\n            } =\u003e {\n                if success {\n                    println!(\n                        \"ğŸ“Š Latest event: Edit succeeded '{}' -\u003e '{}' ({duration_ms} ms)\",\n                        edit.track_name_original, edit.track_name\n                    );\n                } else {\n                    let error_msg = error_message\n                        .as_ref()\n                        .map(|s| format!(\" - {s}\"))\n                        .unwrap_or_default();\n                    println!(\n                        \"ğŸ“Š Latest event: Edit failed '{}' -\u003e '{}' ({duration_ms} ms){error_msg}\",\n                        edit.track_name_original, edit.track_name\n                    );\n                }\n            }\n        }\n    } else {\n        println!(\"ğŸ“Š No events have occurred yet\");\n    }\n\n    // Make some requests that might trigger rate limiting\n    println!(\"ğŸµ Fetching recent tracks to potentially trigger rate limiting...\");\n\n    for page in 1..=3 {\n        println!(\"ğŸ“„ Fetching page {page}...\");\n        match client.get_recent_scrobbles(page).await {\n            Ok(tracks) =\u003e {\n                println!(\"âœ… Got {} tracks from page {page}\", tracks.len());\n            }\n            Err(e) =\u003e {\n                println!(\"âŒ Error on page {page}: {e}\");\n            }\n        }\n\n        // Check if we're currently rate limited\n        if let Some(ClientEvent::RateLimited { delay_seconds, .. }) = client.latest_event() {\n            println!(\n                \"ğŸ›‘ Currently rate limited for {delay_seconds} seconds according to latest event\"\n            );\n        }\n\n        // Small delay between requests\n        tokio::time::sleep(std::time::Duration::from_millis(500)).await;\n    }\n\n    println!(\"ğŸ Done! Event monitor will continue running...\");\n\n    // Let the event monitor run for a bit longer to catch any final events\n    tokio::time::sleep(std::time::Duration::from_secs(2)).await;\n\n    // Cancel the event monitor\n    event_monitor.abort();\n\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","remove_remaster.rs"],"content":"#[path = \"shared/common.rs\"]\nmod common;\n\nuse lastfm_edit::{LastFmEditClient, Result};\nuse regex::Regex;\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c()\u003e {\n    let client = common::setup_client().await?;\n\n    println!(\"=== Remaster \u0026 Year Removal Tool ===\\n\");\n    println!(\"ğŸ¯ This will remove 'remastered' text and year suffixes from track names\");\n    println!(\"ğŸ“ Patterns include: '- 2009', '(2009)', '[2009]', '- Remaster', etc.\\n\");\n\n    let artist = std::env::args()\n        .nth(1)\n        .unwrap_or_else(|| \"The Beatles\".to_string());\n\n    println!(\"ğŸµ Processing tracks for artist: {artist}\\n\");\n\n    // Regex patterns to clean up remaster text and year suffixes\n    // Note: Order matters! More specific patterns should come first\n    let remaster_patterns = vec![\n        // Patterns with \"remaster\" word (most specific)\n        // \"Track Name - 2009 Remaster\" -\u003e \"Track Name\"\n        Regex::new(r\"(?i)\\s*-\\s*\\d{4}\\s*remaster(ed)?.*$\").unwrap(),\n        // \"Track Name - Remaster\" or \"Track Name - Remastered\" -\u003e \"Track Name\"\n        Regex::new(r\"(?i)\\s*-\\s*remaster(ed)?.*$\").unwrap(),\n        // \"Track Name (2009 Remaster)\" -\u003e \"Track Name\"\n        Regex::new(r\"(?i)\\s*\\(\\d{4}\\s*remaster(ed)?.*\\)\\s*$\").unwrap(),\n        // \"Track Name (Remaster)\" or \"Track Name (Remastered)\" -\u003e \"Track Name\"\n        Regex::new(r\"(?i)\\s*\\(remaster(ed)?.*\\)\\s*$\").unwrap(),\n        // \"Track Name [2009 Remaster]\" -\u003e \"Track Name\"\n        Regex::new(r\"(?i)\\s*\\[\\d{4}\\s*remaster(ed)?.*\\]\\s*$\").unwrap(),\n        // \"Track Name [Remaster]\" or \"Track Name [Remastered]\" -\u003e \"Track Name\"\n        Regex::new(r\"(?i)\\s*\\[remaster(ed)?.*\\]\\s*$\").unwrap(),\n        // \"Track Name Remastered\" -\u003e \"Track Name\"\n        Regex::new(r\"(?i)\\s*remaster(ed)?\\s*(\\d{4})?\\s*$\").unwrap(),\n        // Years that are likely remaster years (1980-2030) - be more conservative\n        // \"Track Name - 2009\" -\u003e \"Track Name\" (only for likely remaster years)\n        Regex::new(r\"(?i)\\s*-\\s*(19[8-9]\\d|20[0-3]\\d)\\s*$\").unwrap(),\n        // \"Track Name (2009)\" -\u003e \"Track Name\" (only for likely remaster years)\n        Regex::new(r\"(?i)\\s*\\((19[8-9]\\d|20[0-3]\\d)\\)\\s*$\").unwrap(),\n        // \"Track Name [2009]\" -\u003e \"Track Name\" (only for likely remaster years)\n        Regex::new(r\"(?i)\\s*\\[(19[8-9]\\d|20[0-3]\\d)\\]\\s*$\").unwrap(),\n        // Other common suffixes that should be removed\n        // \"Track Name - 2019 Mix\" -\u003e \"Track Name\"\n        Regex::new(r\"(?i)\\s*-\\s*\\d{4}\\s*mix.*$\").unwrap(),\n        // \"Track Name - Mix\" -\u003e \"Track Name\"\n        Regex::new(r\"(?i)\\s*-\\s*mix.*$\").unwrap(),\n    ];\n\n    // First, collect some tracks to process\n    let mut tracks_to_process = Vec::new();\n    let mut fetched_count = 0;\n    let mut page = 1;\n\n    loop {\n        match client.get_artist_tracks_page(\u0026artist, page).await {\n            Ok(track_page) =\u003e {\n                if track_page.tracks.is_empty() {\n                    println!(\"\\nğŸ“š Fetched all {fetched_count} tracks for {artist}\");\n                    break;\n                }\n\n                for track in track_page.tracks {\n                    fetched_count += 1;\n                    println!(\"ğŸ” [{:3}] Found track: '{}'\", fetched_count, track.name);\n\n                    // Check if track name contains remaster text\n                    let mut cleaned_name = track.name.clone();\n                    let mut needs_cleaning = false;\n\n                    for pattern in \u0026remaster_patterns {\n                        if pattern.is_match(\u0026cleaned_name) {\n                            cleaned_name = pattern.replace(\u0026cleaned_name, \"\").trim().to_string();\n                            needs_cleaning = true;\n                        }\n                    }\n\n                    if needs_cleaning \u0026\u0026 !cleaned_name.is_empty() {\n                        tracks_to_process.push((track, cleaned_name));\n                    }\n                }\n\n                if !track_page.has_next_page {\n                    println!(\"\\nğŸ“š Fetched all {fetched_count} tracks for {artist}\");\n                    break;\n                }\n\n                page += 1;\n            }\n            Err(e) =\u003e {\n                println!(\"âŒ Error fetching tracks page {page}: {e}\");\n                break;\n            }\n        }\n    }\n\n    println!(\n        \"\\nğŸ§¹ Starting remaster removal on {} tracks...\\n\",\n        tracks_to_process.len()\n    );\n\n    let mut processed_count = 0;\n    let mut edits_made = 0;\n    let mut rate_limit_hits = 0;\n\n    // Now process the collected tracks\n    for (track, cleaned_name) in tracks_to_process {\n        processed_count += 1;\n        println!(\n            \"ğŸ”§ [{:3}] Processing: '{}' -\u003e '{}'\",\n            processed_count, track.name, cleaned_name\n        );\n        println!(\"   ğŸ”„ Applying change...\");\n\n        // Load edit form - this makes an HTTP request\n        let edit_template =\n            lastfm_edit::ScrobbleEdit::from_track_and_artist(\u0026track.name, \u0026track.artist);\n        match client\n            .discover_scrobble_edit_variations(\u0026edit_template)\n            .await\n        {\n            Ok(exact_edit_vec) =\u003e {\n                if let Some(exact_edit) = exact_edit_vec.into_iter().next() {\n                    let mut edit_data = exact_edit.to_scrobble_edit();\n                    // Update track name\n                    edit_data.track_name = Some(cleaned_name.clone());\n\n                    // Submit edit - another HTTP request\n                    match client.edit_scrobble(\u0026edit_data).await {\n                        Ok(_) =\u003e {\n                            edits_made += 1;\n                            println!(\"   âœ… Successfully cleaned track\");\n                        }\n                        Err(e) =\u003e {\n                            println!(\"   âŒ Error editing track: {e}\");\n                            if e.to_string().contains(\"RateLimit\") {\n                                rate_limit_hits += 1;\n                                log::info!(\"Rate limit encountered during edit operation for track '{}' by '{}'\", track.name, track.artist);\n                                println!(\"   ğŸš¨ RATE LIMIT DETECTED during edit operation!\");\n                                break;\n                            }\n                        }\n                    }\n                } else {\n                    println!(\"   âš ï¸  No edit data found for track\");\n                }\n            }\n            Err(e) =\u003e {\n                println!(\"   âš ï¸  Couldn't load edit form: {e}\");\n                if e.to_string().contains(\"RateLimit\") {\n                    rate_limit_hits += 1;\n                    log::info!(\n                        \"Rate limit encountered during form load for track '{}' by '{}'\",\n                        track.name,\n                        track.artist\n                    );\n                    println!(\"   ğŸš¨ RATE LIMIT DETECTED during form load!\");\n                    break;\n                }\n            }\n        }\n    }\n\n    println!(\"\\n=== Summary ===\");\n    println!(\"ğŸ“Š Tracks processed: {processed_count}\");\n    println!(\"âœï¸  Edits made: {edits_made}\");\n    println!(\"ğŸš¨ Rate limit hits: {rate_limit_hits}\");\n\n    if rate_limit_hits \u003e 0 {\n        println!(\"\\nğŸ¯ Rate limiting was triggered.\");\n    } else {\n        println!(\"\\nâœ¨ All changes completed successfully!\");\n    }\n\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","rename_album.rs"],"content":"#[path = \"shared/common.rs\"]\nmod common;\n\nuse lastfm_edit::{LastFmEditClient, Result};\nuse std::env;\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c()\u003e {\n    let args: Vec\u003cString\u003e = env::args().collect();\n\n    if args.len() != 4 {\n        eprintln!(\"Usage: cargo run --example rename_album -- \\\"Old Album Name\\\" \\\"New Album Name\\\" \\\"Artist Name\\\"\");\n        eprintln!(\"Example: cargo run --example rename_album -- \\\"Abbey Road - Remastered 2019\\\" \\\"Abbey Road\\\" \\\"The Beatles\\\"\");\n        std::process::exit(1);\n    }\n\n    let old_album_name = \u0026args[1];\n    let new_album_name = \u0026args[2];\n    let artist_name = \u0026args[3];\n\n    let client = common::setup_client().await?;\n\n    println!(\"=== Album Rename Tool ===\\n\");\n    println!(\"ğŸ¨ Artist: {artist_name}\");\n    println!(\"ğŸ’¿ Renaming: '{old_album_name}' â†’ '{new_album_name}'\");\n    println!();\n\n    println!(\"ğŸ” Loading album edit form data...\");\n    match client\n        .edit_album(old_album_name, new_album_name, artist_name)\n        .await\n    {\n        Ok(_response) =\u003e {\n            println!(\"âœ… Successfully renamed album!\");\n            println!(\"   From: '{old_album_name}'\");\n            println!(\"   To:   '{new_album_name}'\");\n            println!(\"   Artist: {artist_name}\");\n            println!(\n                \"\\nğŸ’¡ All scrobbles from this album have been updated with the new album name.\"\n            );\n        }\n        Err(e) =\u003e {\n            println!(\"âŒ Failed to rename album: {e}\");\n            println!(\"\\nThis might happen if:\");\n            println!(\"   â€¢ The album hasn't been scrobbled recently\");\n            println!(\"   â€¢ The album name doesn't match exactly\");\n            println!(\"   â€¢ There are temporary server issues\");\n        }\n    }\n\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","rename_artist.rs"],"content":"#[path = \"shared/common.rs\"]\nmod common;\n\nuse lastfm_edit::Result;\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c()\u003e {\n    let mut client = common::setup_client().await?;\n\n    let args: Vec\u003cString\u003e = std::env::args().collect();\n    if args.len() \u003c 4 {\n        eprintln!(\"Usage:\");\n        eprintln!(\"  {} all \u003cold_artist\u003e \u003cnew_artist\u003e\", args[0]);\n        eprintln!(\"  {} track \u003ctrack_name\u003e \u003cold_artist\u003e \u003cnew_artist\u003e\", args[0]);\n        eprintln!(\"  {} album \u003calbum_name\u003e \u003cold_artist\u003e \u003cnew_artist\u003e\", args[0]);\n        eprintln!();\n        eprintln!(\"Examples:\");\n        eprintln!(\"  {} all \\\"The Beatles\\\" \\\"Beatles\\\"\", args[0]);\n        eprintln!(\n            \"  {} track \\\"Hey Jude\\\" \\\"The Beatles\\\" \\\"Beatles\\\"\",\n            args[0]\n        );\n        eprintln!(\n            \"  {} album \\\"Abbey Road\\\" \\\"The Beatles\\\" \\\"Beatles\\\"\",\n            args[0]\n        );\n        std::process::exit(1);\n    }\n\n    let mode = \u0026args[1];\n\n    match mode.as_str() {\n        \"all\" =\u003e {\n            if args.len() != 4 {\n                eprintln!(\"Usage: {} all \u003cold_artist\u003e \u003cnew_artist\u003e\", args[0]);\n                std::process::exit(1);\n            }\n            let old_artist = \u0026args[2];\n            let new_artist = \u0026args[3];\n            rename_all_tracks(\u0026mut client, old_artist, new_artist).await\n        }\n        \"track\" =\u003e {\n            if args.len() != 5 {\n                eprintln!(\n                    \"Usage: {} track \u003ctrack_name\u003e \u003cold_artist\u003e \u003cnew_artist\u003e\",\n                    args[0]\n                );\n                std::process::exit(1);\n            }\n            let track_name = \u0026args[2];\n            let old_artist = \u0026args[3];\n            let new_artist = \u0026args[4];\n            rename_single_track(\u0026mut client, track_name, old_artist, new_artist).await\n        }\n        \"album\" =\u003e {\n            if args.len() != 5 {\n                eprintln!(\n                    \"Usage: {} album \u003calbum_name\u003e \u003cold_artist\u003e \u003cnew_artist\u003e\",\n                    args[0]\n                );\n                std::process::exit(1);\n            }\n            let album_name = \u0026args[2];\n            let old_artist = \u0026args[3];\n            let new_artist = \u0026args[4];\n            rename_album_tracks(\u0026mut client, album_name, old_artist, new_artist).await\n        }\n        _ =\u003e {\n            eprintln!(\"Invalid mode '{mode}'. Use 'all', 'track', or 'album'\");\n            std::process::exit(1);\n        }\n    }\n}\n\nasync fn rename_all_tracks(\n    client: \u0026mut dyn lastfm_edit::LastFmEditClient,\n    old_artist: \u0026str,\n    new_artist: \u0026str,\n) -\u003e Result\u003c()\u003e {\n    println!(\"=== Artist Rename Tool - All Tracks ===\\n\");\n    println!(\"ğŸ¯ This will rename ALL tracks from one artist to another\");\n    println!(\"ğŸ“ Old artist: '{old_artist}'\");\n    println!(\"ğŸ“ New artist: '{new_artist}'\");\n    println!(\"âš ï¸  This will edit ALL tracks that are found in your recent scrobbles!\\n\");\n\n    if !confirm_operation()? {\n        return Ok(());\n    }\n\n    println!(\"\\nğŸ” Starting artist rename operation...\\n\");\n\n    match client.edit_artist(old_artist, new_artist).await {\n        Ok(response) =\u003e print_result(response),\n        Err(e) =\u003e println!(\"âŒ Error during artist rename: {e}\"),\n    }\n\n    Ok(())\n}\n\nasync fn rename_single_track(\n    client: \u0026mut dyn lastfm_edit::LastFmEditClient,\n    track_name: \u0026str,\n    old_artist: \u0026str,\n    new_artist: \u0026str,\n) -\u003e Result\u003c()\u003e {\n    println!(\"=== Artist Rename Tool - Single Track ===\\n\");\n    println!(\"ğŸ¯ This will rename the artist for a specific track\");\n    println!(\"ğŸµ Track: '{track_name}'\");\n    println!(\"ğŸ“ Old artist: '{old_artist}'\");\n    println!(\"ğŸ“ New artist: '{new_artist}'\");\n    println!(\"âš ï¸  This will only edit this specific track if found in recent scrobbles!\\n\");\n\n    if !confirm_operation()? {\n        return Ok(());\n    }\n\n    println!(\"\\nğŸ” Starting track artist rename...\\n\");\n\n    match client\n        .edit_artist_for_track(track_name, old_artist, new_artist)\n        .await\n    {\n        Ok(response) =\u003e print_result(response),\n        Err(e) =\u003e println!(\"âŒ Error during track artist rename: {e}\"),\n    }\n\n    Ok(())\n}\n\nasync fn rename_album_tracks(\n    client: \u0026mut dyn lastfm_edit::LastFmEditClient,\n    album_name: \u0026str,\n    old_artist: \u0026str,\n    new_artist: \u0026str,\n) -\u003e Result\u003c()\u003e {\n    println!(\"=== Artist Rename Tool - Album Tracks ===\\n\");\n    println!(\"ğŸ¯ This will rename the artist for all tracks in a specific album\");\n    println!(\"ğŸ’¿ Album: '{album_name}'\");\n    println!(\"ğŸ“ Old artist: '{old_artist}'\");\n    println!(\"ğŸ“ New artist: '{new_artist}'\");\n    println!(\"âš ï¸  This will edit all tracks in this album that are found in recent scrobbles!\\n\");\n\n    if !confirm_operation()? {\n        return Ok(());\n    }\n\n    println!(\"\\nğŸ” Starting album artist rename...\\n\");\n\n    match client\n        .edit_artist_for_album(album_name, old_artist, new_artist)\n        .await\n    {\n        Ok(response) =\u003e print_result(response),\n        Err(e) =\u003e println!(\"âŒ Error during album artist rename: {e}\"),\n    }\n\n    Ok(())\n}\n\nfn confirm_operation() -\u003e Result\u003cbool\u003e {\n    print!(\"Are you sure you want to continue? [y/N]: \");\n    std::io::Write::flush(\u0026mut std::io::stdout()).unwrap();\n\n    let mut input = String::new();\n    std::io::stdin().read_line(\u0026mut input).unwrap();\n    let response = input.trim().to_lowercase();\n\n    if response != \"y\" \u0026\u0026 response != \"yes\" {\n        println!(\"Operation cancelled.\");\n        return Ok(false);\n    }\n\n    Ok(true)\n}\n\nfn print_result(response: lastfm_edit::EditResponse) {\n    if response.success() {\n        println!(\"âœ… Success!\");\n        if let Some(message) = response.message() {\n            println!(\"ğŸ“‹ {message}\");\n        }\n    } else {\n        println!(\"âŒ Operation failed\");\n        if let Some(message) = response.message() {\n            println!(\"ğŸ“‹ {message}\");\n        }\n    }\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","save_album_response.rs"],"content":"#[path = \"shared/common.rs\"]\nmod common;\n\nuse lastfm_edit::Result;\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c()\u003e {\n    let client = common::setup_client().await?;\n\n    // Test the URL construction manually to see what's wrong\n    let artist = \"Radiohead\";\n    let album = \"In Rainbows\";\n\n    // Get the session details to construct URLs manually\n    let session = client.get_session();\n    println!(\"Username: {}\", session.username);\n    println!(\"Base URL: {}\", session.base_url);\n\n    // Construct the URL we're using\n    let url = format!(\n        \"{}/user/{}/library/music/{}/{}/+tracks?page=1\u0026ajax=true\",\n        session.base_url,\n        session.username,\n        artist.replace(\" \", \"+\"),\n        album.replace(\" \", \"+\")\n    );\n\n    println!(\"Constructed URL: {url}\");\n\n    // Let's also try some variations (manually encoded):\n    let artist_encoded = artist.replace(\" \", \"%20\");\n    let album_encoded = album.replace(\" \", \"%20\");\n    let url_encoded = format!(\n        \"{}/user/{}/library/music/{}/{}/+tracks?page=1\u0026ajax=true\",\n        session.base_url, session.username, artist_encoded, album_encoded\n    );\n\n    println!(\"URL encoded version: {url_encoded}\");\n\n    // Test with a manually constructed HTTP client to see what we get\n    println!(\"\\nMaking direct HTTP request to see response...\");\n\n    // Make the request using the client's internal HTTP client\n    // We'll access this by making the client call directly and examining response\n    match client.get_album_tracks_page(album, artist, 1).await {\n        Ok(tracks_page) =\u003e {\n            println!(\"Success: {} tracks\", tracks_page.tracks.len());\n        }\n        Err(e) =\u003e {\n            println!(\"Error: {e}\");\n        }\n    }\n\n    // Let's also check what a working artist tracks URL looks like for comparison\n    let artist_tracks_url = format!(\n        \"{}/user/{}/library/music/{}/+tracks?page=1\u0026ajax=true\",\n        session.base_url,\n        session.username,\n        artist.replace(\" \", \"+\")\n    );\n    println!(\"Artist tracks URL (working): {artist_tracks_url}\");\n\n    // And albums URL\n    let artist_albums_url = format!(\n        \"{}/user/{}/library/music/{}/+albums?page=1\u0026ajax=true\",\n        session.base_url,\n        session.username,\n        artist.replace(\" \", \"+\")\n    );\n    println!(\"Artist albums URL (working): {artist_albums_url}\");\n\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","session_event_sharing.rs"],"content":"use lastfm_edit::{ClientEvent, LastFmEditClientImpl};\nuse std::env;\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c(), Box\u003cdyn std::error::Error\u003e\u003e {\n    env_logger::init();\n\n    let username =\n        env::var(\"LASTFM_EDIT_USERNAME\").expect(\"Set LASTFM_EDIT_USERNAME environment variable\");\n    let password =\n        env::var(\"LASTFM_EDIT_PASSWORD\").expect(\"Set LASTFM_EDIT_PASSWORD environment variable\");\n\n    println!(\"ğŸ”§ Demonstrating shared event broadcasting between clients...\");\n\n    // Create HTTP client and login to create first client\n    let http_client = http_client::native::NativeClient::new();\n    println!(\"ğŸ” Logging in with client1...\");\n    let client1 =\n        LastFmEditClientImpl::login_with_credentials(Box::new(http_client), \u0026username, \u0026password)\n            .await?;\n    println!(\"âœ… Successfully logged in as: {}\", client1.username());\n\n    // Create a second client that shares the broadcaster with client1\n    let http_client2 = http_client::native::NativeClient::new();\n    let client2 = client1.with_shared_broadcaster(Box::new(http_client2));\n    println!(\"ğŸ”„ Created client2 with shared broadcaster from client1\");\n\n    // Subscribe to events from both clients\n    let mut events1 = client1.subscribe();\n    let mut events2 = client2.subscribe();\n    println!(\"ğŸ“¡ Subscribed to events from both clients\");\n\n    // Spawn background tasks to monitor events from each client\n    let monitor1 = tokio::spawn(async move {\n        println!(\"ğŸ” Client1 monitor started\");\n        while let Ok(event) = events1.recv().await {\n            match event {\n                ClientEvent::RequestStarted { request } =\u003e {\n                    println!(\n                        \"ğŸš€ Client1 monitor: Started request {}\",\n                        request.short_description()\n                    );\n                }\n                ClientEvent::RequestCompleted {\n                    request,\n                    status_code,\n                    duration_ms,\n                } =\u003e {\n                    println!(\n                        \"âœ… Client1 monitor: Completed {} - {} ({} ms)\",\n                        request.short_description(),\n                        status_code,\n                        duration_ms\n                    );\n                }\n                ClientEvent::RateLimited {\n                    delay_seconds,\n                    request,\n                    rate_limit_type,\n                    rate_limit_timestamp,\n                } =\u003e {\n                    let req_desc = request\n                        .as_ref()\n                        .map(|r| r.short_description())\n                        .unwrap_or_else(|| \"unknown request\".to_string());\n                    println!(\n                        \"â³ Client1 monitor: Rate limited ({rate_limit_type:?}) for {delay_seconds} seconds - {req_desc} (at timestamp {rate_limit_timestamp})\"\n                    );\n                }\n                ClientEvent::RateLimitEnded {\n                    request,\n                    rate_limit_type,\n                    total_rate_limit_duration_seconds,\n                } =\u003e {\n                    println!(\n                        \"ğŸ‰ Client1 monitor: Rate limiting ended ({rate_limit_type:?}) after {total_rate_limit_duration_seconds} seconds - {}\",\n                        request.short_description()\n                    );\n                }\n                ClientEvent::EditAttempted {\n                    edit,\n                    success,\n                    error_message,\n                    duration_ms,\n                } =\u003e {\n                    if success {\n                        println!(\n                            \"âœ… Client1 monitor: Edit succeeded '{}' -\u003e '{}' ({duration_ms} ms)\",\n                            edit.track_name_original, edit.track_name\n                        );\n                    } else {\n                        let error_msg = error_message\n                            .as_ref()\n                            .map(|s| format!(\" - {s}\"))\n                            .unwrap_or_default();\n                        println!(\n                            \"âŒ Client1 monitor: Edit failed '{}' -\u003e '{}' ({duration_ms} ms){error_msg}\",\n                            edit.track_name_original, edit.track_name\n                        );\n                    }\n                }\n            }\n        }\n    });\n\n    let monitor2 = tokio::spawn(async move {\n        println!(\"ğŸ” Client2 monitor started\");\n        while let Ok(event) = events2.recv().await {\n            match event {\n                ClientEvent::RequestStarted { request } =\u003e {\n                    println!(\n                        \"ğŸš€ Client2 monitor: Started request {}\",\n                        request.short_description()\n                    );\n                }\n                ClientEvent::RequestCompleted {\n                    request,\n                    status_code,\n                    duration_ms,\n                } =\u003e {\n                    println!(\n                        \"âœ… Client2 monitor: Completed {} - {} ({} ms)\",\n                        request.short_description(),\n                        status_code,\n                        duration_ms\n                    );\n                }\n                ClientEvent::RateLimited {\n                    delay_seconds,\n                    request,\n                    rate_limit_type,\n                    rate_limit_timestamp,\n                } =\u003e {\n                    let req_desc = request\n                        .as_ref()\n                        .map(|r| r.short_description())\n                        .unwrap_or_else(|| \"unknown request\".to_string());\n                    println!(\n                        \"â³ Client2 monitor: Rate limited ({rate_limit_type:?}) for {delay_seconds} seconds - {req_desc} (at timestamp {rate_limit_timestamp})\"\n                    );\n                }\n                ClientEvent::RateLimitEnded {\n                    request,\n                    rate_limit_type,\n                    total_rate_limit_duration_seconds,\n                } =\u003e {\n                    println!(\n                        \"ğŸ‰ Client2 monitor: Rate limiting ended ({rate_limit_type:?}) after {total_rate_limit_duration_seconds} seconds - {}\",\n                        request.short_description()\n                    );\n                }\n                ClientEvent::EditAttempted {\n                    edit,\n                    success,\n                    error_message,\n                    duration_ms,\n                } =\u003e {\n                    if success {\n                        println!(\n                            \"âœ… Client2 monitor: Edit succeeded '{}' -\u003e '{}' ({duration_ms} ms)\",\n                            edit.track_name_original, edit.track_name\n                        );\n                    } else {\n                        let error_msg = error_message\n                            .as_ref()\n                            .map(|s| format!(\" - {s}\"))\n                            .unwrap_or_default();\n                        println!(\n                            \"âŒ Client2 monitor: Edit failed '{}' -\u003e '{}' ({duration_ms} ms){error_msg}\",\n                            edit.track_name_original, edit.track_name\n                        );\n                    }\n                }\n            }\n        }\n    });\n\n    // Make a request with client1 that might trigger rate limiting\n    println!(\"ğŸ“¡ Making request with client1...\");\n    match client1.get_recent_scrobbles(1).await {\n        Ok(tracks) =\u003e {\n            println!(\"âœ… Client1 got {} tracks\", tracks.len());\n        }\n        Err(e) =\u003e {\n            println!(\"âš ï¸ Client1 error: {e}\");\n        }\n    }\n\n    // Check latest event from both clients (should be the same due to shared broadcaster)\n    let event1 = client1.latest_event();\n    let event2 = client2.latest_event();\n\n    match (event1, event2) {\n        (\n            Some(ClientEvent::RateLimited {\n                delay_seconds: delay1,\n                ..\n            }),\n            Some(ClientEvent::RateLimited {\n                delay_seconds: delay2,\n                ..\n            }),\n        ) =\u003e {\n            println!(\"ğŸ¯ Both clients show rate limiting: {delay1}s and {delay2}s\");\n            if delay1 == delay2 {\n                println!(\n                    \"âœ… SUCCESS: Both clients report the same delay (shared broadcaster working!)\"\n                );\n            } else {\n                println!(\"âŒ UNEXPECTED: Different delays reported\");\n            }\n        }\n        (\n            Some(ClientEvent::RequestCompleted { .. }),\n            Some(ClientEvent::RequestCompleted { .. }),\n        ) =\u003e {\n            println!(\"âœ… Both clients show completed requests (shared broadcaster working!)\");\n        }\n        (\n            Some(ClientEvent::EditAttempted {\n                success: success1, ..\n            }),\n            Some(ClientEvent::EditAttempted {\n                success: success2, ..\n            }),\n        ) =\u003e {\n            if success1 == success2 {\n                println!(\"âœ… Both clients show same edit result (shared broadcaster working!)\");\n            } else {\n                println!(\"âŒ UNEXPECTED: Different edit results reported\");\n            }\n        }\n        (None, None) =\u003e {\n            println!(\"ğŸ“Š No events occurred yet - this is normal\");\n            println!(\"    In real usage, both clients would see the same events when they occur\");\n        }\n        _ =\u003e {\n            println!(\"ğŸ“Š Different event states between clients (could be due to timing)\");\n        }\n    }\n\n    // Let monitors run for a bit\n    tokio::time::sleep(std::time::Duration::from_secs(1)).await;\n\n    // Clean up\n    monitor1.abort();\n    monitor2.abort();\n\n    println!(\"ğŸ Demo completed!\");\n\n    println!(\"\\nğŸ“„ Key Points:\");\n    println!(\"  â€¢ client1.with_shared_broadcaster() creates clients that share event broadcasting\");\n    println!(\"  â€¢ When any shared client encounters rate limiting, all see the same events\");\n    println!(\"  â€¢ Use this pattern when you need multiple HTTP clients but want unified rate limit handling\");\n    Ok(())\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","session_management.rs"],"content":"/// Example demonstrating both login and session restore initialization methods.\n///\n/// This example shows how to:\n/// 1. Initialize a client with username/password login\n/// 2. Save the session state to a file\n/// 3. Restore the session from the saved file\n/// 4. Use both initialization patterns\n///\n/// Usage:\n///   # First run - will prompt for credentials and save session\n///   direnv exec . cargo run --example session_management\n///\n///   # Subsequent runs - will use saved session\n///   direnv exec . cargo run --example session_management\nuse lastfm_edit::{LastFmEditClient, LastFmEditClientImpl, LastFmEditSession, Result};\nuse std::env;\nuse std::fs;\nuse std::io::{self, Write};\nuse std::path::Path;\n\nconst SESSION_FILE: \u0026str = \"session.json\";\n\n#[tokio::main]\nasync fn main() -\u003e Result\u003c()\u003e {\n    env_logger::init();\n\n    println!(\"ğŸµ Last.fm Session Management Example\");\n    println!(\"=====================================\\n\");\n\n    // Try to load existing session first\n    if Path::new(SESSION_FILE).exists() {\n        println!(\"ğŸ“ Found existing session file, attempting to restore...\");\n        match restore_from_session().await {\n            Ok(client) =\u003e {\n                println!(\"âœ… Session restored successfully!\");\n                println!(\"ğŸ‘¤ Logged in as: {}\", client.username());\n\n                // Test the restored session by fetching recent tracks\n                println!(\"ğŸ§ Testing session by fetching recent tracks...\");\n                let tracks = client.get_recent_scrobbles(1).await?;\n                let recent_tracks: Vec\u003c_\u003e = tracks.into_iter().take(3).collect();\n                println!(\"ğŸ“Š Found {} recent tracks:\", recent_tracks.len());\n\n                for track in recent_tracks {\n                    println!(\"   ğŸµ {} - {}\", track.artist, track.name);\n                }\n\n                return Ok(());\n            }\n            Err(e) =\u003e {\n                println!(\"âŒ Failed to restore session: {e}\");\n                println!(\"ğŸ”„ Falling back to fresh login...\\n\");\n                // Remove invalid session file\n                let _ = fs::remove_file(SESSION_FILE);\n            }\n        }\n    }\n\n    // No valid session found, perform fresh login\n    println!(\"ğŸ”‘ No valid session found, performing fresh login...\");\n    let client = login_with_credentials().await?;\n    println!(\"âœ… Login successful!\");\n    println!(\"ğŸ‘¤ Logged in as: {}\", client.username());\n\n    // Save session for future use\n    println!(\"ğŸ’¾ Saving session to {SESSION_FILE}...\");\n    save_session(\u0026client)?;\n    println!(\"âœ… Session saved!\");\n\n    // Test the new session\n    println!(\"ğŸ§ Testing session by fetching recent tracks...\");\n    let tracks = client.get_recent_scrobbles(1).await?;\n    let recent_tracks: Vec\u003c_\u003e = tracks.into_iter().take(3).collect();\n    println!(\"ğŸ“Š Found {} recent tracks:\", recent_tracks.len());\n\n    for track in recent_tracks {\n        println!(\"   ğŸµ {} - {}\", track.artist, track.name);\n    }\n\n    println!(\"\\nğŸ‰ Example completed!\");\n    println!(\"ğŸ’¡ Next time you run this example, it will use the saved session automatically.\");\n\n    Ok(())\n}\n\n/// Restore client from saved session file\nasync fn restore_from_session() -\u003e Result\u003cLastFmEditClientImpl\u003e {\n    let session_json = fs::read_to_string(SESSION_FILE)\n        .map_err(|e| lastfm_edit::LastFmError::Http(format!(\"Failed to read session file: {e}\")))?;\n\n    let session = LastFmEditSession::from_json(\u0026session_json)\n        .map_err(|e| lastfm_edit::LastFmError::Http(format!(\"Failed to parse session: {e}\")))?;\n\n    if !session.is_valid() {\n        return Err(lastfm_edit::LastFmError::Auth(\n            \"Invalid session data\".to_string(),\n        ));\n    }\n\n    let http_client = http_client::native::NativeClient::new();\n    Ok(LastFmEditClientImpl::from_session(\n        Box::new(http_client),\n        session,\n    ))\n}\n\n/// Perform fresh login with credentials\nasync fn login_with_credentials() -\u003e Result\u003cLastFmEditClientImpl\u003e {\n    println!(\"ğŸ”§ Using login with credentials pattern...\");\n    let username = get_username();\n    let password = get_password();\n\n    let http_client = http_client::native::NativeClient::new();\n    LastFmEditClientImpl::login_with_credentials(Box::new(http_client), \u0026username, \u0026password).await\n}\n\n/// Save current session to file\nfn save_session(client: \u0026dyn LastFmEditClient) -\u003e Result\u003c()\u003e {\n    let session = client.get_session();\n    let session_json = session\n        .to_json()\n        .map_err(|e| lastfm_edit::LastFmError::Http(format!(\"Failed to serialize session: {e}\")))?;\n\n    fs::write(SESSION_FILE, session_json).map_err(|e| {\n        lastfm_edit::LastFmError::Http(format!(\"Failed to write session file: {e}\"))\n    })?;\n\n    Ok(())\n}\n\n/// Get username from environment variable or prompt\nfn get_username() -\u003e String {\n    env::var(\"LASTFM_EDIT_USERNAME\").unwrap_or_else(|_| {\n        print!(\"Last.fm username: \");\n        io::stdout().flush().unwrap();\n        let mut input = String::new();\n        io::stdin().read_line(\u0026mut input).unwrap();\n        input.trim().to_string()\n    })\n}\n\n/// Get password from environment variable or prompt\nfn get_password() -\u003e String {\n    env::var(\"LASTFM_EDIT_PASSWORD\").unwrap_or_else(|_| {\n        print!(\"Last.fm password: \");\n        io::stdout().flush().unwrap();\n        let mut input = String::new();\n        io::stdin().read_line(\u0026mut input).unwrap();\n        input.trim().to_string()\n    })\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","shared","common.rs"],"content":"use lastfm_edit::{LastFmEditClientImpl, Result};\nuse std::env;\n\npub async fn setup_client() -\u003e Result\u003cLastFmEditClientImpl\u003e {\n    // Initialize logger to handle log::debug! calls\n    env_logger::init();\n\n    let username = env::var(\"LASTFM_EDIT_USERNAME\")\n        .expect(\"LASTFM_EDIT_USERNAME environment variable not set\");\n    let password = env::var(\"LASTFM_EDIT_PASSWORD\")\n        .expect(\"LASTFM_EDIT_PASSWORD environment variable not set\");\n\n    // Login and create client\n    let http_client = http_client::native::NativeClient::new();\n    println!(\"Logging in as {username}...\");\n    let client =\n        LastFmEditClientImpl::login_with_credentials(Box::new(http_client), \u0026username, \u0026password)\n            .await?;\n    println!(\"âœ“ Logged in successfully\");\n\n    Ok(client)\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","examples","smart_scrobble_display.rs"],"content":"use lastfm_edit::{ExactScrobbleEdit, ScrobbleEdit};\n\nfn main() {\n    println!(\"=== Smart ScrobbleEdit Display Examples ===\\n\");\n\n    // Example 1: Only changing the artist name\n    let edit1 = ScrobbleEdit {\n        artist_name_original: \"The Beatles\".to_string(),\n        track_name_original: Some(\"Yesterday\".to_string()),\n        album_name_original: Some(\"Help!\".to_string()),\n        album_artist_name_original: None,\n\n        artist_name: \"Beatles, The\".to_string(),   // Changed\n        track_name: Some(\"Yesterday\".to_string()), // Same\n        album_name: Some(\"Help!\".to_string()),     // Same\n        album_artist_name: None,                   // Same\n\n        timestamp: None,\n        edit_all: false,\n    };\n    println!(\"ğŸ“ Artist name change:\");\n    println!(\"   {edit1}\");\n\n    // Example 2: Changing track and album names\n    let edit2 = ScrobbleEdit {\n        artist_name_original: \"Pink Floyd\".to_string(),\n        track_name_original: Some(\"Shine on You Crazy Diamond\".to_string()),\n        album_name_original: Some(\"Wish You Were Here\".to_string()),\n        album_artist_name_original: None,\n\n        artist_name: \"Pink Floyd\".to_string(), // Same\n        track_name: Some(\"Shine On You Crazy Diamond\".to_string()), // Changed\n        album_name: Some(\"Wish You Were Here (Remastered)\".to_string()), // Changed\n        album_artist_name: None,               // Same\n\n        timestamp: Some(1640995200),\n        edit_all: true,\n    };\n    println!(\"\\nğŸ“ Track and album changes:\");\n    println!(\"   {edit2}\");\n\n    // Example 3: Adding album artist information\n    let edit3 = ScrobbleEdit {\n        artist_name_original: \"Various Artists\".to_string(),\n        track_name_original: Some(\"Hotel California\".to_string()),\n        album_name_original: Some(\"Greatest Hits Collection\".to_string()),\n        album_artist_name_original: None,\n\n        artist_name: \"Eagles\".to_string(),                // Changed\n        track_name: Some(\"Hotel California\".to_string()), // Same\n        album_name: Some(\"Hotel California\".to_string()), // Changed\n        album_artist_name: Some(\"Eagles\".to_string()),    // Added\n\n        timestamp: None,\n        edit_all: false,\n    };\n    println!(\"\\nğŸ“ Multiple changes including adding
