    /// Create config with custom delays\n    pub fn with_delays(edit_delay_ms: u64, delete_delay_ms: u64) -\u003e Self {\n        Self {\n            edit_delay_ms,\n            delete_delay_ms,\n        }\n    }\n}\n\n/// Unified configuration for retry behavior and rate limiting\n#[derive(Debug, Clone, PartialEq, Eq, Default)]\npub struct ClientConfig {\n    /// Retry configuration\n    pub retry: RetryConfig,\n    /// Rate limit detection configuration\n    pub rate_limit: RateLimitConfig,\n    /// Operational delay configuration\n    pub operational_delays: OperationalDelayConfig,\n}\n\nimpl ClientConfig {\n    /// Create a new config with default settings\n    pub fn new() -\u003e Self {\n        Self::default()\n    }\n\n    /// Create config with retries disabled\n    pub fn with_retries_disabled() -\u003e Self {\n        Self {\n            retry: RetryConfig::disabled(),\n            rate_limit: RateLimitConfig::default(),\n            operational_delays: OperationalDelayConfig::default(),\n        }\n    }\n\n    /// Create config with rate limit detection disabled\n    pub fn with_rate_limiting_disabled() -\u003e Self {\n        Self {\n            retry: RetryConfig::default(),\n            rate_limit: RateLimitConfig::disabled(),\n            operational_delays: OperationalDelayConfig::default(),\n        }\n    }\n\n    /// Create config with both retries and rate limiting disabled\n    pub fn minimal() -\u003e Self {\n        Self {\n            retry: RetryConfig::disabled(),\n            rate_limit: RateLimitConfig::disabled(),\n            operational_delays: OperationalDelayConfig::default(),\n        }\n    }\n\n    /// Create config optimized for testing (rate limit detection enabled, retries enabled but no delays)\n    pub fn for_testing() -\u003e Self {\n        Self {\n            retry: RetryConfig {\n                max_retries: 3,\n                base_delay: 0, // No delay for fast tests\n                max_delay: 0,  // No delay for fast tests\n                enabled: true,\n            },\n            rate_limit: RateLimitConfig::default(), // Keep detection enabled\n            operational_delays: OperationalDelayConfig::no_delays(),\n        }\n    }\n\n    /// Set custom retry configuration\n    pub fn with_retry_config(mut self, retry_config: RetryConfig) -\u003e Self {\n        self.retry = retry_config;\n        self\n    }\n\n    /// Set custom rate limit configuration\n    pub fn with_rate_limit_config(mut self, rate_limit_config: RateLimitConfig) -\u003e Self {\n        self.rate_limit = rate_limit_config;\n        self\n    }\n\n    /// Set custom operational delay configuration\n    pub fn with_operational_delays(mut self, operational_delays: OperationalDelayConfig) -\u003e Self {\n        self.operational_delays = operational_delays;\n        self\n    }\n\n    /// Set custom retry count\n    pub fn with_max_retries(mut self, max_retries: u32) -\u003e Self {\n        self.retry.max_retries = max_retries;\n        self.retry.enabled = max_retries \u003e 0;\n        self\n    }\n\n    /// Set custom retry delays\n    pub fn with_retry_delays(mut self, base_delay: u64, max_delay: u64) -\u003e Self {\n        self.retry.base_delay = base_delay;\n        self.retry.max_delay = max_delay;\n        self\n    }\n\n    /// Add custom rate limit patterns\n    pub fn with_custom_rate_limit_patterns(mut self, patterns: Vec\u003cString\u003e) -\u003e Self {\n        self.rate_limit.custom_patterns = patterns;\n        self\n    }\n\n    /// Enable/disable HTTP status code rate limit detection\n    pub fn with_status_detection(mut self, enabled: bool) -\u003e Self {\n        self.rate_limit.detect_by_status = enabled;\n        self\n    }\n\n    /// Enable/disable response pattern rate limit detection\n    pub fn with_pattern_detection(mut self, enabled: bool) -\u003e Self {\n        self.rate_limit.detect_by_patterns = enabled;\n        self\n    }\n}\n\n/// Configuration for retry behavior\n#[derive(Debug, Clone, PartialEq, Eq)]\npub struct RetryConfig {\n    /// Maximum number of retry attempts (set to 0 to disable retries)\n    pub max_retries: u32,\n    /// Base delay for exponential backoff (in seconds)\n    pub base_delay: u64,\n    /// Maximum delay cap (in seconds)\n    pub max_delay: u64,\n    /// Whether retries are enabled at all\n    pub enabled: bool,\n}\n\nimpl Default for RetryConfig {\n    fn default() -\u003e Self {\n        Self {\n            max_retries: 3,\n            base_delay: 5,\n            max_delay: 300, // 5 minutes\n            enabled: true,\n        }\n    }\n}\n\nimpl RetryConfig {\n    /// Create a config with retries disabled\n    pub fn disabled() -\u003e Self {\n        Self {\n            max_retries: 0,\n            base_delay: 5,\n            max_delay: 300,\n            enabled: false,\n        }\n    }\n\n    /// Create a config with custom retry count\n    pub fn with_retries(max_retries: u32) -\u003e Self {\n        Self {\n            max_retries,\n            enabled: max_retries \u003e 0,\n            ..Default::default()\n        }\n    }\n\n    /// Create a config with custom delays\n    pub fn with_delays(base_delay: u64, max_delay: u64) -\u003e Self {\n        Self {\n            base_delay,\n            max_delay,\n            ..Default::default()\n        }\n    }\n}\n\n/// Result of a retry operation with context\n#[derive(Debug)]\npub struct RetryResult\u003cT\u003e {\n    /// The successful result\n    pub result: T,\n    /// Number of retry attempts made\n    pub attempts_made: u32,\n    /// Total time spent retrying (in seconds)\n    pub total_retry_time: u64,\n}\n\n// ================================================================================================\n// EVENT SYSTEM\n// ================================================================================================\n\n/// Request information for client events\n#[derive(Clone, Debug, PartialEq, Eq, Hash, Serialize, Deserialize)]\npub        path,\n        }\n    }\n\n    /// Get a short description of the request for logging\n    pub fn short_description(\u0026self) -\u003e String {\n        let mut desc = format!(\"{} {}\", self.method, self.path);\n        if !self.query_params.is_empty() {\n            let params: Vec\u003cString\u003e = self\n                .query_params\n                .iter()\n                .map(|(k, v)| format!(\"{k}={v}\"))\n                .collect();\n            if params.len() \u003c= 2 {\n                desc.push_str(\u0026format!(\"?{}\", params.join(\"\u0026\")));\n            } else {\n                desc.push_str(\u0026format!(\"?{}...\", params[0]));\n            }\n        }\n        desc\n    }\n}\n\n/// Type of rate limiting detected\n#[derive(Clone, Debug, PartialEq, Eq, Hash, Serialize, Deserialize)]\npub enum RateLimitType {\n    /// HTTP 429 Too Many Requests\n    Http429,\n    /// HTTP 403 Forbidden (likely rate limiting)\n    Http403,\n    /// Rate limit patterns detected in response body\n    ResponsePattern,\n}\n\n/// Event type to describe internal HTTP client activity\n#[derive(Clone, Debug, PartialEq, Serialize, Deserialize)]\npub enum ClientEvent {\n    /// Request started\n    RequestStarted {\n        /// Request details\n        request: RequestInfo,\n    },\n    /// Request completed successfully\n    RequestCompleted {\n        /// Request details\n        request: RequestInfo,\n        /// HTTP status code\n        status_code: u16,\n        /// Duration of the request in milliseconds\n        duration_ms: u64,\n    },\n    /// Rate limiting detected with backoff duration in seconds\n    RateLimited {\n        /// Duration to wait in seconds\n        delay_seconds: u64,\n        /// Request that triggered the rate limit (if available)\n        request: Option\u003cRequestInfo\u003e,\n        /// Type of rate limiting detected\n        rate_limit_type: RateLimitType,\n        /// Timestamp when the rate limit was detected (seconds sinc );\n            return false;\n        }\n\n        if self.match_url \u0026\u0026 request.url().to_string() != recorded_request.url {\n            log::debug!(\n                \"URL mismatch: {} != {}\",\n                request.url(),\n                recorded_request.url\n            );\n            return false;\n        }\n\n        // For Last.fm, we explicitly ignore unstable headers that change between sessions\n        // This includes cookies, session tokens, CSRF tokens, and other ephemeral data\n        let unstable_headers = [\n            \"cookie\",\n            \"set-cookie\",\n            \"authorization\",\n            \"x-csrf-token\",\n            \"csrf-token\",\n            \"sessionid\",\n            \"session\",\n            \"x-session-id\",\n            \"x-auth-token\",\n            \"auth-token\",\n        ];\n\n        // Match on all headers EXCEPT the unstable ones\n        log::debug!(\"Checking headers (ignoring unstable ones)\");\n        for (header_name, recorded_values) in \u0026recorded_request.headers {\n            let header_lower = header_name.to_lowercase();\n\n            // Skip unstable headers\n            if unstable_headers\n                .iter()\n                .any(|unstable| header_lower.contains(unstable))\n            {\n                log::debug!(\"Skipping unstable header: {header_name}\");\n                continue;\n            }\n\n            let request_header = request.header(header_name.as_str());\n            log::debug!(\n                \"Comparing stable header '{header_name}': request={:?}, recorded={recorded_values:?}\",\n                request_header.map(|v| v.iter().map(|h| h.as_str()).collect::\u003cVec\u003c_\u003e\u003e())\n            );\n\n            match request_header {\n                Some(req_val) =\u003e {\n                    let req_values: Vec\u003cString\u003e =\n                        req_val.iter().map(|v| v.as_str().to_string()).collect();\n                    if \u0026req_values != recorded_values {\n                        log::debug!(\n                            \"Header '{header_name}' values mismatch: {req_values:?} != {recorded_values:?}\"\n                        );\n                        return false;\n                    }\n                }\n                None =\u003e {\n                    // If the recorded request has a header but the current request doesn't,\n                    // that's a mismatch (unless it's an unstable header we're ignoring)\n                    log::debug!(\"Header '{header_name}' missing from request\");\n                    return false;\n                }\n            }\n        }\n\n        log::debug!(\"Request matched successfully\");\n\n        true\n    }\n\n    fn matches_serializable(\n        \u0026self,\n        request: \u0026SerializableRequest,\n        recorded_request: \u0026SerializableRequest,\n    ) -\u003e bool {\n        log::debug!(\n            \"Matching serializable request: {} {} vs {} {}\",\n            request.method,\n            request.url,\n            recorded_request.method,\n            recorded_request.url\n        );\n        if self.match_method \u0026\u0026 request.method != recorded_request.method {\n            return false;\n        }\n\n        if self.match_url \u0026\u0026 request.url != recorded_request.url {\n            return false;\n        }\n\n        // Same logic as above - ignore unstable headers\n        let unstable_headers = [\n            \"cookie\",\n            \"set-cookie\",\n            \"authorization\",\n            \"x-csrf-token\",\n            \"csrf-token\",\n            \"sessionid\",\n            \"session\",\n            \"x-session-id\",\n            \"x-auth-token\",\n            \"auth-token\",\n        ];\n\n        // Match on all headers EXCEPT the unstable ones\n        log::debug!(\n            \"Checking {} recorded headers\",\n            recorded_request.headers.len()\n        );\n        for (header_name, recorded_values) in \u0026recorded_request.headers {\n            let header_lower = header_name.to_lowercase();\n\n            // Skip unstable headers\n            if unstable_headers\n                .iter()\n                .any(|unstable| header_lower.contains(unstable))\n            {\n                log::debug!(\"Skipping unstable header: {header_name}\");\n                continue;\n            }\n\n            log::debug!(\"Checking stable header: {header_name} = {recorded_values:?}\");\n\n            let request_header = request.headers.get(header_name);\n\n            match request_header {\n                Some(req_values) =\u003e {\n                    log::debug!(\n                        \"Comparing header '{header_name}': request={req_values:?} vs recorded={recorded_values:?}\"\n                    );\n                    if req_values != recorded_values {\n                        log::debug!(\n                            \"Header '{header_name}' MISMATCH! request={req_values:?} != {recorded_values:?}\"\n                        );\n                        return false;\n                    }\n                }\n                None =\u003e {\n                    // Some headers like content-type are automatically added by HTTP clients\n                    // but may not be present during replay. For GET requests, content-type is often optional.\n                    if header_name.to_lowercase() == \"content-type\" \u0026\u0026 request.method == \"GET\" {\n                        log::debug!(\"Ignoring missing content-type header for GET request\");\n                        continue;\n                    }\n\n                    // If the recorded request has a header but the current request doesn't,\n                    // that's a mismatch (unless it's an unstable header we're ignoring)\n                    log::debug!(\n                        \"Header '{header_name}' missing from current request (recorded has: {recorded_values:?})\"\n esponse set-cookie headers\n        if let Some(set_cookie_values) = response.headers.get_mut(\"set-cookie\") {\n            for set_cookie_header in set_cookie_values.iter_mut() {\n                if set_cookie_header.contains(\"sessionid=\") {\n                    *set_cookie_header = self.filter_set_cookie_session(set_cookie_header);\n                }\n            }\n        }\n    }\n}\n\nimpl LastFmPasswordOnlyFilter {\n    /// Filter session cookies from a cookie header string\n    fn filter_session_cookies(\u0026self, cookie_header: \u0026str) -\u003e String {\n        let mut filtered_cookies = Vec::new();\n\n        for cookie in cookie_header.split(';') {\n            let cookie = cookie.trim();\n            if cookie.starts_with(\"sessionid=\") {\n                // Replace session ID with test value\n                filtered_cookies.push(\"sessionid=test_session_id\");\n            } else {\n                filtered_cookies.push(cookie);\n            }\n        }\n\n        filtered_cookies.join(\"; \")\n    }\n\n    /// Filter session cookies from a set-cookie header string\n    fn filter_set_cookie_session(\u0026self, set_cookie_header: \u0026str) -\u003e String {\n        if set_cookie_header.starts_with(\"sessionid=\") {\n            // Extract everything after the session value up to the first semicolon or end\n            if let Some(semicolon_pos) = set_cookie_header.find(';') {\n                let attributes = \u0026set_cookie_header[semicolon_pos..];\n                format!(\"sessionid=test_session_id{attributes}\")\n            } else {\n                \"sessionid=test_session_id\".to_string()\n            }\n        } else {\n            set_cookie_header.to_string()\n        }\n    }\n}\n\n/// Create a Last.fm test filter chain that:\n/// - Keeps usernames and CSRF tokens intact (needed for proper request matching)\n/// - Filters passwords from request bodies with predictable test values\n/// - Filters session tokens with predictable test values\npub fn create_lastfm_test_filter_chain() -\u003e Result\u003cFilterChain, regex::Error\u003e {\n    let filter_chain = FilterChain::new().add_filter(Box::new(LastFmPasswordOnlyFilter));\n    Ok(filter_chain)\n}\n","traces":[{"line":11,"address":[5993877,5993120,5993871],"length":1,"stats":{"Line":0}},{"line":13,"address":[3063073],"length":1,"stats":{"Line":0}},{"line":14,"address":[3063244,3063139],"length":1,"stats":{"Line":0}},{"line":15,"address":[3063310],"length":1,"stats":{"Line":0}},{"line":18,"address":[5993495,5993844,5993423],"length":1,"stats":{"Line":0}},{"line":19,"address":[3063756,3063428,3063498],"length":1,"stats":{"Line":0}},{"line":20,"address":[3063621,3063649],"length":1,"stats":{"Line":0}},{"line":26,"address":[3063797,3063170],"length":1,"stats":{"Line":0}},{"line":27,"address":[3063813,3064099,3063867],"length":1,"stats":{"Line":0}},{"line":28,"address":[3063940,3063997],"length":1,"stats":{"Line":0}},{"line":33,"address":[3064435,3064112],"length":1,"stats":{"Line":0}},{"line":35,"address":[3064147],"length":1,"stats":{"Line":0}},{"line":36,"address":[3064211,3064259],"length":1,"stats":{"Line":0}},{"line":37,"address":[3064495,3064317],"length":1,"stats":{"Line":0}},{"line":38,"address":[3064357,3064469,3064409],"length":1,"stats":{"Line":0}},{"line":47,"address":[3064512,3065082,3065088],"length":1,"stats":{"Line":0}},{"line":48,"address":[3064563],"length":1,"stats":{"Line":0}},{"line":50,"address":[3064587,3064652],"length":1,"stats":{"Line":0}},{"line":51,"address":[5995035,5994919],"length":1,"stats":{"Line":0}},{"line":52,"address":[3064967],"length":1,"stats":{"Line":0}},{"line":54,"address":[5995137,5995177],"length":1,"stats":{"Line":0}},{"line":56,"address":[3065072,3065014],"length":1,"stats":{"Line":0}},{"line":60,"address":[5994936],"length":1,"stats":{"Line":0}},{"line":64,"address":[3065104],"length":1,"stats":{"Line":0}},{"line":65,"address":[3065169],"length":1,"stats":{"Line":0}},{"line":67,"address":[3065281,306 ent1.latest_event().is_none());\n    assert!(client2.latest_event().is_none());\n    assert!(client3.latest_event().is_none());\n\n    // In a real scenario, rate limit events would be broadcast automatically\n    // when HTTP requests encounter rate limiting. Since we can't easily simulate\n    // that in a unit test, we verify the structure is correct by checking that:\n\n    // 1. Clients with shared broadcasters have the same latest event state\n    // 2. Clients with independent broadcasters maintain separate state\n\n    // For now, we can only test that the event subscriptions are properly set up\n    // and that no events are present initially (which is correct)\n\n    // Test that subscriptions don't immediately have events\n    let no_event_1 = timeout(Duration::from_millis(10), events1.recv()).await;\n    let no_event_2 = timeout(Duration::from_millis(10), events2.recv()).await;\n    let no_event_3 = timeout(Duration::from_millis(10), events3.recv()).await;\n\n    // All should timeout (no events received)\n    assert!(no_event_1.is_err());\n    assert!(no_event_2.is_err());\n    assert!(no_event_3.is_err());\n}\n\n#[test_log::test(tokio::test)]\nasync fn test_session_sharing_vs_broadcaster_sharing() {\n    // Create first client\n    let http_client1 = NoOpClient::new();\n    let client1 = LastFmEditClientImpl::from_session(Box::new(http_client1), create_test_session());\n\n    // Client2: shares session but NOT broadcaster\n    let http_client2 = NoOpClient::new();\n    let session = client1.get_session();\n    let client2 = LastFmEditClientImpl::from_session(Box::new(http_client2), session);\n\n    // Client3: shares BOTH session and broadcaster\n    let http_client3 = NoOpClient::new();\n    let client3 = client1.with_shared_broadcaster(Box::new(http_client3));\n\n    // Verify session sharing\n    assert_eq!(\n        client1.get_session().base_url,\n        client2.get_session().base_url\n    );\n    assert_eq!(\n        client1.get_session().base_url,\n        client3.get_session().base_url\n    );\n\n    // All clients should start with no events\n    assert!(client1.latest_event().is_none());\n    assert!(client2.latest_event().is_none());\n    assert!(client3.latest_event().is_none());\n\n    // Subscribe to verify broadcast setup\n    let _events1 = client1.subscribe();\n    let _events2 = client2.subscribe();\n    let _events3 = client3.subscribe();\n\n    // Test passes if no panics occur - the broadcaster sharing is working correctly\n    // In real usage, when client1 or client3 encounter rate limits, both would see the events\n    // while client2 would not (since it has an independent broadcaster)\n}\n\n#[test_log::test]\nfn test_client_creation_patterns() {\n    // Pattern 1: Independent clients\n    let http_client1 = NoOpClient::new();\n    let client1 = LastFmEditClientImpl::from_session(Box::new(http_client1), create_test_session());\n\n    let http_client2 = NoOpClient::new();\n    let session = client1.get_session();\n    let client2 = LastFmEditClientImpl::from_session(Box::new(http_client2), session);\n\n    // These should be independent - same session but different broadcasters\n    assert_eq!(\n        client1.get_session().base_url,\n        client2.get_session().base_url\n    );\n\n    // Pattern 2: Shared broadcaster\n    let http_client3 = NoOpClient::new();\n    let client3 = client1.with_shared_broadcaster(Box::new(http_client3));\n\n    // These should share both session and broadcaster\n    assert_eq!(\n        client1.get_session().base_url,\n        client3.get_session().base_url\n    );\n\n    // Test that we can create subscriptions without issues\n    let _sub1 = client1.subscribe();\n    let _sub2 = client2.subscribe();\n    let _sub3 = client3.subscribe();\n}\n","traces":[],"covered":0,"coverable":0},{"path":["/","home","imalison","Projects","lastfm-edit","tests","mock_client.rs"],"content":"#[cfg(feature = \"mock\")]\nmod mock_tests {\n    use lastfm_edit::{\n        Album, AlbumPage, EditResponse, ExactScrobbleEdit, LastFmEditClient, MockLastFmEditClient,\n        Result, ScrobbleEdit, Track, TrackPage,\n    };\n    use mockall::predicate::*; // for eq(), any(), etc.\n\n    #[test_log::test(tokio::test)]\n    async fn test_mock_basic_functionality() -\u003e Result\u003c()\u003e {\n        let mut mock_client = MockLastFmEditClient::new();\n\n        mock_client\n            .expect_username()\n            .times(1)\n            .returning(|| \"testuser\".to_string());\n\n        // Use the mock as a trait object\n        let client: \u0026dyn LastFmEditClient = \u0026mock_client;\n\n        // Test username retrieval\n        assert_eq!(client.username(), \"testuser\");\n\n        Ok(())\n    }\n\n    #[test_log::test(tokio::test)]\n    async fn test_mock_edit_scrobble() -\u003e Result\u003c()\u003e {\n        let mut mock_client = MockLastFmEditClient::new();\n\n        let edit = ScrobbleEdit::new(\n            Some(\"Old Track\".to_string()),\n            Some(\"Old Album\".to_string()),\n            \"Old Artist\".to_string(),\n            Some(\"Old Artist\".to_string()),\n            Some(\"New Track\".to_string()),\n            Some(\"New Album\".to_string()),\n            \"New Artist\".to_string(),\n            Some(\"New Artist\".to_string()),\n            Some(1640995200),\n            false,\n        );\n\n        let expected_exact_edit = ExactScrobbleEdit::new(\n            \"Old Track\".to_string(),\n            \"Old Album\".to_string(),\n            \"Old Artist\".to_string(),\n            \"Old Artist\".to_string(),\n            \"New Track\".to_string(),\n            \"New Album\".to_string(),\n            \"New Artist\".to_string(),\n            \"New Artist\".to_string(),\n            1640995200,\n            false,\n        );\n\n        let expected_response = EditResponse::single(\n            true,\n            Some(\"Edit completed successfully\".to_string()),\n            None,\n            expected_exact_edit,\n        );\n\n        // Set up expectation for edit_scrobble\n        mock_client\n            .expect_edit_scrobble()\n            .with(eq(edit.clone()))\n            .times(1)\n            .returning(move |_| Ok(expected_response.clone()));\n\n        // Use the mock\n        let client: \u0026dyn LastFmEditClient = \u0026mock_client;\n        let response = client.edit_scrobble(\u0026edit).await?;\n\n        assert!(response.success());\n        assert_eq!(\n            response.message(),\n            Some(\"Edit completed successfully\".to_string())\n        );\n\n        Ok(())\n    }\n\n    #[test_log::test(tokio::test)]\n    async fn test_mock_get_recent_scrobbles() -\u003e Result\u003c()\u003e {\n        let mut mock_client = MockLastFmEditClient::new();\n\n        let expected_tracks = vec![\n            Track {\n                name: \"Test Track 1\".to_string(),\n                artist: \"Test Artist 1\".to_string(),\n                album: Some(\"Test Album 1\".to_string()),\n                album_artist: Some(\"Test Artist 1\".to_string()),\n                playcount: 5,\n                timestamp: Some(1640995200),\n            },\n            Track {\n                name: \"Test Track 2\".to_string(),\n                artist: \"Test Artist 2\".to_string(),\n                album: Some(\"Test Album 2\".to_string()),\n                album_artist: Some(\"Test Artist 2\".to_string()),\n                playcount: 3,\n                timestamp: Some(1640995100),\n            },\n        ];\n\n        // Set up expectation\n        mock_client\n            .expect_get_recent_tracks_page()\n            .with(eq(1))\n            .times(1)\n            .returning(move |page| {\n                Ok(TrackPage {\n                    tracks: expected_tracks.clone(),\n                    page_number: page,\n                    has_next_page: false,\n                    total_pages: Some(1),\n                })\n            });\n\n        // Use the mock\n        let client: \u0026dyn LastFmEditClient = \u0026mock_client;\n        let page = client.get_recent_tracks_page(1).await?;\n\n        assert_eq!(page.tracks.len(), 2);\n        assert_eq!(page.tracks[0].name, \"Test Track 1\");\n        assert_eq!(page.tracks[1].name, \"Test Track 2\");\n        assert_eq!(page.page_number, 1);\n\n        Ok(())\n    }\n\n    #[test_log::test(tokio::test)]\n    async fn test_mock_iterator_concept() -\u003e Result\u003c()\u003e {\n        // Note: Due to Rust's lifetime system, mocking iterators that borrow from\n        // the client is complex. In practice, you would typically mock the underlying\n        // pagination methods (like get_artist_tracks_page) rather than the iterators themselves.\n\n        let mut mock_client = MockLastFmEditClient::new();\n\n        // Mock the underlying pagination method that iterators use\n        mock_client\n            .expect_get_artist_tracks_page()\n            .with(eq(\"test_artist\"), eq(1))\n            .returning(|_, _| {\n                Ok(TrackPage {\n                    tracks: vec![Track {\n                        name: \"Mocked Track\".to_string(),\n                        artist: \"Mocked Artist\".to_string(),\n                        album: Some(\"Mocked Album\".to_string()),\n                        album_artist: Some(\"Mocked Artist\".to_string()),\n                        playcount: 10,\n                        timestamp: Some(1640995200),\n                    }],\n                    page_number: 1,\n                    has_next_page: false,\n                    total_pages: Some(1),\n                })\n            });\n\n        let client: \u0026dyn LastFmEditClient = \u0026mock_client;\n\n        // Test that the underlying method works correctly\n        let page = client.get_artist_tracks_page(\"test_artist\", 1).await?;\n        assert_eq!(page.tracks.len(), 1);\n        assert_eq!(page.tracks[0].name, \"Mocked Track\");\n\n        Ok(())\n    }\n\n    #[test_     <script>const e = React.createElement;

function pathToString(path) {
  if (path[0] === '/') {
    return '/' + path.slice(1).join('/');
  } else {
    return path.join('/');
  }
}

function findCommonPath(files) {
  if (!files || !files.length) {
    return [];
  }

  function isPrefix(arr, prefix) {
    if (arr.length < prefix.length) {
      return false;
    }
    for (let i = prefix.length - 1; i >= 0; --i) {
      if (arr[i] !== prefix[i]) {
        return false;
      }
    }
    return true;
  }

  let commonPath = files[0].path.slice(0, -1);
  while (commonPath.length) {
    if (files.every(file => isPrefix(file.path, commonPath))) {
      break;
    }
    commonPath.pop();
  }
  return commonPath;
}

function findFolders(files) {
  if (!files || !files.length) {
    return [];
  }

  let folders = files.filter(file => file.path.length > 1).map(file => file.path[0]);
  folders = [...new Set(folders)]; // unique
  folders.sort();

  folders = folders.map(folder => {
    let filesInFolder = files
      .filter(file => file.path[0] === folder)
      .map(file => ({
        ...file,
        path: file.path.slice(1),
        parent: [...file.parent, file.path[0]],
      }));

    const children = findFolders(filesInFolder); // recursion

    return {
      is_folder: true,
      path: [folder],
      parent: files[0].parent,
      children,
      covered: children.reduce((sum, file) => sum + file.covered, 0),
      coverable: children.reduce((sum, file) => sum + file.coverable, 0),
      prevRun: {
        covered: children.reduce((sum, file) => sum + file.prevRun.covered, 0),
        coverable: children.reduce((sum, file) => sum + file.prevRun.coverable, 0),
      }
    };
  });

  return [
    ...folders,
    ...files.filter(file => file.path.length === 1),
  ];
}

class App extends React.Component {
  constructor(...args) {
    super(...args);

    this.state = {
      current: [],
    };
  }

  componentDidMount() {
    this.updateStateFromLocation();
    window.addEventListener("hashchange", () => this.updateStateFromLocation(), false);
  }

  updateStateFromLocation() {
    if (window.location.hash.length > 1) {
      const current = window.location.hash.substr(1).split('/');
      this.setState({current});
    } else {
      this.setState({current: []});
    }
  }

  getCurrentPath() {
    let file = this.props.root;
    let path = [file];
    for (let p of this.state.current) {
      file = file.children.find(file => file.path[0] === p);
      if (!file) {
        return path;
      }
      path.push(file);
    }
    return path;
  }

  render() {
    const path = this.getCurrentPath();
    const file = path[path.length - 1];

    let w = null;
    if (file.is_folder) {
      w = e(FilesList, {
        folder: file,
        onSelectFile: this.selectFile.bind(this),
        onBack: path.length > 1 ? this.back.bind(this) : null,
      });
    } else {
      w = e(DisplayFile, {
        file,
        onBack: this.back.bind(this),
      });
    }

    return e('div', {className: 'app'}, w);
  }

  selectFile(file) {
    this.setState(({current}) => {
      return {current: [...current, file.path[0]]};
    }, () => this.updateHash());
  }

  back(file) {
    this.setState(({current}) => {
      return {current: current.slice(0, current.length - 1)};
    }, () => this.updateHash());
  }

  updateHash() {
    if (!this.state.current || !this.state.current.length) {
      window.location = '#';
    } else {
      window.location = '#' + this.state.current.join('/');
    }
  }
}

function FilesList({folder, onSelectFile, onBack}) {
  let files = folder.children;
  return e('div', {className: 'display-folder'},
    e(FileHeader, {file: folder, onBack}),
    e('table', {className: 'files-list'},
      e('thead', {className: 'files-list__head'},
        e('tr', null,
          e('th', null, "Path"),
          e('th', null, "Coverage")
        )
      ),
      e('tbody', {className: 'files-list__body'},
        files.map(file => e(File, {file, onClick: onSelectFile}))
      )
    )
  );
}

function File({file, onClick}) {
  const coverage = file.coverable ? file.covered / file.coverable * 100 : -1;
  const coverageDelta = file.prevRun &&
    (file.covered / file.coverable * 100 - file.prevRun.covered / file.prevRun.coverable * 100);

  return e('tr', {
      className: 'files-list__file'
        + (coverage >= 0 && coverage < 50 ? ' files-list__file_low': '')
        + (coverage >= 50 && coverage < 80 ? ' files-list__file_medium': '')
        + (coverage >= 80 ? ' files-list__file_high': '')
        + (file.is_folder ? ' files-list__file_folder': ''),
      onClick: () => onClick(file),
    },
    e('td', null, e('a', null, pathToString(file.path))),
    e('td', null,
      file.covered + ' / ' + file.coverable +
      (coverage >= 0 ? ' (' + coverage.toFixed(2) + '%)' : ''),
      e('span', {title: 'Change from the previous run'},
        (coverageDelta ? ` (${coverageDelta > 0 ? '+' : ''}${coverageDelta.toFixed(2)}%)` : ''))
    )
  );
}

function DisplayFile({file, onBack}) {
  return e('div', {className: 'display-file'},
    e(FileHeader, {file, onBack}),
    e(FileContent, {file})
  );
}

function FileHeader({file, onBack}) {
  const coverage = file.covered / file.coverable * 100;
  const coverageDelta = file.prevRun && (coverage - file.prevRun.covered / file.prevRun.coverable * 100);

  return e('div', {className: 'file-header'},
    onBack ? e('a', {className: 'file-header__back', onClick: onBack}, 'Back') : null,
    e('div', {className: 'file-header__name'}, pathToString([...file.parent, ...file.path])),
    e('div', {className: 'file-header__stat'},
      'Covered: ' + file.covered + ' of ' + file.coverable +
      (file.coverable ? ' (' + coverage.toFixed(2) + '%)' : ''),
      e('span', {title: 'Change from the previous run'},
        (coverageDelta ? ` (${coverageDelta > 0 ? '+' : ''}${coverageDelta.toFixed(2)}%)` : ''))
    )
  );
}

function FileContent({file}) {
  return e('pre', {className: 'file-content'},
    file.content.split(/\r?\n/).map((line, index) => {
      const trace = file.traces.find(trace => trace.line === index + 1);
      const covered = trace && trace.stats.Line;
      const uncovered = trace && !trace.stats.Line;
      return e('code', {
          className: 'code-line'
            + (covered ? ' code-line_covered' : '')
            + (uncovered ? ' code-line_uncovered' : ''),
          title: trace ? JSON.stringify(trace.stats, null, 2) : null,
        }, line);
    })
  );
}

(function(){
  const commonPath = findCommonPath(data.files);
  const prevFilesMap = new Map();

  previousData && previousData.files.forEach((file) => {
    const path = file.path.slice(commonPath.length).join('/');
    prevFilesMap.set(path, file);
  });

  const files = data.files.map((file) => {
    const path = file.path.slice(commonPath.length);
    const { covered = 0, coverable = 0 } = prevFilesMap.get(path.join('/')) || {};
    return {
      ...file,
      path,
      parent: commonPath,
      prevRun: { covered, coverable },
    };
  });

  const children = findFolders(files);

  const root = {
    is_folder: true,
    children,
    path: commonPath,
    parent: [],
    covered: children.reduce((sum, file) => sum + file.covered, 0),
    coverable: children.reduce((sum, file) => sum + file.coverable, 0),
    prevRun: {
      covered: children.reduce((sum, file) => sum + file.prevRun.covered, 0),
      coverable: children.reduce((sum, file) => sum + file.prevRun.coverable, 0),
    }
  };

  ReactDOM.render(e(App, {root, prevFilesMap}), document.getElementById('root'));
}());
</script>
